B.O0=new A.R("            \nNeredeyse sineman\u0131n ba\u015flang\u0131c\u0131ndan beri korku filmleri vard\u0131. Var olan t\xfcm t\xfcrler aras\u0131nda korku, belki de en geleneksel olanlardan biridir. Bir\xe7ok korku filmi, izleyicilerini korkutmak i\xe7in mecazi kurgu olarak da adland\u0131r\u0131lan spesifik olay \xf6rg\xfclerine g\xfcvenir. Bir mecazi kurgu \xe7ok kullan\u0131ld\u0131\u011f\u0131nda kli\u015fe haline gelebilir. Ancak iyi kullan\u0131ld\u0131\u011f\u0131nda, yerimizden f\u0131rlamam\u0131za sebep olabilir. \u0130\u015fte korku filmlerinde en \xe7ok kullan\u0131lan ve belki de suistimal edilen kli\u015felerden baz\u0131lar\u0131.\nNe t\xfcr bir ev olursa olsun, bodrum korku filmlerinde korkutucu bir yerdir. Genellikle bir \u015feylerin sakland\u0131\u011f\u0131 veya k\xf6t\xfc psikopatlar\u0131n aletlerini saklad\u0131\u011f\u0131 yer buras\u0131d\u0131r. Bodrumlar her zaman karanl\u0131k ve genellikle nemlidir. Bodruma sadece dar bir merdivenden ula\u015fabilirsiniz. Ve bodrumlar, a\u015fa\u011f\u0131da hi\xe7bir \u015fey olmad\u0131\u011f\u0131nda bile her zaman \xfcrk\xfct\xfcc\xfcd\xfcr.\nEski korku filmlerinde, kahramanlar \xe7aresizlik i\xe7indeyken, yard\u0131m \xe7a\u011f\u0131rmalar\u0131 ya da polisi aramak zor ya da imkans\u0131zd\u0131. Cep telefonlar\u0131 bu durumu \u015fimdi biraz daha az inand\u0131r\u0131c\u0131 hale getiriyor. Peki gerginli\u011fi s\xfcrd\xfcrmenin \xe7\xf6z\xfcm\xfc nedir? Telefonun \xe7ekmemesi! Bir korku filminde ba\u015frolseniz, en \xf6nemli anda, tam da yard\u0131m \xe7a\u011f\u0131rman\u0131z gerekti\u011finde, hi\xe7bir \u015fekilde telefonunuzun \xe7ekmeyece\u011fi neredeyse kesindir. Veya tam aramay\u0131 yaparken telefonunuzun \u015farj\u0131 bitecektir. Ya da her ikisi de.\nKorku filmleri \u0131ss\u0131z yerleri sever. Bu terk edilmi\u015f bir hastane, korkun\xe7 bir bo\u015f ev veya hayalet bir kasaba olabilir. Yaln\u0131z, bo\u015f yerler \xe7ok ilgi \xe7ekicidir. \u0130nsanlar orada ya\u015farken nas\u0131ld\u0131? Neden ayr\u0131ld\u0131lar? Belki de \xe7ok sessiz olduklar\u0131ndand\u0131r, bu da \xe7ok korkutucu olabilir. Tabii ki, terk edilmi\u015f yerler korku filmi y\xf6netmenleri i\xe7in de kullan\u0131\u015fl\u0131d\u0131r, \xe7\xfcnk\xfc orada telefonunuzun \xe7ekmemesi daha inand\u0131r\u0131c\u0131d\u0131r.\nBa\u015frol saatlerce araba kullan\u0131yor. Gece oldu ve ya\u011fmur ya\u011fmaya ba\u015flad\u0131. Birden yolun kenar\u0131nda bir adam g\xf6r\xfcr. Belki de e\u015flik etmek onu uyan\u0131k tutabilir? Korku filmlerinde birini araban\u0131za almak bela aramakt\u0131r. Ba\u015frol bunu her zaman yapar ve sonu her zaman k\xf6t\xfc biter.\nBu korku filmi kli\u015fesi, \xf6zellikle 20. y\xfczy\u0131l\u0131n sonlar\u0131ndaki korku filmlerinde pop\xfclerdi. Bir grup gencin e\u011flenmesiyle ba\u015flar ve bir k\u0131z\u0131n d\u0131\u015f\u0131nda herkesin \xf6lmesiyle biter. Ba\u015flang\u0131\xe7ta k\u0131z genellikle masum, utanga\xe7t\u0131r ve g\xfc\xe7l\xfc de\u011fildir. Sonlara do\u011fru, d\xfcnyan\u0131n en sert ve en becerikli insan\u0131 olur. Sona kalan k\u0131z neredeyse her zaman sonunda kazan\u0131r.\n            ",null,B.u,null,null,null,null,null,null)
B.O2=new A.R("              \nDiyelim ki, d\xfcn ak\u015fam biz uyurken \u015fiddetli bir ya\u011fmur ya\u011fd\u0131 ve biz sabah uyanmadan bu ya\u011fmur kesildi. D\u0131\u015far\u0131ya \xe7\u0131k\u0131p bakt\u0131\u011f\u0131m\u0131zda ise ya\u011fmurun etkisiyle yerlerin \u0131slakl\u0131\u011f\u0131n\u0131 fark ettik. Fark edilece\u011fi \xfczere olay\u0131n kendisi, yani bizzat ya\u011fmur ya\u011fma eylemi bitse de bu olay\u0131n etkilerinin izleri hala g\xf6r\xfclmeye devam etmektedir.\n\n\u0130ngilizcede present perfect tense, ge\xe7mi\u015fte meydana gelmi\u015f ve bitmi\u015f ama etkileri hala devam eden ve meydana geli\u015f zaman\u0131 \xf6nemli olmayan olaylar\u0131 ifade etmek i\xe7in kullan\u0131lan zaman dilimidir.\n\nZaten T\xfcrk\xe7ede b\xf6ylesi olaylar\u0131n yak\u0131n ge\xe7mi\u015f olarak adland\u0131r\u0131lmas\u0131n\u0131n nedeni de budur; ge\xe7mi\u015fte ba\u015flam\u0131\u015f bir olay\u0131n kendisi bitse de bug\xfcnle ba\u011flant\u0131s\u0131 bir \u015fekilde devam etmektedir.\n\nHave yard\u0131mc\u0131 fiilinin kullan\u0131ld\u0131\u011f\u0131 present perfect tense\u2019de c\xfcmlenin ana fiil ise \xfc\xe7\xfcnc\xfc halini al\u0131r (have/has + V3). A\u015fa\u011f\u0131daki tabloda olumlu, olumsuz ve soru hallerinin yap\u0131l\u0131\u015f\u0131 g\xf6sterilmi\u015ftir.\n\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/you/we/they + have V3\nI/you/we/they + \u2018ve V3\nHe/she/it + has V3\nHe/she/it + \u2018s V3\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/you/we/they + have not V3\nI/you/we/they + haven\u2019t V3\nHe/she/it + has not V3\nHe/she/it + hasn\u2019t V3\n\n\u27a1\ufe0f Soru c\xfcmleleri\nHave + I/you/we/they + V3?\nHaven\u2019t + I/you/we/they + V3?\nHas + he/she/it + V3?\nHasn\u2019t + he/she/it + V3?\n\n\u2757 Present perfect tense ile sorulmu\u015f bir soruya Evet-Hay\u0131r \u015feklinde k\u0131sa cevaplar verirken:\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\nYes, I/you/we/they have.\nYes, I/you/we/they \u2018ve.\nYes, He/she/it + has.\nYes, He/she/it + \u2018s.\n\n\u2757 Evet-Hay\u0131r sorular\u0131na k\u0131sa evet cevaplar\u0131 k\u0131saltma ile verilmez.\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\nNo, I/you/we/they have.\nNo, I/you/we/they haven\u2019t.\nNo, he/she/it has not.\nNo, he/she/it hasn\u2019t.\n\n\nG\xfcndelik ya\u015famda s\u0131kl\u0131kla kar\u015f\u0131la\u015f\u0131labilecek olan yukar\u0131daki formlar\u0131n a\u015fa\u011f\u0131da telaffuzlar\u0131 verilmi\u015ftir. Bu telaffuzlar\u0131 \xf6\u011frenmek hem konu\u015fma hem dinleme becerileri i\xe7in olduk\xe7a faydal\u0131 olacakt\u0131r.\n\n\ud83d\udd0a have,\n\ud83d\udd0a I\u2019ve,\n\ud83d\udd0a have not,\n\ud83d\udd0a haven\u2019t,\n\ud83d\udd0a has,\n\ud83d\udd0a He\u2019s,\n\ud83d\udd0a has not,\n\ud83d\udd0a hasn\u2019t\n\u2757 Spesifik, ne zaman oldu\u011funu belirten net bir tarih kullan\u0131m\u0131 (yesterday, 3 years ago vs.) olursa simple past tense kullan\u0131l\u0131r.\n\nPresent Perfect Kullan\u0131m\u0131\n\u2b50 Ge\xe7mi\u015fte bir zamanda ba\u015flam\u0131\u015f ve hen\xfcz bitmemi\u015f non-progressive eylemler (know, want vb.) anlat\u0131l\u0131rken kullan\u0131l\u0131r. Normalde present perfect continuous tense ile anlat\u0131lmas\u0131 gerekirken ilgili eylemlerin -ing almamas\u0131 nedeniyle present perfect tense ile anlat\u0131lmaktad\u0131r. Bu gibi c\xfcmlelerde genellikle since ve for gibi zaman zarflar\u0131 bulunur.\n\nThey have known each other since 2000.\nThey have been knowing each other since 2000.\n2000 y\u0131l\u0131ndan beri birbirlerini tan\u0131yorlar.\n\n\u2b50 Ge\xe7mi\u015fte bir zamanda ba\u015flam\u0131\u015f ve bitmi\u015f olmas\u0131na ra\u011fmen etkileri ve sonu\xe7lar\u0131 hala g\xf6r\xfclebilen i\u015fleri anlat\u0131l\u0131rken kullan\u0131l\u0131r.\n\nMy friend has lost his wallet thus he is calling the police.\nArkada\u015f\u0131m c\xfczdan\u0131n\u0131 kaybetti, bu y\xfczden polisi ar\u0131yor.\nI have solved 20 questions so far.\n\u015eimdiye kadar 20 soru \xe7\xf6zd\xfcm.\nI have not seen him before.\nOnu daha \xf6nce g\xf6rmedim.\n\n\u2b50 Ge\xe7mi\u015fte bir zamanda ba\u015flam\u0131\u015f ve bitmi\u015f ki\u015fisel tecr\xfcbeleri anlatmak i\xe7in idealdir.\n\nI haven\u2019t tried ever Mexican food before.\nDaha \xf6nce hi\xe7 Meksika yeme\u011fi denemedim.\nLucy has visited Paris twice.\nLucy iki kez Paris\u2019i ziyaret etti.\nI\u2019ve watched \u201cLord of the Rings\u201d many times.\nY\xfcz\xfcklerin Efendisi\u2019ni defalarca izledim.\n\n\n\u2b50 Bahsi ge\xe7en eylemlerin hen\xfcz bitmemi\u015f bir zaman diliminde (bu ay, bu hafta, bug\xfcn) oldu\u011fu anlat\u0131l\u0131rken kullan\u0131l\u0131r.\n\nI have lived in London for ten years.\nOn y\u0131ld\u0131r Londra\u2019da ya\u015f\u0131yorum.\nThey\u2019ve known each other since 2000.\n2000 y\u0131l\u0131ndan beri birbirlerini tan\u0131yorlar.\nStudents have not seen their teacher this week.\n\xd6\u011frenciler bu hafta \xf6\u011fretmenlerini g\xf6rmediler.\nShe had already had three cups of coffee in less than an hour.\nBir saatten az bir s\xfcrede \u015fimdiden \xfc\xe7 fincan kahve i\xe7ti.\n\n\u2b50 Son zamanlarda vuku bulmu\u015f eylemler anlat\u0131l\u0131rken kullan\u0131l\u0131r.\n\nSomething called the corona epidemic has emerged.\nKorona salg\u0131n\u0131 denen bir \u015fey ortaya \xe7\u0131kt\u0131.\nIt\u2019s happened because of global warming.\nK\xfcresel \u0131s\u0131nma y\xfcz\xfcnden oldu.\n\n\u2b50 K\u0131sa bir zaman \xf6nce tamamlanm\u0131\u015f i\u015fleri g\xf6sterir.\n\nThey have just returned from a long journey.\nUzun bir yolculuktan yeni d\xf6nd\xfcler.\nI have just finished typing the report.\nRaporu yazmay\u0131 yeni bitirdim.\n\n\u2b50 Ge\xe7mi\u015fte belirsiz bir zamanda bir\xe7ok kez yap\u0131lm\u0131\u015f i\u015fleri anlat\u0131r.\n\nAnna has won the talent contest many times.\nAnna yetenek yar\u0131\u015fmas\u0131n\u0131 bir\xe7ok kez kazand\u0131.\nThomas has come back from the dead many times.\nThomas bir\xe7ok kez \xf6l\xfcmden d\xf6nd\xfc.\n\nPresent Perfect Tense ile Kullan\u0131lan Zarflar\nA\u015fa\u011f\u0131daki tabloda present pertfect tense ile s\u0131kl\u0131kla kullan\u0131lan zaman zarflar\u0131 derlenmi\u015ftir:\n\n\nup to now\t\u015fu ana kadar\nup till now\t\u015fimdiye kadar\nup to the present\t\u015fimdiye kadar, \u015fu ana kadar\nduring the last few years\tson birka\xe7 y\u0131lda\nduring the past few days/weeks/months\tson birka\xe7 g\xfcn/hafta/ay boyunca\nrecently\tge\xe7enlerde, yak\u0131nlarda, son g\xfcnlerde\nlately\tson zamanlarda, son g\xfcnlerde, ge\xe7enlerde\nfinally\tsonunda, nihayet\noften\ts\u0131k s\u0131k, \xe7o\u011fu kez, s\u0131k\xe7a\nmany times\tbir\xe7ok kez\njust\then\xfcz\nalready\t\xe7oktan\never\tasla, hi\xe7\nyet\then\xfcz, daha, yine de, h\xe2l\xe2, \u015fimdiye kadar\nnever\tasla, hi\xe7, hi\xe7bir zaman\nfor\t-den beri, -den itibaren, -den bu yana\nsince\t-den beri, -den itibaren, -den bu yana\never since\to zamandan beri\nas soon as\themen, -ince, -ir -mez\n\u0130ngilizcede Present Perfect Tense\nFor & Since\nFor ve since, present perfect tense ile en \xe7ok kullan\u0131lan zaman ifadelerindendir. For\u2018dan sonra bir zaman dilimi, since\u2018den sonra ise bir zaman noktas\u0131 kullan\u0131l\u0131r.\n\nfor + zaman dilimi\nsince + zaman noktas\u0131\n\nThey have worked here for\tseveral weeks\na few months\na long time\nThey have worked here since\tJanuary\nlast year\n2015\nthen\nthey got married\nJust\nK\u0131sa bir s\xfcre \xf6nce yap\u0131lm\u0131\u015f i\u015fleri anlat\u0131r.\n\nShe has just taken a shower.\nDaha yeni du\u015f ald\u0131.\nAlready\nBir i\u015fin halihaz\u0131rda yap\u0131lm\u0131\u015f oldu\u011funu anlat\u0131r.\n\nShe has already talked to him.\nOnunla \xe7oktan konu\u015ftu.\nYet\nOlumsuz c\xfcmlelerde ve sorularda kullan\u0131l\u0131r. Daha, hala, hen\xfcz anlam\u0131 vard\u0131r:\n\nShe hasn\u2019t talked to him yet.\nHen\xfcz onunla konu\u015fmad\u0131.\nHas she talked to him yet?\nOnunla hen\xfcz konu\u015fmad\u0131 m\u0131?\nEver\nOlumsuz c\xfcmlelerde ve sorularda kullan\u0131l\u0131r. E\u011fer soru c\xfcmlelerindeki cevap olumsuz ise never kullan\u0131l\u0131r.\n\nHave you ever met an honest politician?\nHi\xe7 d\xfcr\xfcst bir politikac\u0131yla tan\u0131\u015ft\u0131n\u0131z m\u0131?\nI have never met an honest politician.\nHi\xe7 d\xfcr\xfcst bir politikac\u0131yla tan\u0131\u015fmad\u0131m.\nOlumsuz c\xfcmlelerde \u201chi\xe7, \u015fimdiye kadar\u201d anlam\u0131nda kullan\u0131labilir.\n\nWe haven\u2019t ever had a problem with noise in the neighbourhood before.\nWe\u2019ve never had a problem with noise in the neighbourhood before.\nDaha \xf6nce mahallede g\xfcr\xfclt\xfc ile ilgili hi\xe7 bir sorunumuz olmam\u0131\u015ft\u0131.\nNever\nOlumlu c\xfcmleler ile kullan\u0131l\u0131p c\xfcmleyi olumsuz yapar. Present perfect tense ile \u201chi\xe7\u201d anlam\u0131yla kullan\u0131labilmektedir.\n\nI have never seen such a thing before.\nDaha \xf6nce b\xf6yle bir \u015fey g\xf6rmemi\u015ftim.\nup to now, up till now, up to the present, so far\nBu zarflar, \u015fimdiye kadar, bug\xfcne kadar, g\xfcn\xfcm\xfcze kadar, \u015fu ana kadar anlamlar\u0131na gelmekte olup, present perfect tense\u2019in \u201cge\xe7mi\u015fte ba\u015flay\u0131p ve hala devam eden i\u015fleri anlatma i\u015flevinde kullan\u0131l\u0131rlar.\n\nSo far we have had no problems.\n\u015eu ana kadar hi\xe7bir problem ya\u015famad\u0131k.\nWe have heard nothing from him up to now.\n\u015eu ana kadar kendisinden hi\xe7bir \u015fey duymad\u0131k.\n\n",null,B.u,null,null,null,null,null,null)
