B.O5=new A.R("            \nTemiz bir tasma takt\u0131m. Hubbel'in avlusunu ve k\xf6peklerini ba\u011flad\u0131klar\u0131 ta\u015f direk \xfczerindeki halkay\u0131 g\xf6rebildi\u011fim ikinci kattaki odam\u0131zdayd\u0131m. K\xf6pek orada de\u011fildi. \xc7\u0131kartt\u0131\u011f\u0131m yakan\u0131n i\xe7 k\u0131sm\u0131nda iki \xe7e\u015fit \xe7ama\u015f\u0131r izi vard\u0131, biri g\xf6mle\u011fimi \xe7\u0131kard\u0131\u011f\u0131m \xe7ama\u015f\u0131rdan, di\u011feri de mevcut \xe7ama\u015f\u0131rdan. Sonra ellerimi y\u0131kad\u0131m.\n\nSabun a\u015f\u0131nm\u0131\u015ft\u0131, neredeyse hi\xe7 kalmam\u0131\u015ft\u0131. Salata gibi kokan sabun gibiydi. Suyu kapatt\u0131m ama su hala musluktan damla damla ak\u0131yordu. Ellerimi kuruttum. Havluyu \xe7ubu\u011fun sol ucuna ast\u0131m. \xc7ubu\u011fun sa\u011f ucu Mae i\xe7indir. \xc7ubuk camd\u0131r ve bir g\xfcn gev\u015feyecek, d\xfc\u015fecek ve k\u0131r\u0131lacakt\u0131r. Musluktan damlayan su sesini duymamak i\xe7in banyonun kap\u0131s\u0131n\u0131 kapatt\u0131m.\n\nMae ve benim i\xe7in olan odaya tekrar girdim. G\xfcnd\xfczleri yata\u011f\u0131nda iri g\xf6zl\xfc bir Frans\u0131z bebe\u011fi vard\u0131r. Yata\u011f\u0131n arkas\u0131n\u0131n duvara \xe7arpt\u0131\u011f\u0131 yerde bir i\u015faret vard\u0131r. Yataktan \xe7\u0131kt\u0131m ve i\u015fareti g\xf6rd\xfcm. Siyah ve bir avlu uzunlu\u011funda. Bebek d\xfc\u015ft\xfc ve d\u0131\u015far\u0131 \xe7\u0131kt\u0131\u011f\u0131mda bana bakmas\u0131n diye onu tekrar yata\u011f\u0131n \xfczerine koydum. Sonra d\u0131\u015far\u0131 \xe7\u0131kt\u0131m.\n\nSalondayd\u0131m ve g\xf6zlerimi kapatt\u0131m. Koridorda ne t\xfcr bir duvar ka\u011f\u0131d\u0131 oldu\u011funu bilmiyordum. Ye\u015fil olaca\u011f\u0131n\u0131 d\xfc\u015f\xfcnm\xfc\u015ft\xfcm ama g\xf6zlerimi tekrar a\xe7t\u0131\u011f\u0131mda ye\u015filden \xe7ok maviydi, bir kad\u0131nla, bir sepetle ve bir lambayla. Kap\u0131n\u0131n etraf\u0131ndaki duvar ka\u011f\u0131d\u0131 kesilmi\u015fti ve sadece lamba vard\u0131; tavandan una sekiz kez, kad\u0131n yok ve sepet yok, sadece lamba. Ayak parmaklar\u0131m\u0131n \xfczerinde durdu\u011fumda tavana dokunabiliyordum.\nOdam\u0131z\u0131n yan\u0131nda kullanmad\u0131\u011f\u0131m\u0131z ekstra oda var. buna girdim Aynan\u0131n arkas\u0131 soyulmu\u015ftu ve her iki pencere de kapal\u0131yd\u0131.\n\nPencerede b\xfcy\xfck bir sinek vard\u0131 ve pencereyi a\xe7t\u0131m ve onu d\u0131\u015far\u0131 \xe7\u0131kard\u0131m ve u\xe7up gitti. Ve pencere \xe7er\xe7evesinde uzun bir \xe7ivi vard\u0131 ve ayakkab\u0131m\u0131 \xe7\u0131kard\u0131m ve \xe7iviyi ayakkab\u0131m\u0131n topu\u011fuyla \xe7akt\u0131m. Sonra ayakkab\u0131m\u0131 tekrar giydim. Bir duvardan di\u011ferine her y\xf6nde y\xfcr\xfcyerek oday\u0131 \xf6l\xe7t\xfcm. On'a on d\xf6rt.\n\nMasan\u0131n kar\u015f\u0131s\u0131ndaki kap\u0131dan salona girdim. Masan\u0131n bir taraf\u0131nda \xfc\xe7 \xe7ekmece vard\u0131r. Alt \xe7ekmeceden bir zarf \xe7\u0131kar\u0131p i\xe7ine biraz para koydum ve \xfczerine \"Mae i\xe7in\" yaz\u0131p masan\u0131n \xfcst\xfcne koydum. Salondaki perdeler k\u0131rm\u0131z\u0131yd\u0131. G\xfcne\u015fin onlara \xe7arpt\u0131\u011f\u0131 yerde k\u0131rm\u0131z\u0131 de\u011fil pembe olan bir k\u0131s\u0131m vard\u0131r. Masan\u0131n \xfczerinde Movieland diye bir dergi vard\u0131 ve onu okumaya ba\u015flad\u0131m ama okumad\u0131m. \u015e\xf6minenin \xfczerinden ge\xe7tim ve oradan odan\u0131n geri kalan\u0131na bakt\u0131m ve masay\u0131 ve hal\u0131y\u0131 ve iki sandalyenin nas\u0131l birbirine bakt\u0131\u011f\u0131n\u0131 g\xf6rd\xfcm. Bir aya\u011f\u0131 di\u011ferlerinden k\u0131sa olan birinin \xfczerine oturdum ve kalk\u0131p mutfa\u011fa gittim.\n\nMutfakta Mae'nin bezelyeleri ay\u0131klad\u0131\u011f\u0131n\u0131 g\xf6rd\xfcm. G\xfcmb\xfcrt\xfcs\xfcyle bezelyeleri kabuktan d\u0131\u015far\u0131 zorlar ve bezelyeler kaseye d\xfc\u015fer. Yerde \xfc\xe7 bezelye vard\u0131, onlar\u0131 ald\u0131m ve cebime koydum. Mutfak zemini, iki in\xe7 karelik mavi ve beyaz karelerle mu\u015fambayla d\xf6\u015fenmi\u015fti. Mae bir taburede oturmu\u015f \xf6n\xfcne konan bir ka\u011f\u0131d\u0131 okuyordu. \u0130\xe7eri girdi\u011fimde arkas\u0131n\u0131 d\xf6nmedi. \u201cGeri d\xf6nd\xfc\u011f\xfcn\xfczde yan\u0131n\u0131za biraz soba cilas\u0131 getirin\u201d dedi.\n\n\u015eimdi gidiyorum dedim.\nArka kap\u0131dan bah\xe7eye \xe7\u0131kt\u0131m. Orada \xe7ocu\u011fumun biraz kum ve oyuncak kamyonla oynad\u0131\u011f\u0131n\u0131 ve ard\u0131ndan kamyonu kumda ileri geri ko\u015ftu\u011funu g\xf6rd\xfcm. Kum \u0131slakt\u0131 ve \xfczerinde elinin izini g\xf6rebiliyordum. Bu onun sol eliydi. Elveda o\u011flum dedim ama bir \u015fey demedi. Kamyonu ve kumla \xe7ok me\u015fguld\xfc.\nSonra garaja gittim ve kap\u0131y\u0131 a\xe7t\u0131m. Araban\u0131n \xf6n cam\u0131na bir bez s\xfcrd\xfcm ve \xf6n cam silece\u011finin sildi\u011fi yerde yar\u0131m daire \u015feklinde \xe7izildi. Birka\xe7 dakika orada durdum, sonra kap\u0131lar\u0131 kapatt\u0131m ve evin yan taraf\u0131na do\u011fru y\xfcr\xfcd\xfcm ve saatime bakt\u0131m. Ona yirmi dakika vard\u0131.\n\nSonra tahta basamaklardan kald\u0131r\u0131ma indim ve basamaklar\u0131 sayd\u0131m. On ad\u0131m sayd\u0131m, son ad\u0131m\u0131 sayd\u0131\u011f\u0131m\u0131 sand\u0131m ama belki saymad\u0131m. Caddede y\xfcr\xfcd\xfcm ve arkama bakt\u0131m ve evi g\xf6rd\xfcm ve yar\u0131ya kadar g\xf6lgeli\u011fi olan bir pencere vard\u0131 ve emin olmak i\xe7in geri d\xf6n\xfcp ad\u0131mlar\u0131 tekrar saymak istedim ama yapmad\u0131m. K\xf6\u015feye kadar y\xfcr\xfcd\xfcm ve otob\xfcse bindim ve karakolda indim ve Y\xfczba\u015f\u0131 Rogers'\u0131 buldum ve ona Sam Mathews'u \xf6ld\xfcren adam\u0131 ar\u0131yorlarsa beni tutuklamalar\u0131 gerekti\u011fini \xe7\xfcnk\xfc bunu ben yapt\u0131\u011f\u0131m\u0131 s\xf6yledim.\n\nY\xfczba\u015f\u0131 Rogers bana bir itiraf yazmak isteyip istemedi\u011fimi sordu ve ben de yazaca\u011f\u0131m\u0131 s\xf6yledim ama onlara Mathews'u nas\u0131l \xf6ld\xfcrd\xfc\u011f\xfcm\xfc anlatmadan \xf6nce evimde g\xf6rd\xfc\u011f\xfcm son \u015feyleri ve onlar\u0131 nas\u0131l hat\u0131rlad\u0131\u011f\u0131m\u0131 yazmak istiyorum \xe7\xfcnk\xfc art\u0131k Bir daha asla g\xf6rmeyece\u011fim t\xfcm o \u015feyleri her zaman hat\u0131rlayabilmeyi isteyece\u011fim.\n            ",null,B.u,null,null,null,null,null,null)
B.O6=new A.R("              \nWould like ile istenen \u015feyin i\u015f, olu\u015f bildirdi\u011fi bir fiil (y\xfcklem) olmas\u0131 durumunda fiil ile aras\u0131na to getirilir. Ancak istenilen \u015fey alelade dura\u011fan bir \u015fey, yani herhangi bir eylem bildirmiyorsa, yani fiil yoksa to kullan\u0131lmaz. A\u015fa\u011f\u0131daki tabloda would like fiilinin kullan\u0131m\u0131 g\xf6sterilmi\u015ftir.\n\n\u27a1\ufe0f Olumlu c\xfcmleler\n\nSubject (I, you, we, they, he, she, it) + would like + to + V1\nSubject (I, you, we, they, he, she, it) + would like (fiil yoksa to yok)\n\nJohn would like a cup of tea.\nJohn bir fincan \xe7ay istiyor.\n\nI would like some cheese, please.\nBiraz peynir istiyorum, l\xfctfen.\n\nShe\u2019d like to buy a new jacket.\nYeni bir ceket almak istiyor.\n\nI\u2019d like pizza.\nPizza istiyorum.\n\nI\u2019d like to order pizza.\nPizza sipari\u015f etmek istiyorum.\n\nI would like to meet you.\nSizinle tan\u0131\u015fmak isterim.\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\n\nSubject (I, you, we, they, he, she, it) + would not like + to + V1\nSubject (I, you, we, they, he, she, it) + wouldn\u2019t like + V1\nSubject (I, you, we, they, he, she, it) + would not like (fiil yoksa to yok)\nSubject (I, you, we, they, he, she, it) + wouldn\u2019t like (fiil yoksa to yok)\n\n\u2757 \u2018d not like diye bir \u015fey kullan\u0131lmaz.\n\nJohn wouldn\u2019t like a cup of tea.\nJohn bir fincan \xe7ay istemiyor.\n\nI would not like cheese.\nPeynir istemiyorum.\n\nShe wouldn\u2019t like to buy a new jacket.\nYeni bir ceket almak istemiyor.\n\nI would not like pizza.\nPizza isteimyorum.\n\nI wouldn\u2019t like to order pizza.\nPizza sipari\u015f etmek istemiyorum.\n\nI wouldn\u2019t like to meet you.\nSizinle tan\u0131\u015fmak istemiyorum.\n\n\u27a1\ufe0f Soru c\xfcmleleri\nWould + subject (I, you, we, they, he, she, it) + like + to + V1?\nWould + subject (I, you, we, they, he, she, it) + like? (fiil yoksa to yok)\n\n\u2757 E\u011fer bir soru kelimesi ile beraber kullan\u0131lacaksa en ba\u015fa soru kelimesi gelir.\n\nWhat would you like to drink?\nNe i\xe7mek istersiniz?\n\nWould you like to eat something?\nBir \u015feyler yemek ister misin?\n\nWhat would you like to have?\nNe al\u0131rd\u0131n\u0131z?\n\nWhat would you like to order?\nNe sapari\u015f vermek istersiniz?\n\nHow would you like your drink?\n\u0130\xe7ece\u011finizi nas\u0131l istersiniz?\n\n",null,B.u,null,null,null,null,null,null)
