B.Oc=new A.R("              \n\u0130ngilizcede type 2, olas\u0131 olmayan veya ger\xe7ekle\u015fmesi pek de m\xfcmk\xfcn olmayan varsay\u0131msal bir \u015fart\u0131 anlatmak i\xe7in kullan\u0131l\u0131r. Her ne kadar bu olaylar\u0131n ger\xe7ekle\u015fmesi olas\u0131 olsa da ger\xe7ekle\u015fme ihtimalleri \xe7ok d\xfc\u015f\xfckt\xfcr.\n\n\u2757 Type 2 yap\u0131lar\u0131nda kullan\u0131lan if\u2019li c\xfcmle her ne kadar past tense ile kullan\u0131lsa da anlam present\u2019ta kalmaktad\u0131r. Zira ger\xe7eklere o an i\xe7in ters d\xfc\u015fen olay, zaman hen\xfcz bitmedi\u011fi i\xe7in hala ger\xe7ekle\u015febilir vaziyettedir.\n\nBu yap\u0131n\u0131n ilk b\xf6l\xfcm\xfcnde varsay\u0131msal ifade (if clause) yer al\u0131rken ikinci b\xf6l\xfcm\xfcnde varsay\u0131msal durumun sonucu (would V1 ya da could V1) yer almaktad\u0131r.\n\n\u25b6\ufe0f If Clause (\u015eartl\u0131 C\xfcmle), Main Clause (Ana C\xfcmle)\n\u25b6\ufe0f If + simple past tense, would V1\n\u25b6\ufe0f If + simple past tense, could V1\n\nIf I had time (if clause), I would visit you (main clause).\nVaktim olsayd\u0131 (\u015fartl\u0131 ifade) seni ziyaret ederdim (temel c\xfcmle).\n\n\u2757 Ko\u015fulun belirtildi\u011fi yan c\xfcmle ile sonucu belirten ana c\xfcmlenin s\u0131ras\u0131 de\u011fi\u015ftirilebilir. B\xf6ylesi durumlarda c\xfcmledeki anlam de\u011fi\u015fmez ancak normalde kullan\u0131lan virg\xfcl bunda kullan\u0131lmaz.\n\n\u25b6\ufe0f Main Clause (Ana C\xfcmle) If Clause (\u015eartl\u0131 C\xfcmle) (virg\xfcl yok)\n\u25b6\ufe0f would V1 If + simple past tense\n\u25b6\ufe0f could V1 If + simple past tense\n\nI would visit you (main clause) if I had time (if clause).\nVaktim olsayd\u0131 (\u015fartl\u0131 ifade) seni ziyaret ederdim (temel c\xfcmle).\n\n\u2757 \u015eartl\u0131 ifadenin anlat\u0131ld\u0131\u011f\u0131 c\xfcmlede e\u011fer to be fiili kullan\u0131lm\u0131\u015fsa past tense versiyonunda t\xfcm zamirler were olarak \xe7ekimlenir. Her ne kadar ilgili zamirler (I, he, she, it) i\xe7in was \xe7ekimlemek dil bilgisel a\xe7\u0131dan yanl\u0131\u015f say\u0131lmasa da yayg\u0131n kullan\u0131m were \u015feklindedir.\n\nIf I were a rich man, I wouldn\u2019t work.\nZengin biri olsam \xe7al\u0131\u015fmazd\u0131m.\n\nIf I were you, I would go and talk to Anna.\nSenin yerinde olsayd\u0131m, Anna ile konu\u015furdum.\n\nIf I were you, I\u2019d wear a suit.\nBen olsam tak\u0131m elbise giyerdim\n\nIf I were Messi, I\u2019d play for Galatasaray.\nBen Messi\u2019nin yerinde olsam Galatasaray\u2019da oynard\u0131m.\n\nIf he were an honest person, I would belive in him.\nE\u011fer d\xfcr\xfcst bir insan olsayd\u0131, ona inan\u0131rd\u0131m.\n\nType 2 \xd6rnek C\xfcmleler\n\n\u2757 Kibar sorular sormak i\xe7in type 2 yap\u0131s\u0131 pekala kullan\u0131labilir:\n\nWould it be alright if I went home early?\nEve erken gitsem olur mu?\n\nWould it be alright if I bought this?\nBunu alsam sorun olur mu?\n\nType 2 \xd6rnek C\xfcmleler\n\nA\u015fa\u011f\u0131daki tabloda \xf6rnek type 2 c\xfcmleleri derlenmi\u015ftir:\n\n\nI would give a speech, if I wasn\u2019t so nervous.\nBu kadar gergin olmasayd\u0131m bir konu\u015fma yapard\u0131m.\n\nI would buy a new PC, if I had enough money.\nYeterli param olsa yeni bir bilgisayar al\u0131rd\u0131m.\n\nIf I had more time, I\u2019d talk to him.\nDaha fazla zaman\u0131m olsayd\u0131, onunla konu\u015furdum.\n\nIf I went by bus now, I would get there earlier.\n\u015eimdi otob\xfcsle gitseydim, oraya daha erken gelirdim.\n\nIf Tom had more money, he lend you some.\nTom\u2019un daha fazla paras\u0131 olsayd\u0131, sana biraz bor\xe7 verirdi.\n\nWe would invite them if the venue were bigger.\nMekan daha b\xfcy\xfck olsayd\u0131 onlar\u0131 da davet ederdik.\n\nIf I had a car, I\u2019d drive you to the party.\nArabam olsayd\u0131, seni partiye g\xf6t\xfcr\xfcrd\xfcm.\n\n",null,B.u,null,null,null,null,null,null)
