B.Og=new A.R("              \nGelecekte tamamlanm\u0131\u015f olacak eylem anlat\u0131m\u0131 i\xe7in bu tense kullan\u0131l\u0131r. Diyelim ki evlilik haz\u0131rl\u0131\u011f\u0131 yap\u0131yorsunuz ve nikah i\xe7in bir ay sonras\u0131na tarih ald\u0131n\u0131z. \u0130\u015fte bu tarz son teslim tarihi olan ve gelecekte ger\xe7ekle\u015fecek eylemleri anlatmak i\xe7in future perfect tense kullan\u0131l\u0131r:\n\nEmma und Thomas will have been married by next month.\nEmma ve Thomas \xf6n\xfcm\xfczdeki aya evlenmi\u015f olacaklar.\n\nGelecekteki bir zamanda bitmi\u015f olmas\u0131 beklenen eylemler i\xe7in kullan\u0131lan bu zaman \u0130ngilizcede will + have + V3 \u015feklinde yap\u0131l\u0131rken T\xfcrk\xe7eye ilgili \u015fah\u0131s zamirlerine g\xf6re -m\u0131\u015f/mi\u015f olaca\u011f\u0131m \u015feklinde \xe7evrilebilir.\n\nA\u015fa\u011f\u0131daki tablolarda ilgili \u015fah\u0131s zamirlerine g\xf6re \xe7ekimlenmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/you/we/they/he/she/it + will have V3\nI/you/we/they/he/she/it + \u2018ll have V3\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/you/we/they/he/she/it + will not have V3\nI/you/we/they/he/she/it + won\u2019t have V3\n\n\u27a1\ufe0f Soru c\xfcmleleri\nWill + I/you/we/they/he/she/it + have V3?\nWon\u2019t + I/you/we/they/he/she/it + have V3?\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a will have,\n\ud83d\udd0a I\u2019ll have,\n\ud83d\udd0a will not have,\n\ud83d\udd0a won\u2019t have\nFuture Perfect Perfect Tense Kullan\u0131m\u0131\n\u2b50 Bir i\u015fin, gelecekte belli bir andan \xf6nce yap\u0131laca\u011f\u0131n\u0131 g\xf6stermek i\xe7in kullan\u0131l\u0131r.\n\nI will have prepared breakfast by the time the children wake up.\n\xc7ocuklar uyanana kadar ben kahvalt\u0131y\u0131 haz\u0131rlam\u0131\u015f olaca\u011f\u0131m.\n\nBy the time we get back from holiday, we will have done two thousand miles.\nTatilden d\xf6nd\xfc\u011f\xfcm\xfczde iki bin mil yapm\u0131\u015f olaca\u011f\u0131z.\n\nWill they have finished thier work by 5 o\u2019clock?\n\u0130\u015flerini saat 5\u2019e kadar bitirmi\u015f olacaklar m\u0131?\n\nEmma und Thomas will have been married by next year.\nEmma ve Thomas gelecek y\u0131l evlenmi\u015f olacaklar.\n\nWill the concert have started by 10 minutes?\nKonser 10 dakikaya ba\u015flam\u0131\u015f olacak m\u0131?\n\nBy that time I will have finished my job.\nO zamana kadar i\u015fimi bitirmi\u015f olaca\u011f\u0131m.\n\n\u2b50 Nadiren de olsa olas\u0131l\u0131k ya da varsay\u0131m ifade etmek i\xe7in kullan\u0131labilir.\n\n\nIt is midnight. They will have arrived there by now.\nGece yar\u0131s\u0131 oldu. \u015eimdiye kadar oraya varm\u0131\u015flard\u0131r\n\n\u0130ngilizcede Future Perfect Tense Ne Zaman Kullan\u0131lmaz?\n\u2757 Future perfect ile gelecekte belirli bir noktadan \xf6nce tamamlanacak eylemlerin anlat\u0131m\u0131 yap\u0131l\u0131r. Ba\u015fka bir deyi\u015fle, bahsi ge\xe7en eylemin bir son teslim tarihi olmal\u0131d\u0131r. E\u011fer son teslim tarihi yoksa, future perfect yerine simple future tense kullan\u0131lmas\u0131 gerekir.\n\nHe will have left. \ud83d\udc4e\ud83c\udffb\nAyr\u0131lm\u0131\u015f olacak.\n\nHe will leave. \ud83d\udc4d\ud83c\udffb\nAyr\u0131lacak.\n\n\u2757 \u201cwhen\u201c, \u201cwhile\u201c, \u201cbefore\u201c, \u201cafter\u201c, \u201cby the time\u201c, \u201cas soon as\u201c, \u201cif\u201c, \u201cunless\u201d gibi zaman ifadelerinden sonra gelecek zaman t\xfcrleri (future tense, future continuous tense, future perfect, future perfect continuous tense) kullan\u0131lamaz. Ama bunlardan \xf6nceki c\xfcmlelerde kullan\u0131labilir:\n\nI will have gone already when you read these lines.\nSiz bu sat\u0131rlar\u0131 okurken, ben \xe7oktan gitmi\u015f olaca\u011f\u0131m.\n\nFuture Perfect ile Kullan\u0131lan Zaman \u0130fadeleri\n\xd6zellikle gelecekte bir noktada ba\u015flayan bir eylemin yine gelecekteki bir ba\u015fka noktada tamamlanaca\u011f\u0131n\u0131 belirtmek i\xe7in \u201cby the time\u201d, \u201cby\u201d gibi zarflarla s\u0131kl\u0131kla kullan\u0131lmaktad\u0131r.\n\nBy next week tomorrow, he will have left already.\nHaftaya ertesi g\xfcn, \xe7oktan ayr\u0131lm\u0131\u015f olacak.\n\nMy wife will have been in the home by the time I arrive.\nBen gelene kadar kar\u0131m evde olmu\u015f olacak.\n\n",null,B.u,null,null,null,null,null,null)
