B.Oi=new A.R("            \n\xdc\xe7 erkek tatil i\xe7in New York\u2019a geldi. \xc7ok b\xfcy\xfck bir otele geldiler ve orada bir oda tuttular. Odalar\u0131 k\u0131rk be\u015finci kattayd\u0131. Ak\u015fam oldu\u011funda arkada\u015flar tiyatroya gittiler ve otele \xe7ok ge\xe7 d\xf6nd\xfcler.\n\n\u201c\xc7ok \xfczg\xfcn\xfcm,\u201d dedi otel sorumlusu, \u201cancak asans\xf6rler bu gece \xe7al\u0131\u015fm\u0131yor. E\u011fer odan\u0131za \xe7\u0131kmak istemezseniz, salonda sizin i\xe7in yataklar yapaca\u011f\u0131z.\u201d\n\n\u201cHay\u0131r, hay\u0131r!\u201d dedi arkada\u015flardan biri, \u201chay\u0131r, te\u015fekk\xfcr ederim. Salonda uyumak istemiyoruz. Odam\u0131za \xe7\u0131kal\u0131m.\u201d\n\nSonra arkada\u015flar\u0131na d\xf6nd\xfc ve: \u201cK\u0131rk be\u015finci kata \xe7\u0131kmak kolay de\u011fil, ama daha kolay h\xe2le getirece\u011fiz. Odaya giderken size baz\u0131 \u015fakalar anlataca\u011f\u0131m; sonra sen, Andy, bize \u015fark\u0131 s\xf6yleyeceksin; sonra sen, Peter, bize ilgin\xe7 hikayeler anlatacaks\u0131n.\u201d\n\nB\xf6ylece odalar\u0131na \xe7\u0131kmaya ba\u015flad\u0131lar. Tom onlara bir\xe7ok \u015faka yapt\u0131; Andy baz\u0131 \u015fark\u0131lar s\xf6yledi. Sonunda otuz alt\u0131nc\u0131 kata geldiler. Yoruldular ve dinlenmeye karar verdiler.\n\n\u201cPeki,\u201d dedi Tom, \u201c\u015fimdi s\u0131ra sende, Peter. T\xfcm \u015fakalardan sonra h\xfcz\xfcnl\xfc bir hikaye duymak isterim. Bize \xfcz\xfcc\xfc bir sonu olan uzun ve ilgin\xe7 bir hikaye anlat.\u201d\n\n\u201cSize anlataca\u011f\u0131m hikaye\u201d dedi Peter, \u201cyeterince \xfcz\xfcc\xfc. Odam\u0131z\u0131n anahtar\u0131n\u0131 salonda b\u0131rakt\u0131k.\u201d\n            ",null,B.u,null,null,null,null,null,null)
