B.Op=new A.R("              \nAyr\u0131k c\xfcmleler olarak adland\u0131r\u0131lmas\u0131n\u0131n sebebi ise, ayr\u0131k c\xfcmleler kurulurken, \xf6zg\xfcn c\xfcmlenin \xf6gelerinin birbirlerinden ayr\u0131lmalar\u0131d\u0131r.\n\nSiz bu a\u011fac\u0131 m\u0131 kestiniz? (Ba\u015fka bir a\u011fac\u0131 de\u011fil)\nSiz mi bu a\u011fac\u0131 kestiniz? (Ba\u015fka birisi de\u011fil)\n\nYukar\u0131daki \xf6rnekte g\xf6r\xfclece\u011fi \xfczere vurgu ile anlam de\u011fi\u015fmektedir. \u0130ngilizcede ayn\u0131 vurguyu sa\u011flamak a\u015fa\u011f\u0131daki \u015fekildedir:\n\nIs it this tree that you cut?\nIs it you that cut this tree?\n\nAyr\u0131k c\xfcmlelerin iki t\xfcr\xfc bulunmaktad\u0131r. Bunlar s\u0131ras\u0131yla a\u015fa\u011f\u0131daki gibidir:\n\nIT-Cleft\nWhat-Cleft\nIt-Cleft\nIt-cleft ayr\u0131k c\xfcmlelerinde fiilin d\u0131\u015f\u0131ndaki \xf6geleri vurgulamak i\xe7in kullan\u0131l\u0131r. IT-Cleft c\xfcmlelerinde it is/was \u2026 (that) eylem hari\xe7 vurgulanmak istenen \xf6geye g\xf6re \xf6zg\xfcn c\xfcmleye yerle\u015ftirilir. Vurgulanmak istenen \xf6ge it is\u2019den hemen sonra gelmelidir.\n\nI phoned you last night.\nIt was me who phoned you last night.\nD\xfcn gece seni arayan bendim.\n\nIt was you who(m) I phoned last night.\nD\xfcn gece arad\u0131\u011f\u0131m ki\u015fi sendin.\n\nIt was last night that I phoned you.\nSeni d\xfcn gece arad\u0131m.\n\nWhat-Cleft\n\nWhat-cleft ayr\u0131k c\xfcmlelerinde c\xfcmlelerin \xf6znesini, nesnesini ya da eylemini vurgulamak i\xe7in kullan\u0131l\u0131r. genel olarak, WHAT-Cleft c\xfcmleleri semi-cleft \u201cyar\u0131 ayr\u0131k\u201d olarak da adland\u0131r\u0131l\u0131r ve vurguda genel olarak c\xfcmlenin sonundad\u0131r.\n\nBunun nedeni WHAT-Cleft c\xfcmlelerinin ger\xe7ekte bir ba\u015fka s\u0131fat c\xfcmleciklerinin k\u0131salt\u0131lm\u0131\u015f \u015fekilleri olarak de\u011ferlendirilmesidir. What-cleft c\xfcmleleri what, why, where ve all, the thing, something, one thing gibi kelimelerle kullan\u0131l\u0131rlar.\n\nWhat do you need?\n\nWhat I need is something to eat.\n\u0130htiyac\u0131m olan \u015fey yiyecek bir \u015feyler.\n\nWhat do you want?\n\nThe one thing I want is to be successful.\n\u0130stedi\u011fim tek \u015fey ba\u015far\u0131l\u0131 olmak.\n\nWhat do you want for Christmas?\n\nAll I want for Christmas is peace.\nNoel i\xe7in tek istedi\u011fim bar\u0131\u015f.\n\nWhat do you notice in people?\n\nThe first thing I notice about people is their smiles.\n\u0130nsanlarda ilk fark etti\u011fim \u015fey g\xfcl\xfcmsemeleri.\n\n",null,B.u,null,null,null,null,null,null)
B.Oq=new A.R("            \nK\xfc\xe7\xfck k\u0131z karde\u015fler top oynamak i\xe7in odaya girdiler.\n\n\u201cBeyaz kediyi uyand\u0131rmamaya dikkat etmeliyiz,\u201d dedi uzun boylu olan usulca.\n\n\u201cYa da g\xfclleri mahvetmemeye\u201d diye f\u0131s\u0131ldad\u0131 \u015fi\u015fman olan;\n\n\u201cAma y\xfckse\u011fe f\u0131rlat, sevgili k\u0131z karde\u015fim, yoksa asla tavana vuramayaca\u011f\u0131z.\u201d\n\n\u201cSiz sevgili \xe7ocuklar\u201d diye d\xfc\u015f\xfcnd\xfc beyaz kedi,\n\n\u201cNeden buraya oynamaya gelirsiniz? G\xf6lgeli a\u011fa\xe7lar, dallarda \u015fark\u0131 s\xf6yleyen ku\u015flar sadece k\xf6\u015feyi d\xf6n\xfcnce ve g\xfcne\u015f \u0131\u015f\u0131\u011f\u0131 patikay\u0131 b\xfcr\xfcyor. Kim bilir ama, d\u0131\u015far\u0131da, topunuz g\xf6ky\xfcz\xfcne dokunabilir mi? Burada sadece beni rahats\u0131z edeceksiniz ve belki de g\xfclleri mahvedeceksiniz ve yapabilece\u011finizin en iyisi tavana vurmak!\u201d\n            ",null,B.u,null,null,null,null,null,null)
B.Or=new A.R("\u0130smin iyelik hali olarak bilinen Possessive \u2018s haliyle iyelik yani bilindik manas\u0131yla sahiplik bildirmek i\xe7in kullan\u0131l\u0131r.\n\n          Possessive \u2018s\n\nBu yap\u0131y\u0131 insanlar ve hayvanlar i\xe7in sahiplik anlat\u0131mlar\u0131 yapmak i\xe7in kullan\u0131r\u0131z. Sahiplik bildirilecek isme -s eki kesme i\u015faretiyle beraber eklenir.\n\nA\u015fa\u011f\u0131daki \xf6rnekleri inceleyiniz:\n\nJohn\u2019s car\n\nJohn\u2019un arabas\u0131\n\nAnna\u2019s book\n\nAnna\u2019n\u0131n kitab\u0131\n\nKevin\u2019s dog\n\nKevin\u2019in k\xf6pe\u011fi\n\nBrad\u2019s phone\n\nBrad\u2019in telefonu\n\nmy father\u2019s house\n\nBabam\u0131n evi\n\nSonu zaten -s eki ile biten bir ismin sahiplik anlat\u0131m\u0131 i\xe7in -s eki eklenmez ve sadece apostrof olarak adland\u0131r\u0131lan \u2018 kesme i\u015fareti getirilir.\n\nA\u015fa\u011f\u0131daki \xf6rnekleri inceleyiniz:\n\nThe babies\u2019 beds\n\nBebeklerin yataklar\u0131\n\nHans\u2019 book\n\nHans\u2019\u0131n kitab\u0131\n\nPippens\u2019 basket\n\nPippens\u2019in sepeti\n\n          Of\n\nBenzer yap\u0131 cans\u0131z nesneler ve soyut ifadeler i\xe7in genellikle of yap\u0131s\u0131 kullan\u0131larak sahiplik anlat\u0131m\u0131 yap\u0131l\u0131r. T\xfcrk\xe7ede benzer anlat\u0131m\u0131 yaparken \u0130ngilizcede farkl\u0131 yap\u0131l\u0131r.\n\n\xd6rne\u011fin T\xfcrk\xe7ede \u201cevin penceresi\u201d olarak ifade etti\u011fimiz durum \u0130ngilizcede \u201cpenceresi evin\u201d \u015feklinde yani \u201cThe window of the house\u201d \u015feklinde iki kelimenin aras\u0131na of getirilerek yap\u0131l\u0131r.\n\nA\u015fa\u011f\u0131daki \xf6rnekleri inceleyin:\n\nColor of the pen\n\nKalemin rengi\n\nPages of the book\n\nKitab\u0131n sayfalar\u0131\n\nKey of the piano\n\nPiyanonun tu\u015fu\n\nThe key of the door\n\nKap\u0131n\u0131n anahtar\u0131\n\nThe door of the house\n\nEvin kap\u0131s\u0131\n\n          \u0130smin \u0130yelik Hali \xd6rnek C\xfcmleler\n      \nHem possesive \u2018s i\xe7eren hem de of kullan\u0131lan \xf6rnek c\xfcmleler a\u015fa\u011f\u0131daki tabloda listelenmi\u015ftir:\n\nHans\u2019 dog is black in color.\n\nHans\u2019\u0131n k\xf6pe\u011fi siyah renklidir.\n\nI gave my father\u2019s car to my friend.\n\nBabam\u0131n arabas\u0131n\u0131 arkada\u015f\u0131ma verdim.\n\nSomeone knocked violently on the door of the house\n\nBiri evin kap\u0131s\u0131n\u0131 \u015fiddetle \xe7ald\u0131\n\nI\u2019m calling you on my friend\u2019s phone.\n\nSeni arkada\u015f\u0131m\u0131n telefonundan ar\u0131yorum.\n\nThe crying of babies is unbearable.\n\nBebeklerin a\u011flamas\u0131 dayan\u0131lmazd\u0131r.\n\nI think a thief stole the kids\u2019 shoes.\n\nSan\u0131r\u0131m bir h\u0131rs\u0131z \xe7ocuklar\u0131n ayakkab\u0131lar\u0131n\u0131 \xe7ald\u0131.\n",null,B.u,null,null,null,null,null,null)
B.Os=new A.R("              \nBilindi\u011fi \xfczere i\u015fin, olay\u0131n veya eylemin yap\u0131lmas\u0131 gerekti\u011fini buyurarak anlatan ya da dileyen isteme kipine emir kipi denir. Emir c\xfcmleleri, emir verme, uyar\u0131da bulunma, \xf6\u011f\xfct verme, direktiflerde ve ricada bulunma durumlar\u0131nda kullan\u0131lmaktad\u0131r.\n\nEmir kipinin T\xfcrk\xe7ede birinci tekil ve \xe7o\u011ful ki\u015filer i\xe7in kullan\u0131m\u0131 yoktur, ikinci tekil ki\u015fi i\xe7in de ek kullan\u0131lmaz; ikinci \xe7o\u011ful ki\u015fi i\xe7in \u2013in , \u2013iniz, \xfc\xe7\xfcnc\xfc tekil ve \xe7o\u011ful ki\u015filer i\xe7in de \u2013sin, \u2013sinler ekleri kullan\u0131l\u0131r ve bu ekler \xfcnl\xfc uyumlar\u0131na uyar; \xf6rne\u011fin \u201csat, sat\u0131n, sat\u0131n\u0131z, sats\u0131n, sats\u0131nlar\u201d.\n\nKabaca simple present tense (geni\u015f zaman), \xf6znesiz kullan\u0131ld\u0131\u011f\u0131nda \u0130ngilizcede imperatives yap\u0131s\u0131n\u0131 olu\u015fturmaktad\u0131r diyebiliriz. Yaln\u0131z \u0130ngilizcede emir c\xfcmleleri olu\u015fturabilmek i\xe7in baz\u0131 kurallar da bulunmaktad\u0131r:\n\n\u2b50 Emir c\xfcmlelerinde \xf6zne kullan\u0131lmad\u0131\u011f\u0131 gibi emir sen ve siz olmak \xfczere iki ki\u015fi \xfczerinden verilir ve emirler \xfcnlem (!) ile biter\n\n\u2b50 \u0130ngilizcede de T\xfcrk\xe7edekine benzer \u015fekilde bir fiil oldu\u011fu gibi yaz\u0131l\u0131p sonuna \xfcnlem i\u015fareti koyuldu\u011funda basit bir \u015fekilde emir c\xfcmlesi kurulmu\u015f olur.\n\nStop!\nDur!\nWake up!\nUyan!\nGet out!\nDefol!\n\n\u2b50 Emir c\xfcmleleri \u0130ngilizcede simple present tense (geni\u015f zaman) \xfczerinden kurulur. Ancak c\xfcmlede \xf6zne kullan\u0131lmaz.\n\nLook at me now!\n\u015eimdi bana bak!\nPlay quietly!\nSessizce oynay\u0131n!\nCome here!\nBuraya gel!\n\n\u2b50 \u0130ngilizcede emir c\xfcmlesi olumsuz yap\u0131lmak istenirse ilgili fiilin \xf6n\xfcne ki\u015fi kim olursa olsun don\u2019t getirilir.\n\nDon\u2019t do it!\nBunu yapma!\nDon\u2019t speak loudly!\nY\xfcksek sesle konu\u015fmay\u0131n!\nDon\u2019t be late!\nGe\xe7 kalma!\nDon\u2019t run in the corridors!\nKoridorlarda ko\u015fmay\u0131n!\n\n\u2b50 Emir c\xfcmlelerini kibarca bir formatta s\xf6yleyebilmek i\xe7in ilgili fiilin ba\u015f\u0131na ya da sonuna aralar\u0131na virg\xfcl gelecek \u015fekilde please (l\xfctfen) kelimesi getirilir.\n\n\nPlease, don\u2019t do that to me!\nL\xfctfen, bunu bana yapma!\nPlease, come to us!\nL\xfctfen bize gelin!\nSit down, please!\nL\xfctfen otur!\n\n\u2b50 E\u011fer sen ve siz \u015fah\u0131s zamirleri d\u0131\u015f\u0131nda kalan \u015fah\u0131slar i\xe7in emir c\xfcmleleri olu\u015fturulmak istenirse \u201cizin vermek\u201d anlam\u0131na gelen let kelimesinden faydalan\u0131l\u0131r.\n\nLet him go!\nB\u0131rak gitsin!\nLet us explain!\nA\xe7\u0131klayal\u0131m (izin ver a\xe7\u0131klayal\u0131m)!\n\n\u2757 Let kullan\u0131larak olu\u015fturulan emir c\xfcmlesi olumsuz yap\u0131lmak istenirse ise yine don\u2019t ekini let fiilinden \xf6nce getiririz.\n\nDon\u2019t let them go!\nGidemesinler!\nDon\u2019t let her come!\nGelmesin!\n",null,B.u,null,null,null,null,null,null)
