B.OF=new A.R("            \n1950\u2019lerde, Orta Amerika\u2019daki ticari muz yeti\u015ftiricileri, en kazan\xe7l\u0131 \xfcr\xfcnleri olan Koca Mike nam-\u0131 di\u011fer Gros Michel muzunun \xf6l\xfcm\xfcyle kar\u015f\u0131 kar\u015f\u0131yayd\u0131. Ve \u015fimdi Koca Mike\u2019\u0131n halefi Cavendish\u2019e de ayn\u0131s\u0131 oluyor.\nKolay ta\u015f\u0131nmas\u0131, kal\u0131n kabuklu olmas\u0131 ve tatl\u0131 tad\u0131 ile Gros Michel muz bitkisi, Orta Amerika\u2019n\u0131n tarlalar\u0131n\u0131n h\xe2kimi oldu. O zamanlar G\xfcney Amerika\u2019n\u0131n ana \xfcreticisi ve ihracat\xe7\u0131s\u0131 olan United Fruit, muzlar\u0131n\u0131 m\xfcmk\xfcn olan en verimli \u015fekilde seri \xfcretti. United Fruit, tohumlardan bitki yeti\u015ftirmek yerine, s\xfcrg\xfcnleri bitkilerin saplar\u0131ndan klonlad\u0131 ve yo\u011fun tarlalarda yeti\u015ftirdi.\nMaalesef bu ko\u015fullar Fusarium Oxysporum mantar\u0131n\u0131n yay\u0131lmas\u0131 i\xe7in de m\xfckemmeldi. Bitkinin k\xf6klerine sald\u0131ran ve g\xf6vdeye ve yapraklara su ta\u015f\u0131mas\u0131n\u0131 engelleyen Mantar\u0131n TR-1 t\xfcr\xfc, mahsul spreylerine kar\u015f\u0131 diren\xe7liydi ve botlar veya kamyon lastikleri \xfczerinde dola\u015farak, b\xf6lgedeki tarlalar\u0131 yava\u015f\xe7a enfekte etti. Mantardan ka\xe7mak i\xe7in \xe7ift\xe7iler, enfekte olmu\u015f tarlalar\u0131 terk ettiler, sel atl\u0131nda b\u0131rakt\u0131lar ve daha sonra ekinlerini ba\u015fka bir yere diktiler ve bunu yapmak i\xe7inse genellikle ya\u011fmur ormanlar\u0131n\u0131 kestiler.\n\xc7abalar\u0131 ba\u015far\u0131s\u0131z oldu. Bunun yerine, mantar\u0131n etkilemedi\u011fi \xe7e\u015fitli muzlar\u0131 arad\u0131lar. Bir \u0130ngiliz d\xfck\xfcn\xfcn seras\u0131nda Cavendish\u2019i buldular. Nakliye a\xe7\u0131s\u0131ndan Gros Michel kadar uygun de\u011fildi, ancak muzlar\u0131 t\xfcketicileri mutlu edecek kadar lezzetliydi. En \xf6nemlisi, TR-1 onu etkilemiyor gibiydi. Birka\xe7 y\u0131l i\xe7inde United Fruit, tarlalar\u0131n\u0131 binlerce yeni bitkiyle doldurarak ve Gros Michel\u2019in b\xfcy\xfcd\xfc\u011f\xfc ayn\u0131 tek k\xfclt\xfcrl\xfc yeti\u015ftirme ko\u015fullar\u0131n\u0131 kopyalayarak kendisini iflastan kurtarm\u0131\u015ft\u0131.\nLatin Amerika end\xfcstrisi i\xe7in operasyon b\xfcy\xfck bir ba\u015far\u0131 olsa da Cavendish muzu g\xfcvenli olmaktan \xe7ok uzakt\u0131. 2014 y\u0131l\u0131nda, bir ba\u015fka b\xfcy\xfck muz \xfcreticisi olan G\xfcney Do\u011fu Asya b\xf6lgesi, d\xf6rt milyon ton Cavendish muzu ihra\xe7 etti. Ancak 2015 y\u0131l\u0131nda, mantar\u0131n ba\u015fka bir t\xfcr\xfc olan TR-4 ve k\xf6t\xfc hava ko\u015fullar\u0131n\u0131n birle\u015fimi sayesinde ihracat\u0131 y\xfczde 46 d\xfc\u015ft\xfc.\nYeti\u015ftirme \xe7al\u0131\u015fmalar\u0131 G\xfcney Do\u011fu Asya\u2019da sorunlar\u0131 \xe7\xf6zmedi. Yeti\u015ftiriciler, hastal\u0131\u011f\u0131 yaymadan bitkileri s\xfcrg\xfcnlerden klonlamak i\xe7in pahal\u0131 laboratuvar temelli y\xf6ntemleri her zaman kar\u015f\u0131layamazlar. Ayr\u0131ca, \xe7iftlik ekipmanlar\u0131n\u0131 temizleme ve vir\xfcsl\xfc tarlalar\u0131 karantinaya alma konusunda genellikle yeterince ilgili de\u011fillerdi. Sonu\xe7 olarak, mantar Avustralya\u2019ya, Orta Do\u011fu\u2019ya ve Mozambik\u2019e yay\u0131ld\u0131. Ve tek k\xfclt\xfcrl\xfc Cavendish mahsullerine b\xfcy\xfck \xf6l\xe7\xfcde ba\u011f\u0131ml\u0131 olan Latin Amerika, kolayca s\u0131radaki b\xf6lge olabilir.\nKa\xe7\u0131n\u0131lmaz olana kar\u015f\u0131 yar\u0131\u015fan bilim adamlar\u0131, Cavendish\u2019i TR-4\u2019e diren\xe7li muz t\xfcrlerinden gelen genlerle genetik olarak de\u011fi\u015ftirerek sorunu \xe7\xf6zmeye \xe7al\u0131\u015f\u0131yorlar. Queensland Teknoloji \xdcniversitesi\u2019ndeki ara\u015ft\u0131rmac\u0131lar, \u015fimdiye kadar \xfc\xe7 y\u0131l boyunca diren\xe7li kalan iki t\xfcr modifiye bitkiyi ba\u015far\u0131yla b\xfcy\xfctt\xfcler. Ancak baz\u0131 uzmanlar bunun, orijinal Cavendish\u2019in sa\u011flad\u0131\u011f\u0131 ayn\u0131 ge\xe7ici \xe7\xf6z\xfcm\xfcn yaln\u0131zca geli\u015fmi\u015f bir versiyonu oldu\u011funu d\xfc\u015f\xfcn\xfcyor. Yeni muzlar, daha \xf6nceki Cavendish ve Gros Michel ile ayn\u0131 \u015fekilde tek k\xfclt\xfcr ile ekilirse, hastal\u0131\u011f\u0131n ba\u015fka bir t\xfcr\xfcn\xfcn, de\u011fi\u015ftirilmi\u015f bitkileri de tehdit etmek i\xe7in y\xfckselmesi riski vard\u0131r.\n            ",null,B.u,null,null,null,null,null,null)
