B.OK=new A.R("              \n\u0130ngilizcede get used to ile, be used to ile anlat\u0131lan \u201cal\u0131\u015fk\u0131n olma\u201d anlam\u0131 yerine \u201cal\u0131\u015fmaya \xe7al\u0131\u015f\u0131yorum\u201d gibi bir anlam sa\u011flan\u0131r. Haliyle bir \u015feylere al\u0131\u015fmaya \xe7al\u0131\u015ft\u0131\u011f\u0131m\u0131z durumlar\u0131 anlatmak i\xe7in bi\xe7ilmez bir kaftand\u0131r.\n\nA\u015fa\u011f\u0131daki tabloda get used to kal\u0131b\u0131n\u0131n olumlu, olumsuz ve soru c\xfcmlelerindeki kullan\u0131m\u0131 i\xe7inde bulundu\u011fu zamana g\xf6re \xe7ekimlenir; e\u011fer geni\u015f zaman ise geni\u015f zaman kurallar\u0131, ge\xe7mi\u015f zaman ise ge\xe7mi\u015f zaman vb. di\u011fer zaman kurallar\u0131 ge\xe7erlidir:\n\n-I did not get used to living in apartment.\nApartmanda ya\u015famaya al\u0131\u015famad\u0131m. (ge\xe7mi\u015f zaman)\n\n-Can your son get used to his new friends?\nO\u011flunuz yeni arkada\u015flar\u0131na al\u0131\u015fabilecek mi? (kip belirteci)\n\n-Will your wife get used to getting up early?\nE\u015finiz erken kalkmaya al\u0131\u015facak m\u0131? (gelecek zaman)\n\n-Are you getting used to cooking?\nYemek yapmaya al\u0131\u015f\u0131yor musun? (\u015fimdiki zaman)\n\n-Our dog couldn\u2019t get used to our new cat.\nK\xf6pe\u011fimiz yeni kedimize al\u0131\u015famad\u0131.\n\n-The baby will not get used to the new sitter.\nBebek yeni bak\u0131c\u0131ya al\u0131\u015fmayacak.\n\n-In life you don\u2019t understand things, you just get used to them.\nHayatta baz\u0131 \u015feyleri anlam\u0131yorsun, sadece al\u0131\u015f\u0131yorsun.\n\n-Whatever you experience, you will soon get used to it.\nNe ya\u015farsan ya\u015fa, yak\u0131nda buna al\u0131\u015facaks\u0131n.\n\n-NASA says it takes months for astronauts to get used to space.\nNASA, astronotlar\u0131n uzaya al\u0131\u015fmas\u0131n\u0131n aylar s\xfcrd\xfc\u011f\xfcn\xfc s\xf6yl\xfcyor.\n\n-Is it good or bad to get used to?\nAl\u0131\u015fmak iyi mi k\xf6t\xfc m\xfc?\n\n-He lived in England for years but never got used to the weather.\nY\u0131llarca \u0130ngiltere\u2019de ya\u015fad\u0131 ama havaya hi\xe7 al\u0131\u015famad\u0131.\n\n-Anna could never get used to the street lifestyle in the city.\nAnna \u015fehirdeki sokak ya\u015fam\u0131na bir t\xfcrl\xfc al\u0131\u015famad\u0131.\n\n-Marriage is like a hot bath. Once you get used to it, it\u2019s not so hot.\nEvlilik s\u0131cak bir banyo gibidir. Bir kere al\u0131\u015f\u0131nca o kadar da s\u0131cak de\u011fil.\n\n",null,B.u,null,null,null,null,null,null)
B.OL=new A.R("            \nThe little sisters went into the room to play at the ball. \u201cWe must be careful not to wake the white cat,\u201d the tall one said, softly.\u201cOr to spoil the roses,\u201d the fat one whispered;\n\n\u201cBut throw high dear sister, or we shall never hit the ceiling.\u201d\n\n\u201cYou dear children,\u201d thought the white cat,\n\n\u201cWhy do you come to play here at all? Only just round the corner are the shady trees, and the birds singing on the branches, and the sunshine is flecking the pathway. Who knows but what, out there, your ball might touch the sky? Here you will only disturb me, and perhaps spoil the roses, and at best you can but hit the ceiling!\u201d\n            ",null,B.u,null,null,null,null,null,null)
B.OM=new A.R("              \n          \u0130ngilizcede Y\xf6n Bildiren Edatlar\n\nBu edatlar herhangi bir yerden veya konumdan ziyade g\xfczergah veya istikamet hakk\u0131nda bilgilendirme yapar. Y\xf6n bildirmek i\xe7in kullan\u0131lan edatlardan yayg\u0131n kullan\u0131lanlar a\u015fa\u011f\u0131daki tabloda derlenmi\u015ftir:\n\nabove\t    \xfczerinde, \xfcst\xfcnde, \xfczerine\n\nacross\t    kar\u015f\u0131s\u0131nda, kar\u015f\u0131ya\n\nalong\t    boyunca\n\naround\t    \xe7evresinde, etraf\u0131nda, etraf\u0131na, \xe7evresine, sular\u0131nda, a\u015fa\u011f\u0131 yukar\u0131\n\nat\t    -ye/ya, -e/a\n\nby way of\t    yoluyla\n\nby\t    yan\u0131nda, kenar\u0131nda, ba\u015f\u0131nda\n\nbeside\t    yan\u0131nda, kenar\u0131nda, ba\u015f\u0131nda\n\npast\t    ge\xe7erek, ge\xe7ip\n\ndown\t    a\u015fa\u011f\u0131ya do\u011fru, boyunca, a\u015fa\u011f\u0131s\u0131nda, a\u015fa\u011f\u0131s\u0131na do\u011fru, beri\n\ninto\t    i\xe7ine, haline, i\xe7eriye, -e, -ye\n\nonto\t    \xfcst\xfcne, \xfczerine, -e\n\nout off\t    -den/dan, -in d\u0131\u015f\u0131nda, d\u0131\u015f\u0131na,\n\non the way to\t    yolu \xfczerinde\n\nover\t    \xfczerinde, \xfczerinden, boyunca, a\u015f\u0131r\u0131, \xfcst\xfcnde, \xfcst\xfcne\n\nthrough\t    sayesinde, i\xe7inden, aras\u0131ndan, y\xfcz\xfcnden, ba\u015ftan ba\u015fa, bir u\xe7tan bir uca\n\nto\t    g\xf6re, kar\u015f\u0131, -e, -ye, -ya, -e do\u011fru\n\ntowards\t    kar\u015f\u0131, y\xf6n\xfcnde, -e do\u011fru, -e kar\u015f\u0131, -e yak\u0131n\n\nup\t    yukar\u0131, yukar\u0131ya, tepesinde, i\xe7eride\n\nupon\t    \xfczerine, \xfczerinde\n\nAcross, above, over gibi edatlar y\xf6n bildirdi\u011fi gibi yer bildiren edat g\xf6revinde de kullan\u0131labilirler.\n\nThe horse jumped over the wall.\n\nAt duvar\u0131n \xfczerinden atlad\u0131.\n\nThe plane flew above/over the hill.\n\nU\xe7ak tepenin \xfcst\xfcnden/\xfczerinden u\xe7tu.\n\nThe children walked up the hill.\n\n\xc7ocuklar tepeye do\u011fru y\xfcr\xfcd\xfcler.\n\nThe children walked down the hill.\n\n\xc7ocuklar tepeden a\u015fa\u011f\u0131 y\xfcr\xfcd\xfcler.\n\nThe children walked over the hill.\n\n\xc7ocuklar tepenin \xfczerinden y\xfcr\xfcd\xfcler.\n\n\u2757 \u0130ngilizcede into edat\u0131 yerine in edat\u0131 daha yayg\u0131n bir \u015fekilde kullan\u0131lmaktad\u0131r.\n\n\u2757 By edat\u0131 ile beside birbirlerinin yerine kullan\u0131labilirler:\n\nCan we have a table beside the window?\n\nCan we have a table by the window?\n\nPencerenin yan\u0131nda bir masa alabilir miyiz?\n\n",null,B.u,null,null,null,null,null,null)
B.ON=new A.R("              \n\u2795 Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + must have V3.\n\n\u2757 Must olumsuz ve sorularda kullan\u0131lamad\u0131\u011f\u0131 i\xe7in onun yerine can kullan\u0131l\u0131r.\n\n\u2796 Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + can\u2019t have V3.\nSubject (I, you, we, they, he, she, it) + cannot have V3.\n\n\u2753 Soru c\xfcmleleri\nCan + subject (I, you, we, they, he, she, it) + have V3?\nCan\u2019t + subject (I, you, we, they, he, she, it) have V3?\n\n\n\xd6rnek telaffuzlar:\n\ud83d\udd0a must have,\n\ud83d\udd0a cannot have,\n\ud83d\udd0a can\u2019t have\n\nPerfect modals yap\u0131lar\u0131ndan biri olan bu yap\u0131n\u0131n kullan\u0131m alanlar\u0131yla alakal\u0131 \xf6rnek c\xfcmleler a\u015fa\u011f\u0131daki tabloda listelenmi\u015ftir:\n\nAnna hasn\u2019t come yet here. She must have missed the bus.\nAnna hen\xfcz buraya gelmedi. Otob\xfcs\xfc ka\xe7\u0131rm\u0131\u015f olmal\u0131.\n\nShe said her car was old, I guess it must have broken down\nArabas\u0131n\u0131n eski oldu\u011funu s\xf6yledi, san\u0131r\u0131m bozulmu\u015f olmal\u0131.\n\nThe ground is wet, it must have rained last night.\nYer \u0131slak, d\xfcn gece ya\u011fmur ya\u011fm\u0131\u015f olmal\u0131.\n\nHe bought a new computer. He must have been paid.\nYeni bir bilgisayar sat\u0131n ald\u0131. Ona \xf6deme yap\u0131lm\u0131\u015f olmal\u0131.\n\nHe looked very happy today. I think he must have reconciled with his wife.\nBug\xfcn \xe7ok mutlu g\xf6r\xfcn\xfcyordu. San\u0131r\u0131m kar\u0131s\u0131yla bar\u0131\u015fm\u0131\u015f olmal\u0131.\n\nHe had been saving money for a long time. I guess he must have bought it with that.\nUzun zamand\u0131r para biriktiriyordu. San\u0131r\u0131m onunla sat\u0131n alm\u0131\u015f olmal\u0131.\n\nThe baby cannot have been hungry. The nanny just fed him.\nBebek a\xe7 olamaz. Dad\u0131 onu az \xf6nce besledi.\n\nThe electricity was off all day, so she must have slept.\nB\xfct\xfcn g\xfcn elektrik kesikti, o y\xfczden uyumu\u015f olmal\u0131.\n\nCan Thomas have returned from Germany?\nThomas, Almanya\u2019dan d\xf6nm\xfc\u015f olabilir mi?\n\n",null,B.u,null,null,null,null,null,null)
B.OO=new A.R("              \nEdilgen \xe7at\u0131y\u0131 yapabilmek i\xe7in etken (active) c\xfcmledeki fiilin nesnesi, edilgen (passive) c\xfcmlede \xf6zne konumuna ge\xe7er ve etken c\xfcmledeki zamana g\xf6re be + past participle (V3) olacak \u015fekilde kurgulan\u0131r:\n\nThe concert has been cancelled due to covid 19.\nKonser, covid 19 nedeniyle iptal edilmi\u015ftir.\n\u2757 Bir eylemi edilgen \xe7at\u0131 yapabilmek i\xe7in kullan\u0131lacak fiilin ge\xe7i\u015fli yani nesne alabilen bir fiil olmas\u0131 gerekir.\n\n\u2757 Edilgen \xe7at\u0131 olan c\xfcmlelerde genel olarak eylemi kimin ger\xe7ekle\u015ftirdi\u011fi vurgulanmaz ancak bu bilgiyi de eklemek istiyorsak, edilgen c\xfcmleden sonra by kullanarak eylemi yapan\u0131 (agent) ekleyebiliriz.\n\n\u25b6\ufe0f Active (Etken)\nI am repairing the car.\nArabay\u0131 tamir ediyorum.\n\u25b6\ufe0f Passive (Edilgen)\nThe car is being repaired (by me)\nAraba (benim taraf\u0131mdan) tamir ediliyor.\n\n\n\u2757 Kimi edilgen c\xfcmlelerde \u201cby\u201d yerine with kullan\u0131labilir. B\xf6ylesi c\xfcmlelerde i\u015fi yapan as\u0131l ki\u015fi yerine i\u015fi yapmaya vesile olan, arac\u0131 olan \u015fey (tool) vurgulan\u0131r.\n\n\u25b6\ufe0f Active (Etken)\nThe knife cut the paper.\nB\u0131\xe7ak ka\u011f\u0131d\u0131 kesti.\n\u25b6\ufe0f Passive (Edilgen)\nThe paper was cut with a knife.\nKa\u011f\u0131t b\u0131\xe7akla kesildi.\n\nWith ile asl\u0131nda birisinin b\u0131\xe7a\u011f\u0131 kullanarak ka\u011f\u0131d\u0131 kesti\u011fi vurgusu var. Zira ara\xe7 bir i\u015fi kendi ba\u015f\u0131na yapamaz, muhakkak o i\u015fi yapabilecek ba\u015fka bir arac\u0131ya ihtiya\xe7 duyar. Yani bu c\xfcmlenin arka plan\u0131n\u0131nda asl\u0131nda a\u015fa\u011f\u0131daki bir anlam yatmakta:\n\nSomeone cut the paper with a knife.\nBirisi ka\u011f\u0131d\u0131 b\u0131\xe7ak kullanarak kesti.\n\n\u2757 Bir arac\u0131 (agent) sizin i\xe7in bir g\xf6revi yerine getirirken, bir ara\xe7 (tool) bir g\xf6revi yapman\u0131za yard\u0131mc\u0131 olur. Passive voice c\xfcmlelerindeki with ile by aras\u0131ndaki en temel fark budur.\n\nThe path was covered with leaves.\nYol yapraklarla kapl\u0131yd\u0131.\n\nYukar\u0131daki \xf6rne\u011fimizde ise g\xf6r\xfclece\u011fi \xfczere yolun yapraklarla kapl\u0131 oldu\u011fu vurgulanmak istemi\u015ftir. Ancak yapraklar kendi ba\u015flar\u0131na yolu kaplayamayaca\u011f\u0131 i\xe7in \xf6rnek olarak r\xfczgar gibi bir arac\u0131n\u0131n sebep oldu\u011fu d\xfc\u015f\xfcn\xfcld\xfc\u011f\xfcnden by yerine with kullan\u0131lm\u0131\u015ft\u0131r.\n\nEdilgen Yap\u0131n\u0131n Kullan\u0131lma Nedenleri\n\n\u2705 Bilimsel makaleler gibi \xe7o\u011fu zaman i\u015fi kimin ya de neyin yapt\u0131\u011f\u0131n\u0131n \xf6nemli olmamas\u0131 ya da konu d\u0131\u015f\u0131 olmas\u0131 nedeniyle edilgen \xe7at\u0131 kullan\u0131l\u0131r.\n\n\u2705 Etken c\xfcmlenin nesnesi e\u011fer \xf6znesinden daha \xf6nemli ise edilgen \xe7at\u0131 kullan\u0131l\u0131r.\n\n\u2705 E\u011fer i\u015fi yapan bilinmiyorsa edilgen \xe7at\u0131 kullan\u0131l\u0131r.\n\n\u2705 Kimi durumlarda do\u011fru anlam\u0131 verebilmek ad\u0131na edilgen \xe7at\u0131n\u0131n kullan\u0131lmas\u0131 gerekebilir.\n\n\u2705 Baz\u0131 durumlarda i\u015fi yapan gizlenmek istenir. B\xf6ylesi durumlarda edilgen \xe7at\u0131 kullan\u0131l\u0131r.\n",null,B.u,null,null,null,null,null,null)
B.OP=new A.R("              \nKi\u015filerin sahip olduklar\u0131 \u015feyleri ifade etmek i\xe7in kullan\u0131lan have got, \xfc\xe7\xfcnc\xfc tekil \u015fah\u0131s zamirlerinde (he, she, it) ve Tom, Anna vb. tekil ki\u015filerde has got olarak \xe7ekimlenmektedir.\n\nA\u015fa\u011f\u0131daki tabloda \u015fah\u0131s zamirlerine g\xf6re have got yap\u0131s\u0131n\u0131n olumlu, olumsuz ve soru halinde kullan\u0131mlar\u0131 g\xf6sterilmi\u015ftir:\n\n\u2795 Olumlu c\xfcmleler\nI/you/we/they + have got\nI/you/we/they + \u2018ve got\nHe/she/it + has got\nHe/she/it + \u2018s got\n\n\u2b50 \xd6rnek:\n-She has got two children.\nOnun iki \xe7ocu\u011fu var\n-Thomas has got a new car.\nThomas\u2019\u0131n yeni bir arabas\u0131 var.\n-I have got a dog.\nBenim bir k\xf6pe\u011fim var.\n\n\u2796 Olumsuz c\xfcmleler\nI/you/we/they + have not got\nI/you/we/they + haven\u2019t got\nHe/she/it + has not got\nHe/she/it + hasn\u2019t got\n\n\u2b50 \xd6rnek:\n-She hasn\u2019t got any children.\nOnun hi\xe7 \xe7ocu\u011fu yok\n-Thomas hasn\u2019t got a new car.\nThomas\u2019\u0131n yeni bir arabas\u0131 yok.\n-I have not got a dog.\nBenim k\xf6pe\u011fim yok.\n\n\u2753 Soru c\xfcmleleri\nHave + I/you/we/they + got?\nHaven\u2019t + I/you/we/they + got?\nHas + he/she/it + got?\nHasn\u2019t + he/she/it + got?\n\n\u2b50 \xd6rnek c\xfcmleler:\n-Haven\u2019t you got some bread?\nBiraz ekme\u011fin yok mu?\n-Has Tom got any money?\nTom\u2019un hi\xe7 paras\u0131 var m\u0131?\n-Has she got any children?\nOnun hi\xe7 \xe7ocu\u011fu var m\u0131?\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\nYes, I/you/we/they have got.\nYes, I/you/we/they\u2018ve got.\nYes, He/she/it has got.\nYes, He/she/it\u2018s got.\n\u2757 Evet-Hay\u0131r sorular\u0131na k\u0131sa evet cevaplar\u0131 k\u0131saltma ile verilmez.\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\nNo, I/you/we/they have not got.\nNo, I/you/we/they haven\u2019t got.\nNo, he/she/it has not got.\nNo, he/she/it hasn\u2019t got.\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a have got,\n\ud83d\udd0a I\u2019ve got,\n\ud83d\udd0a has got,\n\ud83d\udd0a he\u2019s got,\n\ud83d\udd0a have not got,\n\ud83d\udd0a haven\u2019t got,\n\ud83d\udd0a has not got,\n\ud83d\udd0a hasn\u2019t got\n\n          \u0130ngilizcede have ile Sahiplik Anlat\u0131m\u0131\n\n\u0130ngilizcede have got yap\u0131s\u0131, \u0130ngiltere\u2019de yayg\u0131n bir \u015fekilde kullan\u0131lmaktad\u0131r. Amerika\u2019da bu ifade daha \xe7ok got k\u0131sm\u0131 at\u0131lm\u0131\u015f haliyle, yani have \u2013 has \u015feklindedir. Haliyle Amerikan kullan\u0131m\u0131nda olumsuz ve soru halleri de de\u011fi\u015fkenlik g\xf6stermektedir.\n\nA\u015fa\u011f\u0131daki tabloda \u015fah\u0131s zamirlerine g\xf6re have yap\u0131s\u0131n\u0131n olumlu, olumsuz ve soru hallerindeki kullan\u0131mlar\u0131 derlenmi\u015ftir:\n\n\u2795 Olumlu c\xfcmleler\nI/you/we/they + have\nHe/she/it + has\n\n\u2b50 \xd6rnek c\xfcmleler:\n-She has two children.\nOnun iki \xe7ocu\u011fu var\n-Thomas has a new car.\nThomas\u2019\u0131n yeni bir arabas\u0131 var.\n-I have a dog.\nBenim bir k\xf6pe\u011fim var.\n\n\u2796 Olumsuz c\xfcmleler\nI/you/we/they + do not have\nI/you/we/they + don\u2019t have\nHe/she/it + does not have\nHe/she/it + doesn\u2019t\n\n\u2b50 \xd6rnek c\xfcmleler:\n-She doesn\u2019t have any children.\nOnun hi\xe7 \xe7ocu\u011fu yok\n-Thomas doesn\u2019t have a new car.\nThomas\u2019\u0131n yeni bir arabas\u0131 yok.\n-I don\u2019t have a dog.\nBenim k\xf6pe\u011fim yok.\n\n\u2753 Soru c\xfcmleleri\nDo + I/you/we/they + have?\nDon\u2019t + I/you/we/they + have?\nDoes + he/she/it + have?\nDoesn\u2019t + he/she/it + have?\n\n\u2b50 \xd6rnek c\xfcmleler:\n-Don\u2019t you have some bread?\nBiraz ekme\u011fin yok mu?\n-Do you have any money?\nHi\xe7 paran var m\u0131?\n-Does she have any children?\nOnun hi\xe7 \xe7ocu\u011fu var m\u0131?\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\nYes, I/you/we/they do.\nYes, He/she/it does.\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\nNo, I/you/we/they do not.\nNo, I/you/we/they don\u2019t.\nNo, he/she/it does not.\nNo, he/she/it doesn\u2019t.\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a have,\n\ud83d\udd0a I\u2019ve,\n\ud83d\udd0a has,\n\ud83d\udd0a he\u2019s,\n\ud83d\udd0a have not,\n\ud83d\udd0a haven\u2019t,\n\ud83d\udd0a has not,\n\ud83d\udd0a hasn\u2019t\n\n          Have got ile have Fark\u0131 Nedir?\n\nBu iki yap\u0131 birbirlerinden anlam olarak bir fark bulunmasa da yukar\u0131da da fark edece\u011finiz \xfczere yap\u0131sal farkl\u0131l\u0131klar bulunmaktad\u0131r.\n\n\u2757 Bu iki yap\u0131y\u0131 da ki\u015filerin sahip oldu\u011fu, onlarda olan \u015feyleri anlat\u0131rken kullanmakta fayda var. Zira T\xfcrk\xe7e \xe7evirilerinde \u201cvar\u201d anlam\u0131 \u015fehir, ev gibi yap\u0131larda bulunan \u015feylerde de kullan\u0131labilirken \u0130ngilizcede bu tarz c\xfcmleler i\xe7in there is \u2013 there are yap\u0131s\u0131 kullan\u0131l\u0131r.\n\nThere are five rooms in the house.\nEvde be\u015f tane oda var.\nThere are thirty-nine districts in Istanbul.\n\u0130stanbul\u2019da otuz dokuz tane il\xe7e var.\nThere is one toilet in the bathroom.\nBanyoda bir tane tuvalet var.\n\n\u2757 ABD ve \u0130ngiltere versiyonlar\u0131nda kullan\u0131m farkl\u0131l\u0131klar\u0131 olsa da benzer anlamlarda kullan\u0131lan bu iki yap\u0131 birbirlerinin yerine kullan\u0131lmaz. Yani, have got kullan\u0131larak sorulan bir soruya have kullanarak cevap vermek yanl\u0131\u015f oldu\u011fu gibi tam tersi, have kullanarak sorulan sahiplik sorusuna have got ile cevap vermek yanl\u0131\u015f olacakt\u0131r:\n",null,B.u,null,null,null,null,null,null)
