B.OS=new A.R("            \nTina 6 ya\u015f\u0131nda sevimli bir k\u0131zd\u0131. Tahta oyuncaklara \xe7ok d\xfc\u015fk\xfcnd\xfc, \xf6zellikle 2 ya\u015f\u0131ndayken amcas\u0131 taraf\u0131ndan hediye edilen g\xfczel bir tahta at\u0131 vard\u0131. Tahta at, onun yak\u0131n arkada\u015f\u0131 ve evcil hayvan\u0131 olmu\u015ftu. 9 ya\u015f\u0131nda bir abisi vard\u0131. Ailesiyle birlikte ormanda bir do\u011fa tesisine tatile gitti. Tahta at\u0131 yan\u0131nda ta\u015f\u0131d\u0131. Tatilinde ailesiyle birlikte ormanda e\u011flendi. \n\nEve d\xf6nmeyi planlad\u0131klar\u0131 \xfczere karde\u015fi ile e\u015fyalar\u0131 toplarken tahtadan at d\xfc\u015fm\xfc\u015ft\xfc ve bacaklar\u0131ndan biri k\u0131r\u0131lm\u0131\u015ft\u0131. Tina \xe7ok \xfcz\xfcld\xfc ve sessizce at\u0131 i\xe7in a\u011flad\u0131.\n\n\xc7ok mutsuzdu. Her \u015feyi toplad\u0131lar ve ormandan ayr\u0131ld\u0131lar. B\xfct\xfcn aile tatl\u0131 k\xfc\xe7\xfck k\u0131z\u0131 ne\u015felendirmeye \xe7al\u0131\u015ft\u0131, ama Tina \xe7ok sessiz, \xe7ok \xfczg\xfcnd\xfc. Tina\u2019n\u0131n karde\u015fi onu \xe7ok fazla teselli etmeye \xe7al\u0131\u015ft\u0131.\n\n\xd6\u011fle yeme\u011fi i\xe7in mola verdiler ve Tina yemek yemeyi reddetti. Annesi yemek yemesini istedi, \xe7ok az miktarda yemek yedi.\n\nDi\u011ferleri yemek yerken sessizce araban\u0131n i\xe7inde oturdu. Abisi onun yan\u0131na geldi ve yana\u011f\u0131n\u0131 \xf6pt\xfc, ona dedi ki,\n\n\u201cTina can\u0131m, endi\u015felenme, \xfcz\xfclme can\u0131m. Bu sadece bir tahta oyuncak. At\u0131n bizim gibi bir hayat\u0131 yok ve bu cans\u0131z bir \u015fey. K\u0131r\u0131lan bacak i\xe7in \xe7ok \xfcz\xfclme. At kuyru\u011funu kaybetse bile, bu at\u0131 incitmeyecek. D\xf6rt baca\u011f\u0131n tamam\u0131 k\u0131r\u0131lsa bile tahta at ayn\u0131 kal\u0131r. At kafas\u0131n\u0131 kaybetse bile, ac\u0131 vermez. Senin i\xe7in yeni bir tahta at alaca\u011f\u0131m!\u201d\n\nTina, \u201cEvcil hayvan oyunca\u011f\u0131m\u0131n baca\u011f\u0131n\u0131n k\u0131r\u0131lmas\u0131n\u0131n \xf6nemli olmad\u0131\u011f\u0131n\u0131 m\u0131 d\xfc\u015f\xfcn\xfcyorsun?\u201d diye cevaplad\u0131.\n\nKarde\u015fi, \u201cEvet can\u0131m!\u201d diye yan\u0131tlad\u0131.\n\nTina cevaplad\u0131, \u2018Evet abi hakl\u0131s\u0131n. At par\xe7alara ayr\u0131lsa bile, senin i\xe7in bu ya\u015fta \xf6nemli bir sorun olmayacak. Ama benim ya\u015f\u0131mdaysan, benim oldu\u011fu gibi bir evcil hayvan\u0131n varsa, at\u0131n k\xfc\xe7\xfck bir k\u0131sm\u0131 k\u0131r\u0131lsa bile bunun ne kadar ac\u0131 verici olaca\u011f\u0131n\u0131 hissedeceksin!\u201d\n\nErkek karde\u015fi sessizce ayr\u0131ld\u0131.\n            ",null,B.u,null,null,null,null,null,null)
