B.OU=new A.R("              \nD\xf6n\xfc\u015fl\xfc zamirler, \u015fah\u0131s zamirlerine -self ve -selves ekleri getirilerek olu\u015fturulmaktad\u0131r. \xd6zellikle kendi kendimize yapt\u0131\u011f\u0131m\u0131z i\u015fleri anlatmak i\xe7in kullan\u0131ld\u0131\u011f\u0131ndan anlam olarak T\xfcrk\xe7eye de haliyle \u201ckendi\u201d olarak \xe7evrilmektedir.\n\nI\n(ben)\t\n\nmyself\n(kendim)\n\nyou\n(sen)\t\n\nyourself\n(kendin)\n\nhe\n(o)\t\n\nhimself\n(kendisi)\n\nshe\n(o)\t\n\nherself\n(kendisi)\n\nit\n(o)\t\n\nitself\n(kendisi)\n\nwe\n(biz)\t\n\nourselves\n(kendimiz)\n\nyou\n(siz)\t\n\nyourselves\n(kendiniz)\n\nthey\n(onlar)\t\n\nthemselves\n(kendileri)\n\nReflexive Pronouns Kullan\u0131m\u0131\n\n\u2b50 \xd6znenin yapt\u0131\u011f\u0131 i\u015ften yine \xf6znenin etkilendi\u011fini anlat\u0131r:\n\n-Anna blamed herself for the accident.\nAnna kaza i\xe7in kendisini su\xe7lad\u0131.\n\n-I bought myself a good wallet.\nKendime iyi bir c\xfczdan ald\u0131m.\n\n-Diabetics give themselves insulin shots several times a day.\n\u015eeker hastalar\u0131 g\xfcnde birka\xe7 kez kendilerine ins\xfclin i\u011fnesi yaparlar.\n\n\u2b50 C\xfcmlede herhangi bir \xf6genin vurgulanmas\u0131n\u0131 sa\u011flarlar. Bu vurgu iki \u015fekilde yap\u0131l\u0131r.\n\n\n\u2757 \u0130\u015fi yapan ya da etkilenen \xf6zne vurgulanmak istenebilir. Bunu \xf6zneden hemen sonra d\xf6n\xfc\u015fl\xfc zamir kullanarak yapabilir. B\xf6ylesi bir kullan\u0131mda \u201cbizzat\u201d \u015feklinde T\xfcrk\xe7eye \xe7evrilebilir.\n\n-I myself am a stranger here.\nBen (bizzat) kendim burada bir yabanc\u0131y\u0131m.\n\n-My wife herself cooked the fish.\nKar\u0131m bal\u0131\u011f\u0131 bizzat kendisi pi\u015firdi.\n\n-Bill Gates himself could not have created a better software.\nBizzat Bill Gates\u2019in kendisi (bile) daha iyi bir yaz\u0131l\u0131m yaratamazd\u0131.\n\n\u2757 \xd6znenin g\xf6sterilen i\u015fi bizzat kendi ba\u015f\u0131na, ba\u015fkas\u0131ndan yard\u0131m almaks\u0131z\u0131n yapt\u0131\u011f\u0131 vurgulan\u0131r.\n\n\xd6zellikle by ilgeci ile beraber kullan\u0131ld\u0131\u011f\u0131nda (by + reflexive pronouns) kendi kendine, kendi ba\u015f\u0131na anlam\u0131 sa\u011flanm\u0131\u015f olunur.\n\n-The car drives by itself.\nAraba kendi kendine gidiyor.\n\n-I cooked the dish by myself!\nYeme\u011fi kendi ba\u015f\u0131ma pi\u015firdim!\n\n-I don\u2019t like eating by myself.\nKendi ba\u015f\u0131ma yemek yemeyi sevmiyorum.\n\n\u2757 by + reflexive pronoun yap\u0131s\u0131 anlam olarak on + possessive adjective + own ile ayn\u0131d\u0131r.\n\nby myself\ton my own\nby yourself\ton your own\nby himself\ton his own\nby herself\ton her own\nby itself\ton its own\nby ourselves\ton our own\nby yourselves\ton your own\nby themselves\ton their own\n\n\u0130ngilizcede Reflexive Pronouns\n\n-I played basketball by myself.\nKendi kendime basketbol oynad\u0131m.\n-I played basketball on my own.\nKendi kendime basketbol oynad\u0131m.\n\nReflexive Pronouns\u2019un C\xfcmle \u0130\xe7indeki Yeri\n\n\u2b50 Vurgulama g\xf6steren d\xf6n\xfc\u015fl\xfc zamirler vurgulad\u0131klar\u0131 ismin ard\u0131ndan kullan\u0131labildi\u011fi gibi c\xfcmle sonunda da kullan\u0131labilir.\n\n-John saw himself Madonna.\nJohn, bizzat kendisi Madonna\u2019y\u0131 g\xf6rd\xfc.\n-John saw Madonna himself.\nJohn, bizzat kendisi Madonna\u2019y\u0131 g\xf6rd\xfc.\n\n\u2757 D\xf6n\xfc\u015fl\xfcl\xfck zamirleri \xf6zne olarak kullan\u0131lamazlar!\n",null,B.u,null,null,null,null,null,null)
