B.OW=new A.R("              \nA\u015fa\u011f\u0131daki must yard\u0131mc\u0131 fiilinin olumlu, olumsuz ve soru c\xfcmlesi olarak kullan\u0131l\u0131\u015f\u0131 g\xf6sterilmi\u015ftir. Yaln\u0131z dikkat edilmesi gereken bir husus var ki must kip belirteci olumsuz c\xfcmlelerde (must not ya da mustn\u2019t) \xe7ok g\xfc\xe7l\xfc bir \u015fekilde negatif tavsiye anlat\u0131m\u0131 ve yasak bildirimi yapar.\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + must + V1\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + must not + V1\nSubject (I, you, we, they, he, she, it) + mustn\u2019t + V1\n\n\u27a1\ufe0f Soru c\xfcmleleri\nMust + subject (I, you, we, they, he, she, it) + V1 ?\nMust not + subject (I, you, we, they, he, she, it) + V1 ?\n\n\n\xd6rnek telaffuzlar\u0131:\n\n\ud83d\udd0a must,\n\ud83d\udd0a must not,\n\ud83d\udd0a mustn\u2019t\nMust kip belirtecinin kullan\u0131m alanlar\u0131 alt ba\u015fl\u0131klar halinde derlenmi\u015ftir;\n\n\u2b50 Gereklilik ve zorunluluk anlat\u0131mlar\u0131nda kullan\u0131l\u0131r. B\xf6ylesi durumlarda e\u011fer ki\u015fi kendisi hakk\u0131nda konu\u015fuyorsa, bahsi ge\xe7en gereklili\u011fe inand\u0131\u011f\u0131 g\xf6sterilmi\u015f olur.\n\nIf we desire respect for the law, we must first make the law respectable.\nHukuka sayg\u0131 istiyorsak, \xf6nce hukuku sayg\u0131de\u011fer hale getirmeliyiz.\nI must respect the opinions of others even if I disagree with them.\nBa\u015fkalar\u0131n\u0131n fikirlerine kat\u0131lmasam bile sayg\u0131 duymal\u0131y\u0131m.\n\n\u2b50 G\xf6zleme ve ger\xe7eklere dayal\u0131 tahminlerde kullan\u0131l\u0131r:\n\nGeorge\u2019s been driving all day \u2013 he must be tired.\nGeorge b\xfct\xfcn g\xfcn araba kullan\u0131yor \u2013 yorgun olmal\u0131.\nHe bought an expensive car. He must be rich.\nPahal\u0131 bir araba sat\u0131n ald\u0131. Zengin olmal\u0131.\n\n\u2b50 Alayc\u0131 bir ton ve k\u0131zg\u0131nl\u0131k katmak i\xe7in kullan\u0131l\u0131r:\n\n\nJohnnnn, must you stare at every woman who passes by?\nJohnnnn, yan\u0131ndan ge\xe7en her kad\u0131na bakmak zorunda m\u0131s\u0131n?\nI must say, you look absolutely great.\nS\xf6ylemeliyim ki, kesinlikle harika g\xf6r\xfcn\xfcyorsun.\nI must admit I enjoy these movies.\nI must admit I enjoy these movies.\n\n\u2b50 Tavsiye ifadelerinde kullan\u0131l\u0131r:\n\nIf you go to the USA you must obey the law there.\nABD\u2019ye giderseniz oradaki yasalara uymak zorundas\u0131n\u0131z.\nMeat must be cooked thoroughly.\nEt iyice pi\u015firilmelidir.\n\n\u2b50 \u0130nsani sorumluluklar\u0131 anlat\u0131r:\n\nWe must feed the hungry and clothe the naked.\nA\xe7lar\u0131 doyurmal\u0131, \xe7\u0131plaklar\u0131 giydirmeliyiz.\nWe must ensure against any future practice of abuse against women.\nGelecekte kad\u0131nlara y\xf6nelik herhangi bir istismar uygulamas\u0131na kar\u015f\u0131 g\xfcvence vermeliyiz.\n\n\u2b50 Must not (mustn\u2019t) ile yasak ifadeleri anlat\u0131l\u0131r:\n\nA pregnant woman mustn\u2019t drink alcohol.\nHamile bir kad\u0131n alkol almamal\u0131d\u0131r.\nChildren mustn\u2019t go to bed late in the evening.\n\xc7ocuklar ak\u015fam ge\xe7 yatmamal\u0131d\u0131r.\n\n\u2757 Mustn\u2019t, must c\xfcmlelerinde verilen gereklilik ifadesinin olumsuzluk kar\u015f\u0131l\u0131\u011f\u0131 sa\u011flanmaz. Gereklilik ifade etmedi\u011fi belirtilecekse must not (mustn\u2019t) de\u011fil don\u2019t have to veya needn\u2019t kullan\u0131lmal\u0131d\u0131r.\n\nYou must do the job properly.\n\u0130\u015fi d\xfczg\xfcn yapman gerekiyor.\nYou don\u2019t have to do the job properly.\n\u0130\u015fi d\xfczg\xfcn yapman gerekmiyor.\nYou needn\u2019t do the job properly.\n\u0130\u015fi d\xfczg\xfcn yapmana gerekmiyor\n",null,B.u,null,null,null,null,null,null)
