B.P8=new A.R("            \nNoel'de \xe7ocuklar bacadan hediyeler getirmek i\xe7in Aziz Nikolaos'u beklerler. Ama bu sadece bir hikaye de\u011fil. Aziz Nicholas ger\xe7ek bir insand\u0131.\n\nUzun zaman \xf6nce, Marcus ad\u0131nda bir adam ailesiyle birlikte bir evde oturuyordu. O m\xfctevaz\u0131 de\u011fildi. Herkese her zaman eyaletteki en g\xfc\xe7l\xfc adam oldu\u011funu s\xf6ylerdi.\n\n\xc7ok \xe7al\u0131\u015ft\u0131, ancak ailesini zar zor ge\xe7indirebildi. Para biriktirmek ve geli\u015fmek istiyordu. Yine de ihtiyac\u0131 olandan bir kuru\u015f fazlas\u0131n\u0131 asla kazanamad\u0131.\n\nBir g\xfcn Marcus bir demirciyle anla\u015fma yapt\u0131. Demircinin yapacak \xe7ok i\u015fi vard\u0131. Ama hepsini kendi ba\u015f\u0131na yapamazd\u0131. Marcus demir d\xf6vmesine yard\u0131m etmek istedi. Demirci ona \xe7ok para vermeyi kabul etti.\n\nAyn\u0131 kasabada Nicholas ad\u0131nda bir adam varm\u0131\u015f. Nicholas erken ya\u015fta vaaz vermeye ba\u015flad\u0131. Ama al\xe7akg\xf6n\xfcll\xfc ve hay\u0131rsever olmas\u0131 gerekti\u011fine de inan\u0131yordu. \u0130nsanlara yard\u0131m etmenin onu vaaz etmekten daha fazla tatmin etti\u011fini \xf6\u011frendi.\n\nBir g\xfcn Nicholas, Marcus'la kar\u015f\u0131la\u015ft\u0131. Marcus, Nicholas'a demirciyle yapt\u0131\u011f\u0131 anla\u015fmadan bahsetti. \"Onun i\xe7in \xe7ok \xe7al\u0131\u015ft\u0131m,\" dedi Marcus, \"ama bir sorun \xe7\u0131kt\u0131. Onun i\xe7in \xe7al\u0131\u015fmama ra\u011fmen bana \xf6deme yapmad\u0131.\u201d\n\nNicholas, Marcus'a yard\u0131m etmek istedi. O gece, Marcus'un evine geri d\xf6nd\xfc. Bir kese alt\u0131n getirdi. Marcus'un ihtiya\xe7 duydu\u011fu miktar\u0131 a\u015ft\u0131. Nicholas bir merdivene t\u0131rmand\u0131 ve alt\u0131n torbas\u0131n\u0131 bacadan a\u015fa\u011f\u0131 d\xfc\u015f\xfcrd\xfc. Marcus velinimetine te\u015fekk\xfcr etti.\n\nYak\u0131nda insanlar Nicholas'\u0131n hediyesini \xf6\u011frendi. \u0130yi tan\u0131nd\u0131 ve sevildi. Bug\xfcn bile insanlar hala \xe7ocuklara gizli hediyeler veriyor. Biz de onlar\u0131n St. Nicholas'tan oldu\u011funu s\xf6yl\xfcyoruz.\n            ",null,B.u,null,null,null,null,null,null)
