B.Pa=new A.R("              \n\u0130simler \u0130ngilizcede say\u0131l\u0131p say\u0131lamamalar\u0131na g\xf6re say\u0131labilen ve say\u0131lamayan isimler (countable and uncountable nouns) olarak ikiye ayr\u0131lmaktad\u0131r.\n\n          Say\u0131labilen \u0130simler (Countable Nouns)\n\nBu tarz isimler say\u0131 ile say\u0131labilmesinden \xf6t\xfcr\xfc bu adland\u0131rmay\u0131 alm\u0131\u015ft\u0131r. Say\u0131labilmesi \u201csomut\u201d olarak kolay olan bu isimler tekil ve \xe7o\u011ful formlarda bulunabilirler.\n\nAyr\u0131ca say\u0131labilen isimler tekil formlar\u0131ndayken a, an ve the artikellerini alabilirler. Buna kar\u015f\u0131l\u0131k say\u0131lamayan isimler a, an belirsiz artikellerini alamaz ancak the belirli artikelini alabilirler.\n\nSay\u0131labilen isimlerde \xe7ok miktarlar\u0131 ifade edebilmek i\xe7in many, az ama yeterli miktarlar\u0131 ifade edebilmek i\xe7in a few, az ama yetersiz miktarlar\u0131 ifade edebilmek i\xe7in few kelimelerini kullan\u0131r\u0131z. Hi\xe7 yoksa any kelimesini kullanmak yerinde olacakt\u0131r.\n\nI have three apples.\n\n\xdc\xe7 adet elmam var.\n\nHe has an apple.\n\nBir adet elmas\u0131 var.\n\nJohn doesn\u2019t have any apples.\n\nJohn\u2019un hi\xe7 elmas\u0131 yok.\n\nThere aren\u2019t many tomatoes left.\n\nFazla domates kalmad\u0131.\n\nSay\u0131lamayan \u0130simler (Uncountable Nouns)\n\nTek tek say\u0131lmas\u0131 bir hayli zor olan sa\xe7, \u015feker, pirin\xe7 gibi kelimelerle, belirli sabit bir formu olmayan su, s\xfct gibi ak\u0131\u015fkan maddeler bu tarz bir adland\u0131rmayla an\u0131l\u0131r. Ayr\u0131ca knowledge (bilgi), advice (tavsiye) gibi soyut olan kelimeler de say\u0131lamayan isimlerdir. Haliyle bu tarz isimler herhangi bir \xe7o\u011ful forma sahip olamazlar.\n\nCollecetive nouns ad\u0131 verilen ve do\u011fal olarak bir arada bulunan furniture (mobilya), equipment (ekipman), traffic (trafik) gibi isimler de say\u0131lamayan isimlerdir.\n\nSadece tekil format\u0131 ile kullan\u0131lmalar\u0131n\u0131n yan\u0131 s\u0131ra a, an gibi miktar belirten artikeller de kullan\u0131lamaz. Yani money, rice yerine moneys rices gibi kullan\u0131mlar yanl\u0131\u015f olacakt\u0131r. Ayr\u0131ca daima tekil kullan\u0131ld\u0131\u011f\u0131 gibi c\xfcmledeki fiilin \xe7ekimi 3.tekil \u015fah\u0131s zamirine g\xf6re olmal\u0131d\u0131r.\n\nPeki say\u0131labilen isimler \xe7o\u011ful formata sahip de\u011filse sahip olduklar\u0131 miktarlar\u0131 nas\u0131l ifade edece\u011fiz sorusu gelebilir. B\xfcy\xfck miktarlar\u0131 ifade edebilmek i\xe7in much ve az ama yetersiz miktarlar i\xe7in little, az ama yeterli miktarlar\u0131 ifade edebilmek i\xe7in a little kullan\u0131r\u0131z. A lot of ve lots of kelimeleri hem say\u0131labilen hem de say\u0131lamayan isimlerle birlikte kullan\u0131labilir.\n\nThis rice doesn\u2019t taste right.\n\nBu pirincin tad\u0131 d\xfczg\xfcn de\u011fil.\n\nIs there any money left?\n\nHi\xe7 para kald\u0131 m\u0131?\n\nThere\u2019s a little money in my wallet.\n\nC\xfczdan\u0131mda biraz para var.\n\nThere isn\u2019t much milk.\n\nFazla s\xfct yok.\n\nBaz\u0131 kelimeler sahip olduklar\u0131 anlamlara g\xf6re hem say\u0131labilen hem de say\u0131lamayan olarak nitelendirilmektedir. \xd6rne\u011fin, paper kelimesi ka\u011f\u0131t anlam\u0131nda iken say\u0131lamayan bir isim olarak de\u011ferlendirilirken gazete anlam\u0131nda iken say\u0131labilen bir isim format\u0131na b\xfcr\xfcn\xfcr.\n\nSay\u0131lamayan bir ismi say\u0131labilen bir isim yapmak i\xe7in \xf6n\xfcne say\u0131labilen bir isim getirilebilir. Say\u0131labilen bir sim + of + say\u0131lamayan bir isim; milk \u2013> a bottle of milk\n\nS\xf6zl\xfcklerde arad\u0131\u011f\u0131n\u0131z kelimeleri caountable veya uncountable oldu\u011funu g\xf6stermek i\xe7in c veya u \u015feklinde notlar g\xf6rebilirsiniz.\n\nA\u015fa\u011f\u0131daki tabloda \u0130ngilizcede say\u0131labilen ve say\u0131lamayan isimler ile beraber kullan\u0131lan birtak\u0131m kelimeler listelenmi\u015ftir:\n\nCAUNTABLE NOUNS\n\nSay\u0131labilen \u0130simler\t\n\na-an, the\t\n\nmany\t\n\nfew (yetersiz azl\u0131k)\n\na few (yeterli azl\u0131k)\t\n\na lot of\n\nlots of\n\nUNCOUNTABLE NOUNS\n\nSay\u0131lamayan \u0130simler\n\nthe\n\nfiil sadece 3.Tekil \u015fah\u0131s format\u0131nda\n\nmuch (\xe7okluk)\n\nlittle (yetersiz azl\u0131k)\n\na little (yeterli azl\u0131k)\n\na lot of\n\nlots of\n",null,B.u,null,null,null,null,null,null)
B.Pb=new A.R("              \nBu yaz\u0131m\u0131zda \u0130ngilizcede tavsiye anlat\u0131mlar\u0131 i\xe7in yararlanabilece\u011fimiz ifadelerden olan recommend ve avoid kullan\u0131mlar\u0131n\u0131 derledik.\n\n\u0130ngilizcede tavsiye ifadeleri anlat\u0131rken genel olarak to recommend (tavsiye etmek) ve to avoid (ka\xe7\u0131nmak) gibi ifadeler kullan\u0131lmaktad\u0131r.\n\n\u2757 \u0130ngilizcede belirli eylemleri tavsiye etmek i\xe7in \u201crecommend\u201d kullan\u0131l\u0131r. Recommend s\xf6zc\xfc\u011f\xfcnden hemen sonra gelen fiile -ing eki getirilir\n\n\u25b6\ufe0f recommend + Ving\n\nI can recommend the chicken in mushroom sauce \u2013 it\u2019s delicious.\n\nMantar soslu tavu\u011fu tavsiye edebilirim \u2013 \xe7ok lezzetli.\n\nI recommend visiting the ancient city of Side.\n\nSide antik kentini ziyaret etmenizi \xf6neririm.\n\nWe recommend that this wine should be consumed within six months.\n\nBu \u015farab\u0131n alt\u0131 ay i\xe7inde t\xfcketilmesini \xf6neriyoruz.\n\nMy teacher recommends reading this book.\n\n\xd6\u011fretmenim bu kitab\u0131 okuman\u0131z\u0131 tavsiye ediyor.\n\n\u2757 Tabi tavsiye ya da \xf6nerilerimizi olumsuz manalarda da kullanabiliriz. b\xf6ylesi durumlarda, yani birisinin belirli bir yer veya \u015feyden veya eylemden ka\xe7\u0131nmas\u0131n\u0131 tavsiye etmek i\xe7in avoid kullan\u0131lmaktad\u0131r.\n\n\u25b6\ufe0f \u0130sim gelirse; avoid + isim\n\u25b6\ufe0f Fiil gelirse; avoid + Ving\n\nYou should avoid the salty foods.\n\nTuzlu yiyeceklerden ka\xe7\u0131nmal\u0131s\u0131n\u0131z.\n\nYou should avoid smoking.\n\nSigara i\xe7mekten ka\xe7\u0131nmal\u0131s\u0131n\u0131z.\n\nIf you want to lose weight, avoid eating between meals.\n\nKilo vermek istiyorsan\u0131z, \xf6\u011f\xfcn aralar\u0131nda yemek yemekten ka\xe7\u0131n\u0131n.\n\nIf we set off early tomorrow morning we\u2019ll avoid most of the traffic.\n\nYar\u0131n sabah erkenden yola \xe7\u0131karsak trafi\u011fin \xe7o\u011fundan kurtuluruz.\n\n\u2757 \u0130ngilizcede birisine tavsiye verirken \u201cit\u2019s worth a try\u201d (denemeye de\u011fer) kal\u0131b\u0131 da yayg\u0131n bir \u015fekilde kullan\u0131lmaktad\u0131r.\n\nI\u2019ve only heard good things about the cafe, I guess it\u2019s worth a try.\n\nKafe hakk\u0131nda sadece iyi \u015feyler duydum, san\u0131r\u0131m denemeye de\u011fer.\n\nI\u2019m not sure you\u2019ll like the movie, but I think it\u2019s worth a try.\n\nFilmi be\u011fenece\u011finizden emin de\u011filim ama bence denemeye de\u011fer.\n\n",null,B.u,null,null,null,null,null,null)
B.Pc=new A.R("              \nA\u015fa\u011f\u0131daki tabloda could kip belirtecinin olumlu, olumsuz ve soru c\xfcmlelerinde kullan\u0131m\u0131 g\xf6sterilmi\u015ftir.\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + could + V1\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + couldn\u2019t + V1\nSubject (I, you, we, they, he, she, it) + could not + V1\n\n\u27a1\ufe0f Soru c\xfcmleleri\nCould + subject (I, you, we, they, he, she, it) + V1 ?\nCouldn\u2019t + subject (I, you, we, they, he, she, it) + V1 ?\n\n\nTelaffuzlar\u0131:\n\n\ud83d\udd0a could,\n\ud83d\udd0a could not,\n\ud83d\udd0a couldn\u2019t,\n\u2757 could kip belirteci silent l\u2019ye sahiptir. Dikkatli dinlerseniz l harfinin okunmad\u0131\u011f\u0131 fark edilecektir.\n\nAlt ba\u015fl\u0131klar halinde could kip belirtecinin kullan\u0131ld\u0131\u011f\u0131 durumlar derlenmi\u015ftir:\n\n\u2b50 Ge\xe7mi\u015fe ili\u015fkin zihinsel ve fiziksel yetenek ifade etmek i\xe7in could kullan\u0131labilir.\n\nUsain Bolt could run faster than anybody else.\nUsain Bolt herkesten daha h\u0131zl\u0131 ko\u015fabilirdi.\nMichael Phillips was such a good swimmer that he could glide through the water like a fish.\nMichael Phillips o kadar iyi bir y\xfcz\xfcc\xfcyd\xfc ki suda bir bal\u0131k gibi s\xfcz\xfclebiliyordu.\n\n\u2b50 Ge\xe7mi\u015fe ba\u015far\u0131lm\u0131\u015f i\u015fleri ifade etmek i\xe7in could kullan\u0131labilir:\n\n\nMy friend named Anna could understand all John said to her.\nAnna ad\u0131ndaki arkada\u015f\u0131m John\u2019un ona s\xf6yledi\u011fi her \u015feyi anlayabiliyordu.\nAccording to some archaeologists, the people died because they could not live in peace.\nBaz\u0131 arkeologlara g\xf6re insanlar bar\u0131\u015f i\xe7inde ya\u015fayamad\u0131klar\u0131 i\xe7in \xf6ld\xfcler.\n\n\u2b50 Ge\xe7mi\u015fe ba\u015far\u0131lamam\u0131\u015f i\u015fleri ifade etmek i\xe7in could kullan\u0131l\u0131r:\n\nBecause the Daltons\u2019 clothes were caught in the barbed wire, they could not escape.\nDaltonlar\u0131n k\u0131yafetleri dikenli tellere tak\u0131ld\u0131\u011f\u0131 i\xe7in ka\xe7amad\u0131lar.\nLuftwaffe bombarded London again and again but could not break the resistance of the English.\nLuftwaffe Londra\u2019y\u0131 tekrar tekrar bombalad\u0131 ama \u0130ngilizlerin direni\u015fini k\u0131ramad\u0131.\n\n\u2b50 Rica ifade etmek i\xe7in could kullan\u0131labilir:\n\nCould you open the window?\nPencereyi a\xe7ar m\u0131s\u0131n?\nCould you speak slower? I can\u2019t catch the words.\nDaha yava\u015f konu\u015fabilir misin? Kelimeleri yakalayam\u0131yorum.\nCould I talk to you a little bit?\nSeninle biraz konu\u015fabilir miyim?\n\n\u2b50 Yard\u0131m \xf6nerisi ifade etmek i\xe7in could kullan\u0131labilir:\n\nI could help you fix your computer.\nBilgisayar\u0131n\u0131z\u0131 tamir etmenize yard\u0131mc\u0131 olabilirim.\nI could lend him the money to buy a mobile phone.\nOna bir cep telefonu almas\u0131 i\xe7in bor\xe7 para verebilirim.\n\n\u2b50 Geni\u015f ve gelecek zamana ait olas\u0131l\u0131k ifade etmek i\xe7in could kullan\u0131labilir:\n\n\nIt could rain tomorrow. Take your umbrella.\nYar\u0131n ya\u011fmur ya\u011fabilir. \u015eemsiyeni al.\nAny future world war could include the nuclear bombing of many big cities in the world.\nGelecekteki herhangi bir d\xfcnya sava\u015f\u0131, d\xfcnyadaki bir\xe7ok b\xfcy\xfck \u015fehrin n\xfckleer bombalanmas\u0131n\u0131 i\xe7erebilir.\n\n\u2b50 Ge\xe7mi\u015fte olmu\u015f ve art\u0131k m\xfcmk\xfcn olmayan olaylar\u0131 ifade etmek i\xe7in could kullan\u0131labilir:\n\nOnly ten years ago you could buy a big house for 100000 TL.\nSadece on y\u0131l \xf6nce 100000 TL\u2019ye b\xfcy\xfck bir ev alabilirdiniz.\n\n",null,B.u,null,null,null,null,null,null)
