B.Pg=new A.R("              \n\u2757 Bir \u015feyin do\u011frulu\u011fundan emin oldu\u011fumuzda must kip belirtecini kullan\u0131r\u0131z.\n\nThis must be the author\u2019s new book, I\u2019ve never seen it before.\nBu yazar\u0131n yeni kitab\u0131 olmal\u0131, daha \xf6nce hi\xe7 g\xf6rmemi\u015ftim.\nThe game has frozen again. The internet must be slow.\nOyun yine dondu. \u0130nternet yava\u015f olmal\u0131.\nI don\u2019t recognise that man. He must be a new player.\nO adam\u0131 tan\u0131m\u0131yorum. Yeni bir oyuncu olmal\u0131.\nIt must be George knocking on the door.\nKap\u0131y\u0131 \xe7alan George olmal\u0131.\n\u2757 E\u011fer bir \u015feyin do\u011fru olmad\u0131\u011f\u0131ndan emin olmu\u015fsak can\u2019t kip belirtecini kullan\u0131r\u0131z.\n\nOf course, I can\u2019t lose with this score!\nTabii ki, bu skorla kaybedemem!\nOur team can\u2019t be losing, it was doing so well.\nTak\u0131m\u0131m\u0131z kaybediyor olamaz, \xe7ok iyi gidiyordu.\nThese words can\u2019t be true.\nBu s\xf6zlerin do\u011fru olamaz.\n\n\u2757 Buna kar\u015f\u0131l\u0131k e\u011fer bir \u015feyin do\u011frulu\u011fundan daha az emin oldu\u011fumuz \u015feylerde, yani olas\u0131l\u0131k dahilinde oldu\u011funu d\xfc\u015f\xfcn\xfcyorsak \u201cmight\u201c, \u201cmay\u201d ve \u201ccould\u201d kip belirte\xe7lerini kullan\u0131r\u0131z. Olumsuz ifadeleri i\xe7in ilgili kip belirte\xe7lerine not olumsuzluk eki eklenir.\n\nI may buy the t-shirts, but I need to see the price first.\nTi\u015f\xf6rtleri alabilirim ama \xf6nce fiyat\u0131 g\xf6rmem gerek.\nMy husband might not be online tonight, he has lots of work to do.\nKocam bu gece \xe7evrimi\xe7i olmayabilir, yapacak \xe7ok i\u015fi var.\nI might be able to go fishing this weekend, I will let you know.\nBu hafta sonu bal\u0131\u011fa gidebilirim, sana haber veririm.\nLionel Messi may be able to play this evening.\nLionel Messi bu ak\u015fam oynayabilir.\n\u2757 Must, can\u2019t ve might kip belirte\xe7leri, ge\xe7mi\u015f olaylardan emin oldu\u011fumuzu s\xf6ylemek i\xe7in yard\u0131mc\u0131 fiil + \u201chave\u201d + V3 (ge\xe7mi\u015f zaman ortac\u0131) \u015feklinde kullan\u0131labilir.\n\n\nJohn could have won, he had a high score when I left.\nJohn kazanabilirdi, ben ayr\u0131ld\u0131\u011f\u0131mda y\xfcksek bir puan\u0131 vard\u0131.\nLiverpool could have won. It was up 3-0 when I turned off the TV.\nLiverpool kazanabilirdi. Ben televizyonu kapatt\u0131\u011f\u0131mda 3 0 \xf6ndeydi.\nBrad might\u2019ve played the new game, I\u2019ll ask him.\nBrad yeni oyunu oynam\u0131\u015f olabilir, ona soraca\u011f\u0131m.\nIt can\u2019t have been Angelina, she had very few points.\nAngelina olamaz, \xe7ok az puan\u0131 vard\u0131.\n",null,B.u,null,null,null,null,null,null)
B.Ph=new A.R("              \n1. \xd6zne Olarak Noun Clause\n\nIt is obvious that you love her. \u2192 Senin onu sevdi\u011fin belli.\nThat you love her is obvious. / yine yukar\u0131daki c\xfcmleyle ayn\u0131 anlam\u0131 verdi.\nBurada yan c\xfcmleci\u011fimiz you love her ve ana fiilimiz ise to be fiili olan is. C\xfcmlede \xf6zneyi, Kim, Ne? sorusunu sorarak buluruz. A\xe7\u0131k olan ne diye sordu\u011fumuzda senin onu sevdi\u011fin yan\u0131t\u0131n\u0131 ald\u0131\u011f\u0131m\u0131zdan yan c\xfcmleci\u011fin \xf6zne olarak kullan\u0131ld\u0131\u011f\u0131n\u0131 g\xf6r\xfcyoruz.\n\n2. Nesne Olarak Noun Clause\n\nHe thinks that I am a liar. \u2192 O, benim bir yalanc\u0131 oldu\u011fumu d\xfc\u015f\xfcn\xfcyor.\nI know that you don\u2019t have enough money. \u2192 Senin yeterince paran olmad\u0131\u011f\u0131n\u0131 biliyorum. \nC\xfcmlede nesneyi bulmak i\xe7in neyi? sorusunu sorar\u0131z. O neyi d\xfc\u015f\xfcn\xfcyor diye sordu\u011fumuzda ald\u0131\u011f\u0131m\u0131z yan\u0131t, benim bir yalanc\u0131 oldu\u011fumu oldu\u011fundan yan c\xfcmleci\u011fin nesne konumunda oldu\u011funu anl\u0131yoruz.\n\nBen neyi biliyorum diye sordu\u011fumuzda ald\u0131\u011f\u0131m\u0131z yan\u0131t, senin yeterince paran olmad\u0131\u011f\u0131n\u0131 oldu\u011fundan yan c\xfcmleci\u011fin nesne konumunda oldu\u011funu anl\u0131yoruz.\n\nBir kelime grubunun isim c\xfcmleci\u011fi olup olmad\u0131\u011f\u0131n\u0131 test etmek i\xe7in onun yerine isim koyabiliriz:\n\nWhat the teacher said surprised everybody. \u2192 \xd6\u011fretmenin s\xf6yledi\u011fi \u015fey herkesi \u015fa\u015f\u0131rtt\u0131. (Bu c\xfcmlede Noun Clause What the teacher said k\u0131sm\u0131d\u0131r, bu k\u0131sm\u0131n yerine bir isim koyarsak \xf6rne\u011fin Ali, bu durumda Ali herkesi \u015fa\u015f\u0131rtt\u0131 dedi\u011fimizde anlaml\u0131 bir c\xfcmle oldu\u011funu g\xf6r\xfcyoruz.)\nHow they survived is unbelievable. \u2192 Onlar\u0131n nas\u0131l hayatta kald\u0131\u011f\u0131 inan\u0131lmaz. (Burada yan c\xfcmleci\u011fimiz How they survived ifadesidir. Yan c\xfcmleci\u011fin yerine bir isim \xf6rne\u011fin she getirdi\u011fimizde, o inan\u0131lmaz dedi\u011fimizde c\xfcmle hala anlaml\u0131d\u0131r. Bu sayede test ederek Noun Clause\u2019u bulmu\u015f olduk.)\n\n3. Soru Kelimeleriyle Noun Clause\n\n5N1K kelimeleriyle ba\u015flayan sorular, kelime dizili\u015fi de\u011fi\u015ftirilerek isim yan c\xfcmlesi yap\u0131labilirler.\n\nI don\u2019t know where she went. \u2192 Onun nereye gitti\u011finin bilmiyorum. (Normalde bir soru c\xfcmlesi yap\u0131p O nereye gitti? diye sorarken Where did she go? deriz. Ancak burada bu soru ifadesini yan c\xfcmlecik olarak kulland\u0131\u011f\u0131m\u0131zdan, c\xfcmle dizilimini ba\u015f\u0131nda nerede anlam\u0131 veren where olmas\u0131na ra\u011fmen d\xfcz bir c\xfcmle gibi \xd6zne + fiil \u015feklinde yapt\u0131k. B\xf6ylece 5N1K sorular\u0131ndan biri olan Where ile ba\u015flayan bir Noun Clause elde etmi\u015f olduk.)\nWhat they bought is none of my business. \u2192 Ne ald\u0131klar\u0131 beni ilgilendirmez. (Normalde What did they buy? \u015feklinde c\xfcmle kurmam\u0131z gerekirken, What they bought dedik. Soru c\xfcmlesini d\xfcz bir c\xfcmle gibi kurduk.)\nI wonder how you feel. \u2192 Senin nas\u0131l hissetti\u011fini merak ediyorum. (G\xf6rd\xfc\u011f\xfcn\xfcz gibi bu c\xfcmlelerin sonuna soru i\u015fareti koymuyoruz. \xc7\xfcnk\xfc bu c\xfcmleler, art\u0131k soru de\u011fil bir c\xfcmleciktir.) \n\n4. S\u0131fat Yap\u0131lar\u0131ndan Sonra Noun Clause\n\nI\u2019m pleased (that) you finally found a job. \u2192 Sonunda bir i\u015f buldu\u011fun i\xe7in memnunum.\nI\u2019m sure (that) you will pass the exam. \u2192 S\u0131nav\u0131 ge\xe7ece\u011finden eminim.\n  Yukar\u0131daki \xf6rneklerde g\xf6rd\xfc\u011f\xfcm\xfcz \xfczere, memnun, emin anlam\u0131 veren pleased, sure       s\u0131fatlar\u0131n\u0131n ard\u0131ndan Noun Clause gelmi\u015ftir. \n\n\xd6zellikle soru ve s\u0131fat kelimeleriyle Noun Clause yap\u0131ld\u0131\u011f\u0131nda that \xe7o\u011funlukla at\u0131l\u0131r ama Noun Clause \xf6zne konumunda ise that\u2019 i atamay\u0131z. Bu c\xfcmleler zaten that veya it ile ba\u015flar.\n\n5. Whether / If Yap\u0131lar\u0131yla Noun Clause\n\nWhether c\xfcmleye olup olmad\u0131\u011f\u0131n\u0131 anlam\u0131 verir. Whether yap\u0131s\u0131n\u0131n ard\u0131ndan or not ifadesi takip eder. A\u015fa\u011f\u0131da ayn\u0131 anlama gelen c\xfcmlelerin farkl\u0131 kal\u0131plarla nas\u0131l ifade edilebilece\u011fini g\xf6rece\u011fiz:\n\nWe don\u2019t know whether Jack will come with us. \u2192 Jack\u2019in bizimle gelecek mi bilmiyoruz.\nWe don\u2019t know whether Jack will come with us or not. \u2192 Jack\u2019in bizimle gelip gelmeyece\u011fini bilmiyoruz.\nWe don\u2019t know whether or not Jack will come with us. \u2192 Jack\u2019in bizimle gelip gelmeyece\u011fini bilmiyoruz.\nWe don\u2019t know if Jack will come with us (or not). \u2192 Jack bizimle gelecek mi gelmeyecek mi bilmiyoruz.\n\nD\xf6rt tane daha \xf6rnek c\xfcmle vererek konuyu peki\u015ftirelim:\n\nThe poor boy couldn\u2019t see who hit him. \u2192 Zavall\u0131 \xe7ocuk ona kimin vurdu\u011funu g\xf6remedi.\nYou won\u2019t believe whose hair I\u2019ve found on the shirt of my husband. \u2192 Kocam\u0131n g\xf6mle\u011finde kimin sa\xe7\u0131n\u0131 buldu\u011fuma inanmayacaks\u0131n.\nWhether she\u2019s telling the truth or not will be unknown forever. \u2192 Onun do\u011fruyu s\xf6yleyip s\xf6ylemedi\u011fi sonsuza kadar bilinemeyecek.\nI cannot decide which book to choose. \u2192 Hangi kitab\u0131 se\xe7ece\u011fime karar veremiyorum.\n\n",null,B.u,null,null,null,null,null,null)
