B.Pk=new A.R("              \n\u0130ngilizcede miktar ifadelerindeki yeterlili\u011fi anlatmak i\xe7in enough ve too kal\u0131plar\u0131 kullan\u0131lmaktad\u0131r.\n\nBilindi\u011fi \xfczere isimler say\u0131labilen ve say\u0131lamayan olmak \xfczere ikiye ayr\u0131lmaktad\u0131r. Say\u0131labilen isimler ad\u0131ndan da anla\u015f\u0131laca\u011f\u0131 \xfczere say\u0131 ile say\u0131labilmesinden, belli bir bi\xe7imleri almas\u0131ndan \xf6t\xfcr\xfc bu \u015fekilde adland\u0131r\u0131lm\u0131\u015ft\u0131r (\xd6rnek: table = masa, tables = masalar, egg = yumurta, eggs = yumurtalar).\n\nBuna kar\u015f\u0131l\u0131k say\u0131lamayan isimlerin belirli sabit bir formu ve s\u0131n\u0131rlar\u0131 yoktur ve bu nedenle de onlar\u0131 sayamay\u0131z. Haliyle bu tarz isimler herhangi bir \xe7o\u011ful forma da sahip de\u011fildirler. (\xd6rne\u011fin: flour = un, water = su).\n\nSay\u0131labilen ve say\u0131lamayan isimlerin miktarlar\u0131yla alakal\u0131 sorular sorabilmek i\xe7in kullan\u0131lan iki soru tipi vard\u0131r. Bunlar, say\u0131labilen isimler i\xe7in how many, say\u0131lamayan isimler i\xe7inse how much \u015feklindedir.\n\nHow many pizzas should we order?\nKa\xe7 tane pizza sipari\u015fi verelim?\nHow much juice would you like?\nNe kadar meyve suyu istersin?\n\nHow many \u2013 How much \xd6rnek C\xfcmleler\n\nEnough\n\nBir ismin yeterli miktarda oldu\u011funu vurgulamak i\xe7in enough kullan\u0131lmaktad\u0131r. Enough, hem say\u0131labilen hem say\u0131lamayan isimlerle beraber kullan\u0131labilmektedir.\n\n\nDo we have enough food for dinner?\nAk\u015fam yeme\u011fi i\xe7in yeterli yiyece\u011fimiz var m\u0131?\nWe have enough food.\nYeterince yiyece\u011fimiz var.\nDo we have enough books for everyone?\nHerkese yetecek kadar kitab\u0131m\u0131z var m\u0131?\nWe don\u2019t have enough books.\nYeterince kitab\u0131m\u0131z yok.\n\nEnough \xd6rnek C\xfcmleler\n\nToo\n\nBelli bir e\u015fi\u011fin \xfcst\xfcnde (bu e\u015fik ki\u015fiden ki\u015fiye g\xf6re de\u011fi\u015febilir, g\xf6recelidir) olan miktarlar\u0131 anlatmak i\xe7in too yap\u0131s\u0131 kullan\u0131l\u0131r. Say\u0131lamayan isimlerde too much kullan\u0131l\u0131rken, say\u0131labilen isimlerde too many kullan\u0131l\u0131r.\n\nI think he used too much salt for his salad.\nSan\u0131r\u0131m salatas\u0131 i\xe7in \xe7ok fazla tuz kullanm\u0131\u015f.\nHe ate too many potatoes.\n\xc7ok fazla patates yedi.\nI drank too much water.\n\xc7ok fazla su i\xe7tim.\n\nToo much \u2013 Too many \xd6rnek C\xfcmleler\n\n\u2757 Too much ve too many yap\u0131s\u0131 baz\u0131 kal\u0131p ifadelerde de kullan\u0131lmaktad\u0131r. Dizi ve filmlerde bu yap\u0131yla kar\u015f\u0131la\u015fabilirisiniz:\n\nOh you shouldn\u2019t have, this is too much!\nAh hi\xe7 gerek yoktu, bu \xe7ok fazla!\nI don\u2019t like this song too much.\nBu \u015fark\u0131y\u0131 pek fazla sevmiyorum.\n\n",null,B.u,null,null,null,null,null,null)
B.Pl=new A.R("            \nK\xfc\xe7\xfck K\u0131rm\u0131z\u0131 Ba\u015fl\u0131kl\u0131 K\u0131z annesiyle birlikte bir ormanda ya\u015fard\u0131. Bir g\xfcn K\xfc\xe7\xfck K\u0131rm\u0131z\u0131 Ba\u015fl\u0131kl\u0131 K\u0131z b\xfcy\xfckannesini ziyarete gitti. Sepetinde g\xfczel bir kek vard\u0131. Yolda K\xfc\xe7\xfck K\u0131rm\u0131z\u0131 Ba\u015fl\u0131kl\u0131 K\u0131z bir kurtla kar\u015f\u0131la\u015ft\u0131.\n\n\u201cMerhaba!\u201d dedi kurt. \u201cNereye gidiyorsun?\u201d\n\n\u201cB\xfcy\xfckannemi g\xf6rece\u011fim. O a\u011fa\xe7lar\u0131n arkas\u0131ndaki bir evde ya\u015f\u0131yor.\u201d\n\nKurt, b\xfcy\xfckannenin evine ko\u015ftu ve b\xfcy\xfckanneyi yedi. B\xfcy\xfckannenin yata\u011f\u0131na girdi. Biraz sonra, K\xfc\xe7\xfck K\u0131rm\u0131z\u0131 Ba\u015fl\u0131kl\u0131 K\u0131z eve ula\u015ft\u0131. Kurda bakt\u0131.\n\n\u201cB\xfcy\xfckanne, ne b\xfcy\xfck g\xf6zlerin var!\u201d\n\n\u201cSeni daha iyi g\xf6rmek i\xe7in!\u201d dedi kurt.\n\n\u201cB\xfcy\xfckanne, ne b\xfcy\xfck kulaklar\u0131n var!\u201d\n\n\u201cSeni daha iyi duymak i\xe7in!\u201d dedi kurt.\n\n\u201cB\xfcy\xfckanne, ne kadar b\xfcy\xfck bir burnun var!\u201d\n\n\u201cSeni daha iyi koklamak i\xe7in!\u201d dedi kurt.\n\n\u201cB\xfcy\xfckanne, ne kadar b\xfcy\xfck di\u015flerin var!\u201d\n\n\u201cSeni daha iyi yemek i\xe7in!\u201d diye ba\u011f\u0131rd\u0131 kurt. Ormanda bir oduncu vard\u0131. Y\xfcksek sesle bir \xe7\u0131\u011fl\u0131k duydu ve eve ko\u015ftu. Oduncu kurdu ba\u015f\u0131n\u0131n \xfczerinden vurdu. Kurt a\u011fz\u0131n\u0131 geni\u015f a\xe7t\u0131 ve ba\u011f\u0131rd\u0131 ve B\xfcy\xfckanne d\u0131\u015far\u0131 f\u0131rlad\u0131. Kurt ka\xe7t\u0131 ve K\xfc\xe7\xfck K\u0131rm\u0131z\u0131 Ba\u015fl\u0131kl\u0131 K\u0131z, bir daha kurdu g\xf6rmedi.\n            ",null,B.u,null,null,null,null,null,null)
