B.Pp=new A.R("              \nSo do I kal\u0131b\u0131, olumlu c\xfcmlelerde kullan\u0131lmaktad\u0131r.\n\nI want to watch this movie.\n\n(Bu filmi izlemek istiyorum.)\n\nSo do I.\n\nBen de (istiyorum).\n\nYukar\u0131daki \xf6rnekte g\xf6r\xfcld\xfc\u011f\xfc \xfczere kar\u015f\u0131m\u0131zdaki ki\u015finin g\xf6r\xfc\u015f\xfcne kat\u0131ld\u0131\u011f\u0131m\u0131z\u0131 belirtmek i\xe7in kulland\u0131\u011f\u0131m\u0131z ben de (istiyorum) ifadesi so do I ile sa\u011flanm\u0131\u015ft\u0131r.\n\nBu yap\u0131 \xe7e\u015fitli alternatifleriyle kar\u015f\u0131m\u0131za \xe7\u0131kmaktad\u0131r ve bu y\xfczden a\u015fa\u011f\u0131daki kullan\u0131m yap\u0131s\u0131n\u0131 bilmekte fayda var:\n\nSo + Yard\u0131mc\u0131 fiil + \xd6zne\n\nI am an engineer.                 \nBen bir m\xfchendisim.\n\nSo am I.\nBen de (m\xfchendisim).\n\nAs a kid, I loved chocolate.\n(\xc7ocukken \xe7ikolatay\u0131 severdim.)\n\nSo did I.\nBen de (\xe7ocukken \xe7ikolatay\u0131 severdim).\n\nI\u2019ve been sick recently.\n(Son zamanlarda hastay\u0131m.)\n\nSo have I.\nBen de (son zamanlarda hastay\u0131m).\n\n\xd6zne kendimiz oldu\u011fu i\xe7in anlam\u0131 \u201cBen de\u201d olarak \xe7evirdik. Ancak farkl\u0131 \xf6zneler de kullan\u0131labilmektedir. A\u015fa\u011f\u0131daki \xf6rneklerde farkl\u0131 \xf6znelerle kullan\u0131m\u0131 g\xf6sterilmi\u015ftir:\n\nThey arrived yesterday.\n(D\xfcn geldiler.)\t\n\nSo did we.\nBiz de (d\xfcn geldik).\n\nThomas likes his job.\n(Thomas i\u015fini seviyor.)\t\n\nSo does Anna.\nAnna da (i\u015fini seviyor).\n\nHe should sleep now.\n(\u015eimdi uyumal\u0131.)\t\n\nSo should you.\nSen de (\u015fimdi uyumal\u0131s\u0131n).\n\n\n          Neither do I\n\n\nNeither do I kal\u0131b\u0131 ise olumsuz c\xfcmlelerde kullan\u0131lmaktad\u0131r. Yani ki\u015finin olumsuz g\xf6r\xfc\u015f\xfcyle hemfikir olunmu\u015fsa kullan\u0131l\u0131r.\n\nI don\u2019t want to watch this movie.\n(Bu filmi izlemek istemiyorum.)\n\nNeither do I.\nBen de (istemiyorum).\n\nKullan\u0131m yap\u0131s\u0131 so do I ile benzerdir:\n\nNeither +\tYard\u0131mc\u0131 fiil +\t\xd6zne\n\nI am not an engineer.\n(Ben bir m\xfchendis de\u011filim.)\t\n\nNeither am I.\nBen de (m\xfchendis de\u011filim).\n\nAs a kid, I didn\u2019t love chocolate.\n(\xc7ocukken \xe7ikolatay\u0131 sevmezdim.)\n\nNeither did I.\nBen de (\xe7ocukken \xe7ikolatay\u0131 sevmezdim).\n\nI have not been sick recently.\n(Son zamanlarda hasta de\u011filim.)\t\n\nNeither have I.\nBen de (son zamanlarda hasta de\u011filim).\n\nYine benzer \u015fekilde farkl\u0131 \xf6zneler de kullan\u0131labilmektedir:\n\nThey didn\u2019t arrived yesterday.\n(D\xfcn gelmediler.)\t\n\nNeither did we.\nBiz de (d\xfcn gelmedik).\n\nThomas likes his job.\n(Thomas i\u015fini sevmiyor.)\t\n\nNeither does Anna.\nAnna da (i\u015fini sevmiyor).\n\nHe shouldn\u2019t sleep now.\n(\u015eimdi uyumamal\u0131.)\t\n\nNeither should you.\nSen de (\u015fimdi uyumamal\u0131s\u0131n).\n",null,B.u,null,null,null,null,null,null)
B.Pq=new A.R("              \n          Superlatives Kullan\u0131m\u0131\n\nSuperlative kelimesinin anlam\u0131, \u201csuper\u201d kelimesinden gelmektedir. \xdcst\xfcn, s\xfcperlik gibi anlamlar\u0131 olan bu kelime, superlative adjectives kal\u0131b\u0131n\u0131 \u201c\xfcst\xfcnl\xfck bildiren s\u0131fatlar\u201d olarak tan\u0131mlamaya yard\u0131mc\u0131 olur.\n\n\xdcst\xfcnl\xfck bildiren s\u0131fatlar, ayn\u0131 kar\u015f\u0131la\u015ft\u0131rma s\u0131fatlar\u0131 gibi k\u0131yaslama bildirirler. Ancak aralar\u0131nda belirgin bir fark bulunur. \xdcst\xfcnl\xfck s\u0131fatlar\u0131; iki \u015feyi de\u011fil, bir \u015feyi di\u011fer her \u015feye g\xf6re k\u0131yaslar. Bir ki\u015finin, nesnenin veya hayvan\u0131n di\u011fer b\xfct\xfcn \u015feylere k\u0131yasla ne kadar \xfcst\xfcn oldu\u011funu belirtirler.\n\nYani superlative konusunda \xf6nemli olan bir \u015feyin bir konu hakk\u0131nda di\u011fer her \u015feyle olan k\u0131yaslamas\u0131d\u0131r. Comparative gibi daha de\u011fil; en durumu vard\u0131r.\n\n\xd6rnek: Az \xf6nceki iki \xe7ocu\u011fu tekrar ele alacak olursak, \u201cBenim babam bu d\xfcnyadaki en g\xfc\xe7l\xfc insand\u0131r.\u201d diyen \xe7ocuk, babas\u0131n\u0131 g\xfc\xe7 konusunda d\xfcnyadaki di\u011fer her \u015feyle kar\u015f\u0131la\u015ft\u0131rmakta ve \xfcst\xfcn g\xf6rmektedir. B\xf6yle bir c\xfcmle kurmak i\xe7inse superlatives konusuna ihtiya\xe7 vard\u0131r.\n\nMy father is the strongest person in this world.\n\n(Benim babam bu d\xfcnyadaki en g\xfc\xe7l\xfc insand\u0131r.)\n\n           Superlative C\xfcmle Kurma Form\xfcl\xfc\n\nSuperlative kullan\u0131m\u0131 i\xe7in uyman\u0131z gereken temel form\xfcl \u015fu \u015fekildedir;\n\nSubject (Noun) + Verb + The + Adjective + Object (Noun)\n\n\xd6zne (\u0130sim) + Fiil + The kelimesi + S\u0131fat + Nesne (\u0130sim)\n\nC\xfcmlenizin \xf6\u011felerinin s\u0131ralamas\u0131 bu \u015fekilde olmal\u0131. Bu form\xfclde s\u0131fat\u0131n\u0131z\u0131 belirtirken uyman\u0131z gereken birka\xe7 basit kural ise \u015f\xf6yle;\n\nE\u011fer s\u0131fat\u0131n\u0131z k\u0131saysa yani tek heceliyse s\u0131fat\u0131n sonuna \u2018-est\u2019 tak\u0131s\u0131 gelir.\n\nLongest, biggest, smallest gibi.\n\nE\u011fer s\u0131fat\u0131n\u0131z k\u0131saysa yani 2 heceli ancak sonu -y harfi ile bitiyorsa -y harfi d\xfc\u015fer, s\u0131fat\u0131n sonuna \u2018-iest\u2019 tak\u0131s\u0131 gelir.\n\nHappy -> happiest gibi.\n\nE\u011fer s\u0131fat\u0131n\u0131z uzunsa yani 2 veya daha \xe7ok heceli ise s\u0131fata ek gelmez, s\u0131fattan \xf6nce \u2018most kelimesi gelir.\n\nThe most expensive gibi.\n\n\xd6rnek C\xfcmleler:\n\nShe is the prettiest girl I have ever seen.\n(O, g\xf6rd\xfc\u011f\xfcm en g\xfczel/ ho\u015f k\u0131z.)\n\nMount Everest is the highest mountain in the world.\n(Everest Da\u011f\u0131 d\xfcnyadaki en y\xfcksek da\u011fd\u0131r.)\n\nThis must be the hottest day of the year.\n(Bu y\u0131l\u0131n en s\u0131cak g\xfcn\xfc olmal\u0131.)\n\nHe is the most intelligent boy in the class.\n(O s\u0131n\u0131ftaki en zeki \xe7ocuk.)\n\nHealth is the most important thing.\n(Sa\u011fl\u0131k en \xf6nemli \u015feydir.)\n\nThis car is the fastest car.\n(Bu araba en h\u0131zl\u0131 araba.)\n\nThis chair is the most comfortable chair.\n(Bu sandalye en rahat sandalye.)\n\nNot: Clever, quiet, simple ve narrow s\u0131fatlar\u0131, comparative ve superlative kullan\u0131mlar\u0131nda hem tek heceli s\u0131fat hem de \xe7ok heceli s\u0131fat kural\u0131na g\xf6re ek al\u0131rlar.\n\nCleverest ve Most Clever ya da Cleverer ve More Clever gibi.\n",null,B.u,null,null,null,null,null,null)
B.Pr=new A.R("              \nCan ve onun olumsuzu can\u2019t ya da bir ba\u015fka deyi\u015fle cannot T\xfcrk\xe7ede -e/a bilmek anlam\u0131na gelse de bu -e/a bilmek genel olarak d\xf6rt farkl\u0131 durumu ifade etmek i\xe7in kullan\u0131lmaktad\u0131r. Bu durumlar a\u015fa\u011f\u0131daki tabloda g\xf6sterilmi\u015ftir;\n\nability\nyetenek\t\n\nI can run.\nKo\u015fabilirim.\n\npossibility\nolas\u0131l\u0131k\t\n\nIt can rain today.\nBug\xfcn ya\u011fmur ya\u011fabilir.\n\npermission\nizin\t\n\nCan I open the window?\nPencereyi a\xe7abilir miyim?\n\nrequest\nrica\t\n\nCan you help me, please?\nBana yard\u0131m edebilir misin, acaba?\n\n          \u0130ngilizcede Can \u2013 Can\u2019t Kullan\u0131m\u0131\n          \n\u2757 Yukar\u0131daki anlamlar may, might, could vb. yap\u0131lar kullan\u0131larak da pekala anlat\u0131labilir.\n\n\u0130ngilizcede can Hangi Durumlarda Kullan\u0131l\u0131r?\nOlumlu, olumsuz, soru ve olumsuz soru c\xfcmlelerinde can a\u015fa\u011f\u0131daki tablodaki gibi kullan\u0131l\u0131r:\n\n\u2795 Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + can + V1\n\n\n\u2796 Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + can\u2019t + V1\nSubject (I, you, we, they, he, she, it) + cannot + V1\nSubject (I, you, we, they, he, she, it) + can not + V1\n\n\u2753 Soru c\xfcmleleri\nCan + subject (I, you, we, they, he, she, it) + V1 ?\nCan\u2019t + subject (I, you, we, they, he, she, it) + V1 ?\n\nTelaffuzlar\u0131:\n\n\ud83d\udd0a can,\n\ud83d\udd0a can\u2019t,\n\ud83d\udd0a cannot,\n\ud83d\udd0a can not\n\u2b50 Bir eylemi yapabilme kabiliyetinin anlat\u0131ld\u0131\u011f\u0131 yetenek ifadelerinde kullan\u0131labilir.\n\nMichael Phelps can swim.\nMichael Phelps y\xfczebilir.\nDogs cannot fly in the sky.\nK\xf6pekler g\xf6ky\xfcz\xfcnde u\xe7amaz.\nCan he play the guitar you gave him?\nOna verdi\u011fin gitar\u0131 \xe7alabiliyor mu?\nThe car cannot move without gasoline.\nAraba benzin olmadan hareket edemez.\nCan\u2019t you stop making that awful noise?\nO korkun\xe7 g\xfcr\xfclt\xfcy\xfc yapmay\u0131 kesemez misin?\nWhy can\u2019t you just be nice to her instead of upsetting her?\nNeden onu \xfczmek yerine ona iyi davranm\u0131yorsun?\n\n\u2b50 Bir eylemi yapabilmek i\xe7in kullan\u0131lan rica etme, izin alma veya izin verme gibi durumlarda can kullan\u0131labilir.\n\nJohn can sleep in my living room if he is so tired.\nJohn \xe7ok yorgunsa benim oturma odamda uyuyabilir.\nShe cannot drive my car.\nArabam\u0131 kullanamaz.\nCan he play with us?\nBizimle oynayabilir mi?\n\n\n\u2b50 Olas\u0131l\u0131k bildiren c\xfcmleler olu\u015fturmak i\xe7in kullan\u0131labilir. Bir ko\u015fula ba\u011fl\u0131 eylemler anlat\u0131l\u0131rken can kullan\u0131l\u0131r. Buna kar\u015f\u0131n imkans\u0131za yak\u0131n bir olas\u0131l\u0131\u011f\u0131n anlat\u0131ld\u0131\u011f\u0131 durumlarda ise can\u2019t / cannot kullan\u0131l\u0131r.\n\nIf you be a nice kid, one day you can see the smurfs.\nE\u011fer uslu bir \xe7ocuk olursan, bir g\xfcn \u015firinleri g\xf6rebilirsin.\nAnna can\u2019t be hungry. Because she has just eaten a whole pizza.\nAnna a\xe7 olamaz. \xc7\xfcnk\xfc daha az \xf6nce b\xfct\xfcn bir pizzay\u0131 yedi.\n\n",null,B.u,null,null,null,null,null,null)
B.Ps=new A.R("              \n           Simple Past Tense\n\nPast tense kullan\u0131mlar\u0131, ge\xe7mi\u015fte belirli bir zaman i\xe7erisinde ba\u015flam\u0131\u015f ve art\u0131k sonlanm\u0131\u015f olan eylemleri veya durumlar\u0131 anlatt\u0131\u011f\u0131 i\xe7in eylemin ge\xe7mi\u015fte bitti\u011fi net bir \u015fekilde anla\u015f\u0131l\u0131r. Zaten \xe7o\u011fu simple past tense c\xfcmlelerinde a\u015fa\u011f\u0131daki g\xf6revi yapan \xf6ge belirtilir:\n\n1) Eylemin ne zaman ger\xe7ekle\u015fti\u011fi\n2) Eylemin ge\xe7mi\u015fte tamamlan\u0131p bug\xfcnle bir ili\u015fkisinin kalmad\u0131\u011f\u0131\n\n          To Be ile Simple Past Tense Yap\u0131l\u0131\u015f\u0131\n\n\u0130ngilizcede to be fiilinin simple past tense format\u0131nda was ve were olmak \xfczere iki \u015fekli vard\u0131r. Olumlu ve olumsuz c\xfcmleleri a\u015fa\u011f\u0131daki tablolarda ilgili \u015fah\u0131s zamirlerine g\xf6re \xe7ekimlenmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/he/she/it was\nWe/you/they were\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/he/she/it was not\nI/he/she/it wasn\u2019t\nWe/you/they were not\nWe/you/they weren\u2019t\n\n\u27a1\ufe0f Soru c\xfcmleleri\nWas I/he/she/it?\nWasn\u2019t I/he/she/it?\nWere we/you/they?\nWeren\u2019t we/you/they?\n\n\xd6rnek telaffuzlar\u0131:\n\n\ud83d\udd0a was,\n\ud83d\udd0a wasn\u2019t,\n\ud83d\udd0a was not,\n\ud83d\udd0a were,\n\ud83d\udd0a weren\u2019t,\n\ud83d\udd0a were not\n\xd6rnek c\xfcmleler:\n\nI was in Paris last spring.\nGe\xe7en bahar Paris\u2019teydim.\nWe were at London last Saturday.\nGe\xe7en cumartesi Londra\u2019dayd\u0131k.\nAnna was at home yesterday.\nAnna d\xfcn evdeydi.\nWere Daniel and James Harry\u2019s friends?\nDaniel ve James Harry\u2019nin arkada\u015flar\u0131 m\u0131yd\u0131?\nWere you very busy on Friday?\nCuma g\xfcn\xfc \xe7ok me\u015fgul m\xfcyd\xfcn?\nShe wasn\u2019t in K\xf6ln last month.\nGe\xe7en ay K\xf6ln\u2019de de\u011fildi.\nEmma and Tim weren\u2019t late for school.\nEmma ve Tim okula ge\xe7 kalmad\u0131lar.\n\n          D\xfczenli Fiillerle Simple Past Tense Yap\u0131l\u0131\u015f\u0131\n\n\u0130ngilizcede regular verbs olarak adland\u0131r\u0131lan d\xfczenli fiiller olumlu, olumsuz ve soru c\xfcmlelerinde a\u015fa\u011f\u0131daki tablolarda ilgili \u015fah\u0131s zamirlerine g\xf6re \xe7ekimlenerek kullan\u0131l\u0131r.\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + V2 (Ved/d)\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + didn\u2019t + V1\nSubject (I, you, we, they, he, she, it) + did not + V1\n\n\u27a1\ufe0f Soru c\xfcmleleri\nDid + subject (I, you, we, they, he, she, it) + V1?\nDidn\u2019t + subject (I, you, we, they, he, she, it) + V1?\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a did,\n\ud83d\udd0a did not,\n\ud83d\udd0a didn\u2019t\n\u0130ngilizcede d\xfczenli fiillerin past tense formatlar\u0131 (V2) genellikle -ed eki ile sa\u011flan\u0131r.\ntalk \u2013> talked\nwalk \u2013> walked\ncook \u2013> cooked\nplay \u2013> played\nSon harfi \u2013e ile biten fiiller sadece \u2013d eki al\u0131r:\nlike \u2013> liked likeed\ndance \u2013> danced danceed\nbake \u2013> baked bakeed\nsmile \u2013> smiled smileed\nSon iki harfi \xfcns\xfcz olan bir fiil e\u011fer son harfi -y ile bitmi\u015fse -y kalkar ve -ed eki \u2013ied olarak eklenir.\nstudy \u2013> studied studyed\ncry \u2013> cried cryed\nfry \u2013> fried fryed\ndry \u2013> dried dryed\nFiil bir sesli harf art\u0131 -l ile bitiyorsa o zaman \u0130ngiliz \u0130ngilizcesinde -ed eklemeden \xf6nce l\u2019yi ikiye katlaman\u0131z gerekir:\ntravel \u2013> travelled\nequal \u2013> equalled\nFiil tek bir sesli harf ve bir \xfcns\xfcz ile bitiyorsa ve \xfcst\xfcne vurgu fiilin sonundaysa o zaman -ed eklemeden \xf6nce son \xfcns\xfcz\xfc ikiye katlaman\u0131z gerekir:\nadmit \u2013> admitted\ncommit \u2013> committed\nrefer \u2013> referred\nFiile getirilen -ed ekleri i\xe7in telaffuz kurallar\u0131n\u0131 bilmek hem dinleme hem de konu\u015fma becerileri geli\u015ftirmek i\xe7in \xf6nemlidir. D\xfczenli bir fiil e\u011fer /t/ veya /d/ sesi ile sona ererse -ed net bir \u015fekilde duyulabilirken geri kalan durumlarda -d benzeri bir ses \xe7\u0131kar\u0131r:\n\n\ud83d\udd0a wanted,\n\ud83d\udd0a started,\n\ud83d\udd0a moved\nD\xfczensiz Fiillerle Simple Past Tense Yap\u0131l\u0131\u015f\u0131\n\u0130ngilizcede irregular verbs olarak adland\u0131r\u0131lan fiiller ise past tense formatlar\u0131na sokulurken -ed eki almazlar. Bunun yerine d\xfczensiz bir \u015fekilde past tense format\u0131na d\xf6n\xfc\u015ft\xfcr\xfcl\xfcrler.\n\nBu tarz fiillerin past tense formatlar\u0131 belirli bir d\xfczeni takip etmedi\u011fi i\xe7in her bir fiil kendilerine has bir \u015fekilde V2 olmaktad\u0131r. Bu y\xfczden bunlar\u0131n ezberlenmesi tavsiye edilir. \xd6rne\u011fin:\nwin \u2013> won\nrun \u2013> run\nfind \u2013> found\nput \u2013> put\neat \u2013> ate\n\n          Simple Past Tense Hangi Durumlarda Kullan\u0131l\u0131r?\n          \n\u2b50 Ge\xe7mi\u015fte belirli bir zaman i\xe7erisinde ba\u015flam\u0131\u015f ama sonlanm\u0131\u015f eylemleri anlat\u0131rken kullan\u0131l\u0131r:\n\nI played football yesterday.\nD\xfcn futbol oynad\u0131m.\nI went to London last week.\nGe\xe7en hafta Londra\u2019ya gittim.\nDid he go to school?\nOkula gitti mi?\nI didn\u2019t tell anything.\nHi\xe7bir \u015fey s\xf6ylemedim.\n\n\u2b50 Ge\xe7mi\u015fte birbirini izleyen olaylar\u0131 hikaye ederken kullan\u0131l\u0131r:\n\nJohn went to \u0130stanbul and he visited to Topkap\u0131 Palace.\nJohn \u0130stanbul\u2019a gitti ve Topkap\u0131 Saray\u0131\u2019n\u0131 ziyaret etti.\nI went to Pizza Hut but didn\u2019t eat anything.\nPizza Hut\u2019a gittim ama hi\xe7bir \u015fey yemedim.\nMy mom was mad at me but I didn\u2019t care.\nAnnem bana k\u0131zd\u0131 ama umurumda de\u011fildi.\nMy friend came to us and we studied math together.\nArkada\u015f\u0131m bize geldi ve birlikte matematik \xe7al\u0131\u015ft\u0131k.\n\n\u2b50 Ge\xe7mi\u015fteki al\u0131\u015fkanl\u0131klar\u0131 ifade ederken kullan\u0131l\u0131r:\n\nMy father smoked twenty cigarettes a day till he gave up.\nBabam b\u0131rakana kadar g\xfcnde yirmi sigara i\xe7erdi.\nI saved my money till I married.\nEvlenene kadar param\u0131 biriktirdim.\nI played football till I was up to the age of 30.\n30 ya\u015f\u0131ma kadar futbol oynad\u0131m.\nI studied English until the schools opened.\nOkullar a\xe7\u0131lana kadar \u0130ngilizce \xe7al\u0131\u015ft\u0131m.\n\n    Simple Past Tense ile Kullan\u0131lan Zaman Zarflar\u0131\n\nC\xfcmlede bulunduklar\u0131 zaman ilgili c\xfcmlelerin past tense oldu\u011funu kan\u0131tlayan baz\u0131 zaman zarflar\u0131 vard\u0131r. A\u015fa\u011f\u0131daki tabloda yayg\u0131n bir \u015fekilde kullan\u0131lan zaman zarflar\u0131 derlenmi\u015ftir:\n\nlast night\t    ge\xe7en gece\nlast week\t    ge\xe7en hafta\nlast month\t    ge\xe7en ay\nlast summer\t    ge\xe7en yaz\nlast year\t    ge\xe7en y\u0131l\nlast Monday\t    ge\xe7en pazartesi\nlast May\t    ge\xe7en may\u0131s\na day ago\t    bir g\xfcn \xf6nce\ntwo days ago\t    iki g\xfcn \xf6nce\nfive months ago\t    be\u015f ay \xf6nce\na year ago\t    bir y\u0131l \xf6nce\nyesterday\t    d\xfcn\nthe other day\t    ge\xe7en g\xfcn\nin 2005\t    2005\u2019te\nin the past\t    ge\xe7mi\u015fte\n",null,B.u,null,null,null,null,null,null)
B.Pt=new A.R("              \n\u0130ngilizcede sebep ve sonu\xe7 bildirmek i\xe7in yayg\u0131n olarak kullan\u0131lan ba\u011fla\xe7lar a\u015fa\u011f\u0131daki tabloda derlenmi\u015ftir.\n\n\ud83d\udd0a as\t      -d\u0131\u011f\u0131 i\xe7in, -dan dolay\u0131\n\ud83d\udd0a since\t      -d\u0131\u011f\u0131 i\xe7in, edeli, olal\u0131\n\ud83d\udd0a because\t      \xe7\xfcnk\xfc, dolay\u0131, y\xfcz\xfcnden\n\ud83d\udd0a now that\t      -d\u0131\u011f\u0131ndan, madem, madem ki\n\ud83d\udd0a due to\t      y\xfcz\xfcnden, sayesinde, \xf6t\xfcr\xfc\n\ud83d\udd0a owing to\t      y\xfcz\xfcnden, sayesinde, \xf6t\xfcr\xfc\n\ud83d\udd0a because of\t      y\xfcz\xfcnden, sayesinde, \xf6t\xfcr\xfc\n\ud83d\udd0a thanks to\t      sayesinde\n\ud83d\udd0a as a result of\t      sonu\xe7 olarak\n\ud83d\udd0a therefore\t      onun i\xe7in, bu nedenle\n\ud83d\udd0a so\t      bu y\xfczden, diye, yani, dolay\u0131s\u0131yla\n\ud83d\udd0a concequently\t      bu nedenle, sonu\xe7 olarak\n\ud83d\udd0a thus\t      b\xf6ylece, bu nedenle\n\n\u0130ngilizce Sebep Sonu\xe7 Ba\u011fla\xe7lar\u0131\n\nAs, since ve because her ne kadar benzer anlamlara sahip olup bir \u015feyin nedenini ifade etmek i\xe7in kullan\u0131lsa da aralar\u0131nda ufak farkl\u0131l\u0131klar bulunmaktad\u0131r.\n\n\u201cBecause\u201c, hem yaz\u0131l\u0131 hem de s\xf6zl\xfc dilde \u201cas\u201d ve \u201csince\u201d ba\u011fla\xe7lar\u0131ndan daha yayg\u0131n bir \u015fekilde kullan\u0131l\u0131r. Bacause ile dinleyicinin bilmedi\u011fi yeni fikirleri ifade edilir ve bu da haliyle di\u011fer iki ba\u011flaca g\xf6re daha vurgulu bir anlam sa\u011flar.\n\n\u2757 G\xfcndelik konu\u015fma dilinde veya resmi olmayan ortamlarda bacause \u201ccos\u201d olarak kullan\u0131lmaktad\u0131r.\n\nas ve since ise daha \xe7ok bahsi ge\xe7en nedenin dinleyen taraf\u0131ndan bilindi\u011fi durumlarda ve haliyle nedenden \xe7ok sonuca odaklanmak istenildi\u011finde kullan\u0131l\u0131r. E\u011fer c\xfcmle ba\u015f\u0131nda kullan\u0131l\u0131rsa sebep c\xfcmlesi bittikten sonra araya virg\xfcl gelir.\n\nI\u2019m criying cos I\u2019m so sad.\nA\u011fl\u0131yorum \xe7\xfcnk\xfc \xe7ok \xfczg\xfcn\xfcm.\n\nI am starving because I worked out too much.\n\xc7ok fazla spor yapt\u0131\u011f\u0131m i\xe7in a\xe7l\u0131ktan \xf6l\xfcyorum.\n\nAs everyone already watch the film, there\u2019s no need to go to the cinema.\nFilmi zaten herkes izledi\u011fi i\xe7in sinemaya gitmeye gerek yok.\n\nSince I was tired, I went to bed early.\nYorgun oldu\u011fum i\xe7in erken yatt\u0131m.\n\nI\u2019ll stay home as it\u2019s raining.\nYa\u011fmur ya\u011fd\u0131\u011f\u0131 i\xe7in evde kalaca\u011f\u0131m.\n\n\u0130ngilizce Sebep Sonu\xe7 C\xfcmleleri\n\n\u2757 Because of, due to, owing to, thanks to (olumlu c\xfcmlelerde kullan\u0131l\u0131r) ve as a result of ba\u011fla\xe7lar\u0131ndan sonra mutlaka bir isim veya fiil V+ing gelmelidir.\n\nHe missed the bus due to me.\nBenim y\xfcz\xfcmden otob\xfcs\xfc ka\xe7\u0131rd\u0131.\n\nI didn\u2019t go to school because of raining.\nYa\u011fmur ya\u011fd\u0131\u011f\u0131 i\xe7in okula gitmedim.\n\nOwing to the storm, the flights were cancelled.\nF\u0131rt\u0131na nedeniyle u\xe7u\u015flar iptal edildi.\n\nBecause of her membership, Anna can sign up for as many classes as she want!\n\xdcyeli\u011fi nedeniyle Anna istedi\u011fi kadar derse kaydolabilir.\n\nI am more flexible as a result of my yoga classes.\nYoga derslerim sonucunda daha esne\u011fim.\n\nThanks to the support of the fans, Galatasaray won the match.\nTaraftarlar\u0131n deste\u011fi sayesinde Galatasaray ma\xe7\u0131 kazand\u0131.\n\n\u0130ngilizce Sebep Sonu\xe7 C\xfcmleleri\n\n\u2757 Now that ge\xe7mi\u015f zamanda kullan\u0131lmaz.\n\nNow that I am 18, I can finally get a driving licence.\nArt\u0131k 18 ya\u015f\u0131nday\u0131m ve sonunda ehliyet alabiliyorum.\n\nThere were not enough participants. Therefore, the meeting was cancelled.\nYeterli kat\u0131l\u0131mc\u0131 yoktu. Bu nedenle toplant\u0131 iptal edildi.\n\nI just had pizza, so I\u2019m not hungry.\nAz \xf6nce pizza yedim, o y\xfczden a\xe7 de\u011filim.\n\nI had a lot of work, so I went home late.\n\xc7ok i\u015fim vard\u0131, bu y\xfczden eve ge\xe7 gittim.\n\n",null,B.u,null,null,null,null,null,null)
