B.Pw=new A.R("              \n\u0130ngilizcede type 1 c\xfcmleleri, if clause (\u015fartl\u0131 c\xfcmle) ve main clause (temel c\xfcmle) olmak \xfczere iki k\u0131s\u0131mdan olu\u015fur. Bu iki k\u0131s\u0131mdan i\xe7inde if bar\u0131nd\u0131ran \u015fart c\xfcmlesi geni\u015f zamanda (simpe present tense) kullan\u0131l\u0131rken, ana c\xfcmle ise gelecek zamanda (simple future tense) kullan\u0131l\u0131r.\n\n\u25b6\ufe0f If Clause (\u015eartl\u0131 C\xfcmle), Main Clause (Ana C\xfcmle)\n\u25b6\ufe0f If + simple present tense, simple future tense\n\n\u2757 Ko\u015fulun belirtildi\u011fi yan c\xfcmle ile sonucu belirten ana c\xfcmlenin s\u0131ras\u0131 de\u011fi\u015ftirilebilir. B\xf6ylesi durumlarda virg\xfcl\xfcn ko\u015ful belirten yan c\xfcmle ilk s\u0131rada gelirse kullan\u0131ld\u0131\u011f\u0131na dikkat etmek gerekir.\n\n\u25b6\ufe0f Main Clause (Ana C\xfcmle) If Clause (\u015eartl\u0131 C\xfcmle)\n\u25b6\ufe0f simple future tense If + simple present tense (virg\xfcl yok)\n\n\n\u0130ngilizcede type 1 yap\u0131s\u0131, ger\xe7ek veya ger\xe7e\u011fe uygun olaylar\u0131 anlatmak i\xe7in kullan\u0131lmaktad\u0131r. Haliyle olas\u0131 bir \u015fart ve bu \u015fart\u0131n olas\u0131 sonucu ifade edilir.\n\nIf you don\u2019t drive carefully(if clause), you will have an accident(main clause).\nDikkatli s\xfcrmezseniz(\u015fart c\xfcmlesi) kaza yapars\u0131n\u0131z(temel c\xfcmle).\n\n\u2757 Type 1 yap\u0131s\u0131nda bir \xf6neri belirtmek i\xe7in temel c\xfcmlede gelecek zaman yerine kip belirte\xe7leri (modals) kullan\u0131labilir.\n\nIf there are no waves in the sea, I can swim.\nE\u011fer denizde dalga olmazsa y\xfczebilirim.\nIf your wife calls you home, you should go there.\nKar\u0131n seni eve \xe7a\u011f\u0131r\u0131rsa, oraya gitmelisin.\n\nType 1 \xd6rnek C\xfcmleler\nA\u015fa\u011f\u0131daki tabloda type 1 ile alakal\u0131 \xf6rnek c\xfcmleler derlenmi\u015ftir:\n\nIf I\u2019m free, I\u2019ll go with you to the cinema.\nM\xfcsait olursam, seninle sinemaya gelirim.\n\nIf you don\u2019t hurry, Harry, we\u2019ll miss the bus.\nAcele etmezsen Harry, otob\xfcs\xfc ka\xe7\u0131raca\u011f\u0131z.\n\nif I cancel the reservation tonight, will the hotel charge me?\nBu gece rezervasyonu iptal edersem otel benden \xfccret al\u0131r m\u0131?\n\nIf I\u2019m too busy, I won\u2019t go to the theatre.\nE\u011fer \xe7ok me\u015fgul olursam, tiyatroya gitmeyece\u011fim.\n\nIf it rains, I will buy an umbrella.\nE\u011fer ya\u011fmur ya\u011farsa \u015femsiye alaca\u011f\u0131m.\n\nI will buy an umbrella if it rains.\nE\u011fer ya\u011fmur ya\u011farsa \u015femsiye alaca\u011f\u0131m.\n\nAnna will go to college if you say so.\nSen s\xf6ylersen Anna \xfcniversiteye gidecek.\n\nIf John is late again, my father will be very angry.\nJohn yine ge\xe7 kal\u0131rsa babam \xe7ok k\u0131zacak.\n\nIf I have time, I can meet you.\nVaktim olursa seninle bulu\u015fabilirim.\n\nIf you steal from one author it\u2019s plagiarism; if you steal from many it\u2019s research.\nBir yazardan \xe7alarsan\u0131z, bu intihaldir; e\u011fer bir\xe7o\u011fundan \xe7alarsan\u0131z, bu ara\u015ft\u0131rmad\u0131r.\n\n",null,B.u,null,null,null,null,null,null)
