B.Pz=new A.R("              \nPast continous tense ve simple past tense farkl\u0131 i\u015flevler anlat\u0131lmaktad\u0131r. Past continuous tense bir s\xfcredir devam eden daha uzun bir olay\u0131 anlatmak i\xe7in kullan\u0131l\u0131r.\n\nBuna kar\u015f\u0131l\u0131k past simple tense ile bu olay\u0131 kesen daha k\u0131sa bir eylemi tarif etmek i\xe7in kullan\u0131lmaktad\u0131r. Bu iki zaman\u0131 c\xfcmlede birle\u015ftirmek i\xe7inse \u201cwhen\u201d, \u201cwhile\u201d ve \u201cas\u201d gibi kelimeler kullan\u0131lmaktad\u0131r.\n\nI was taking a shower when the doorbell rang.\nKap\u0131 \xe7ald\u0131\u011f\u0131nda du\u015f al\u0131yordum.\n\nI was watching TV when the phone rang.\nTelefon \xe7ald\u0131\u011f\u0131nda televizyon izliyordum.\n\nAs I was walking in the park, I saw my ex-girlfriend.\nParkta y\xfcr\xfcrken eski k\u0131z arkada\u015f\u0131m\u0131 g\xf6rd\xfcm.\n\nRebeca called me while I was having dinner.\nYemek yerken Rebeca beni arad\u0131.\n\nI had a great idea while I was having a shower.\nDu\u015f al\u0131rken akl\u0131ma harika bir fikir geldi.\n\nHey, Dad. Mum texted you while you were making dinner.\nHey, baba. Sen yemek haz\u0131rlarken annem sana mesaj att\u0131.\n\n          Simple Past Tense ve Past Continuous Tense C\xfcmleleri\n\n\u2b50 Past continuous tense ge\xe7ici eylemler ve durumlar hakk\u0131nda konu\u015fmak i\xe7in de kullan\u0131l\u0131r. Buna kar\u015f\u0131l\u0131k past simple tense ise tamamlanm\u0131\u015f eylemler veya i\u015flemler hakk\u0131nda konu\u015fmak i\xe7in kullan\u0131l\u0131r.\n\nI got into kendo while I was living in Japan.\nJaponya\u2019da ya\u015farken kendo ile tan\u0131\u015ft\u0131m.\n\nI met her when I was working in Germany.\nOnunla Almanya\u2019da \xe7al\u0131\u015f\u0131rken tan\u0131\u015ft\u0131m.\n\nJohn took lots of photos while he was travelling around Europe.\nJohn, Avrupa\u2019y\u0131 dola\u015f\u0131rken \xe7ok say\u0131da foto\u011fraf \xe7ekti.\n\nTom made lots of friends while he was studying abroad.\nTom yurtd\u0131\u015f\u0131nda okurken bir\xe7ok arkada\u015f edindi.\n\nI ate a lot of pizza while I was living in Rome.\nRoma\u2019da ya\u015farken \xe7ok pizza yedim.\n\nI went swimming while I was staying at the hotel.\nOtelde kal\u0131rken y\xfczmeye gittim.\n\n",null,B.u,null,null,null,null,null,null)
B.PA=new A.R("            \nDilbilim alan\u0131 sayesinde, bug\xfcn var olan 5.000\u2019den fazla dilin geli\u015fimi hakk\u0131nda \xe7ok \u015fey biliyoruz. Dilbilgilerini ve telaffuzlar\u0131n\u0131 tan\u0131mlayabilir ve s\xf6zl\xfc ve yaz\u0131l\u0131 bi\xe7imlerinin zaman i\xe7inde nas\u0131l de\u011fi\u015fti\u011fini g\xf6rebiliriz. \xd6rne\u011fin, Norve\xe7\xe7e, Hint\xe7e ve \u0130ngilizceyi i\xe7eren Hint-Avrupa dil grubunun k\xf6kenlerini anlayabiliyor ve onlar\u0131 M\xd6 3000\u2019lerde Do\u011fu Avrupa\u2019daki kabilelere kadar takip edebiliyoruz.\nBu sayede dil tarihinin b\xfcy\xfck bir b\xf6l\xfcm\xfcn\xfc belirledik, ancak hakk\u0131nda hala \xe7ok az \u015fey bildi\u011fimiz alanlar var. Uzmanlar, insan t\xfcr\xfcn\xfcn dili kullanabilmek i\xe7in nas\u0131l geli\u015fti\u011fini \xf6\u011frenmek i\xe7in evrimsel biyoloji alan\u0131na bakmaya ba\u015fl\u0131yor. \u015eimdiye kadar, cevaplardan \xe7ok daha fazla soru ve yar\u0131m teori var.\n\u0130nsan dilinin \u015fempanzeler gibi en yak\u0131n ve en zeki akrabalar\u0131m\u0131zdan bile \xe7ok daha karma\u015f\u0131k oldu\u011funu biliyoruz. Karma\u015f\u0131k d\xfc\u015f\xfcnceleri ifade edebilir, ince duygular\u0131 aktarabilir ve ge\xe7mi\u015f ve gelecek gibi soyut kavramlar hakk\u0131nda ileti\u015fim kurabiliriz. Ve bunu dilbilgisi olarak bilinen bir dizi yap\u0131sal kural\u0131 izleyerek yap\u0131yoruz. Kelimelerin s\u0131ras\u0131n\u0131 y\xf6netmek i\xe7in sadece insanlar do\u011fu\u015ftan gelen bir kurallar sistemi mi kullan\u0131yor? Belki de hay\u0131r, \xe7\xfcnk\xfc baz\u0131 ara\u015ft\u0131rmalar yunuslar\u0131n bu yetene\u011fi payla\u015ft\u0131\u011f\u0131n\u0131, \xe7\xfcnk\xfc bu kurallar\u0131n ne zaman kullan\u0131lmad\u0131\u011f\u0131n\u0131 anlayabildiklerine i\u015faret ediyor.\nKarma\u015f\u0131k dil yetene\u011fimizin nereden geldi\u011fini bilmek istiyorsak, beynimizin di\u011fer hayvanlardan nas\u0131l farkl\u0131 oldu\u011funa bakmam\u0131z gerekir. Bu sadece beyin b\xfcy\xfckl\xfc\u011f\xfcnden \xe7ok daha fazlas\u0131yla ilgili, beynimizin ba\u015fka neler yapabilece\u011fi, ne zaman ve neden bu \u015fekilde geli\u015fti\u011fi de \xf6nemlidir. Ve bunun i\xe7in \xe7ok az fiziksel ipucu var; atalar\u0131m\u0131z\u0131n b\u0131rakt\u0131\u011f\u0131 eserler, bize hangi konu\u015fmay\u0131 yapabileceklerini g\xf6stermiyor. Eski insanlar\u0131n kal\u0131nt\u0131lar\u0131nda g\xf6rebildi\u011fimiz \u015feylerin biri de a\u011f\u0131z, bo\u011faz ve dilin geli\u015fimidir. Yakla\u015f\u0131k 100.000 y\u0131l \xf6nce, insanlar karma\u015f\u0131k sesler yaratma yetene\u011fini geli\u015ftirmi\u015fti. Bundan \xf6nce, evrimsel biyologlar, ilk insanlar\u0131n daha temel sesler kullanarak ileti\u015fim kurup kurmad\u0131\u011f\u0131na dair yaln\u0131zca tahmin \xfcretebilirler.\nBa\u015fka bir soru, dilin di\u011fer primatlarda olmad\u0131\u011f\u0131 \u015fekilde geli\u015fmesine izin veren insan beyninin fark\u0131 nedir? Bir noktada, beynimiz a\u011fz\u0131m\u0131za sesli ve \xfcns\xfcz sesler \xe7\u0131karabilecek hale geldi ve etraf\u0131m\u0131zdaki \u015feyleri adland\u0131rmak i\xe7in kelime icat etme kabiliyeti geli\u015ftirdik. Bunlar karma\u015f\u0131k dilin temel bile\u015fenleriydi. Bir sonraki de\u011fi\u015fiklik, bu kelimeleri, \xe7ocuklar\u0131n konu\u015fmay\u0131 ilk \xf6\u011frendiklerinde kulland\u0131klar\u0131 \u2018\xf6n-dil\u2019e benzer \u015fekilde c\xfcmlelere koymak olurdu. Bir sonraki ad\u0131m\u0131n \u2013 \xf6rne\u011fin ge\xe7mi\u015fi, \u015fimdiyi ve gelece\u011fi i\u015faret etmek i\xe7in dilbilgisini veya \xe7o\u011fullar\u0131 ve ilgili yan t\xfcmceleri eklemenin \u2013 insan beyninde daha fazla geli\u015fmeyi gerektirip gerektirmedi\u011fini veya giderek medenile\u015fen birlikte ya\u015fama tarz\u0131m\u0131za bir yan\u0131t olup olmad\u0131\u011f\u0131n\u0131 kimse bilmiyor.\nYine de 100.000 ila 50.000 y\u0131l \xf6nce, \xf6rne\u011fin ma\u011fara resimlerinde, erken insan uygarl\u0131\u011f\u0131n\u0131n kan\u0131tlar\u0131n\u0131 g\xf6rmeye ba\u015fl\u0131yoruz; kimse bununla dil aras\u0131ndaki ba\u011flant\u0131y\u0131 bilmiyor. Beyinler birdenbire b\xfcy\xfcmedi, ancak insanlar daha karma\u015f\u0131k ve daha zeki hale geldi. Beyinlerinin geli\u015fmesine neden olan dili kullanmak m\u0131yd\u0131? Yoksa daha karma\u015f\u0131k beyinleri dil \xfcretmeye mi ba\u015flad\u0131?\nGeneti\u011fin beyin ve dil geli\u015fimi \xfczerindeki etkisine bakmakta daha fazla soru var. Mutasyona u\u011frayan ve bize dil yetene\u011fi veren genler var m\u0131? Ara\u015ft\u0131rmac\u0131lar, 200.000 ila 100.000 y\u0131l \xf6nce meydana gelen, konu\u015fmayla ve beynimizin a\u011fz\u0131m\u0131z\u0131 ve y\xfcz\xfcm\xfcz\xfc nas\u0131l kontrol etti\u011fiyle ba\u011flant\u0131l\u0131 gibi g\xf6r\xfcnen bir gen mutasyonu buldular. Maymunlar da benzer bir gene sahiptir, ancak bu mutasyona u\u011framam\u0131\u015ft\u0131r. Genlerin dil \xfczerinde ne kadar etkisi oldu\u011funu s\xf6ylemek i\xe7in hen\xfcz \xe7ok erken ama bir g\xfcn cevaplar DNA\u2019m\u0131zda bulunabilir.\n            ",null,B.u,null,null,null,null,null,null)
B.PB=new A.R("              \nPast perfect tense her ne kadar T\xfcrk\xe7ede mi\u015f\u2019li ge\xe7mi\u015f zaman olarak kullan\u0131lsa da, bu kipin en \xf6nemli vazifesi, ge\xe7mi\u015fte meydana gelmi\u015f iki olaydan \xf6nce ger\xe7ekle\u015feni vurgulamak, bildirmektir. E\u011fer c\xfcmlede tek bir ge\xe7mi\u015f eylemden bahsedilecekse past perfect tense yerine simple past tense tercih edilir.\n\nHad + V3 \u015feklinde kullan\u0131lan past perfect tense ile olumlu, olumsuz ve soru c\xfcmleleri a\u015fa\u011f\u0131daki gibi yap\u0131l\u0131r:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/you/we/they/he/she/it had V3\nI/you/we/theye/she/it\u2019d V3\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/you/we/they/he/she/it had not V3\nI/you/we/theye/she/it hadn\u2019t V3\n\n\n\u27a1\ufe0f Soru c\xfcmleleri\nHad I/you/we/they/he/she/it V3?\nHadn\u2019t I/you/we/theye/she/it V3?\n\n\u2757 Past perfect tense ile sorulmu\u015f bir soruya Evet-Hay\u0131r \u015feklinde k\u0131sa cevaplar verirken:\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\nYes, I/you/we/they/he/she/it had.\nYes, I/you/we/they/he/she/it\u2019d.\n\n\u2757 Evet-Hay\u0131r sorular\u0131na k\u0131sa evet cevaplar\u0131 k\u0131saltma ile verilmez.\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\nNo, I/you/we/they/he/she/it had not.\nNo, I/you/we/they/he/she/it hadn\u2019t\n\nG\xfcndelik ya\u015famda s\u0131kl\u0131kla kar\u015f\u0131la\u015f\u0131labilecek olan yukar\u0131daki formlar\u0131n a\u015fa\u011f\u0131da telaffuzlar\u0131 verilmi\u015ftir. Bu telaffuzlar\u0131 \xf6\u011frenmek hem konu\u015fma hem dinleme becerileri i\xe7in olduk\xe7a faydal\u0131 olacakt\u0131r.\n\n\ud83d\udd0a had,\n\ud83d\udd0a I\u2019d,\n\ud83d\udd0a had not,\n\ud83d\udd0a hadn\u2019t\n\u0130ngilizcede Past Perfect Tense Kullan\u0131m\u0131\n\u2b50 Ge\xe7mi\u015fte meydana gelmi\u015f iki olaydan birinin di\u011ferinden ge\xe7mi\u015fte oldu\u011funu belirtirken kullan\u0131l\u0131r.\n\n\nThe thief had fled when the police arrived.\nPolis geldi\u011finde h\u0131rs\u0131z ka\xe7m\u0131\u015ft\u0131.\nBy the time the doctor arrived, the injured man had bled to death.\nDoktor varan kadar yaral\u0131 adam kan kayb\u0131ndan \xf6lm\xfc\u015ft\xfc.\nI was sick because I had overeaten the previous night.\nHastayd\u0131m \xe7\xfcnk\xfc \xf6nceki gece fazla yemi\u015ftim.\n\n\u2b50 Ge\xe7mi\u015fte belirli bir eylem veya zamandan \xf6nceki s\xfcreci anlatmak i\xe7in kullan\u0131l\u0131r:\n\nI had used it for 5 years before my computer broke down.\nBilgisayar\u0131m bozulmadan \xf6nce 5 y\u0131l kullanm\u0131\u015ft\u0131m.\nHad you ever visited \u0130stanbul before your trip in 2000?\n2000 y\u0131l\u0131ndaki seyahatinizden \xf6nce \u0130stanbul\u2019u hi\xe7 ziyaret etmi\u015f miydiniz?\n\n\u2b50 Past perfect tense, ge\xe7mi\u015fte yap\u0131lm\u0131\u015f iki i\u015ften daha \xf6nce yap\u0131lm\u0131\u015f olan\u0131 anlatt\u0131\u011f\u0131 i\xe7in, hemen her zaman simple past tense de i\xe7eren bir c\xfcmlecik e\u015fli\u011finde kurulur.\n\n\xc7o\u011fu zaman bu c\xfcmlecikler before ve after ile ba\u011flan\u0131rlar. Genellikle before simple past\u2019l\u0131, after ise past perfect\u2019li c\xfcmleci\u011fin ba\u015f\u0131nda yer al\u0131r.\n\nThe miser locked the money in a safe after he had counted it.\nCimri paray\u0131 sayd\u0131ktan sonra kasaya kilitledi.\nBefore the miser locked the money in a safe, he had counted it.\nCimri paray\u0131 kasaya kilitlemeden \xf6nce saym\u0131\u015ft\u0131.\n\n\u2757 Past perfect, baz\u0131 c\xfcmlelerde present perfect tense ile kar\u0131\u015ft\u0131r\u0131lmaktad\u0131r. A\u015fa\u011f\u0131daki c\xfcmleyi inceleyin:\n\nI have never seen an actress.\nHi\xe7 aktris g\xf6rmedim.\n\n\nYukar\u0131daki c\xfcmlede c\xfcmleyi s\xf6yleyen ki\u015finin bug\xfcne kadar hi\xe7 aktris g\xf6rmedi\u011fi ve \u015fu anda da g\xf6rmedi\u011fi anla\u015f\u0131lmaktad\u0131r.\n\nI had never seen an actress.\nHi\xe7 aktris g\xf6rmemi\u015ftim.\n\nYukar\u0131daki c\xfcmleyi s\xf6yleyen ki\u015finin ise o ana kadar (ge\xe7mi\u015fte oluyor) hi\xe7 aktris g\xf6rmedi\u011fini ama tam o esnada ilk kez g\xf6rd\xfc\u011f\xfc anlat\u0131lmaktad\u0131r.\n\nBundan dolay\u0131 g\xfczel bir kad\u0131nla konu\u015furken (\u015fu anda) onu ilk g\xf6rd\xfc\u011f\xfcn\xfcz ana at\u0131fta bulunarak \u201cI had never seen such a beautiful woman (Hi\xe7 bu kadar g\xfczel bir kad\u0131n g\xf6rmemi\u015ftim).\u201d demek \xe7ok yerinde bir iltifat olacakt\u0131r. \ud83d\ude0d\ud83d\udc4d\ud83c\udffb\n\n\xd6nce olan\u0131n past perfect ile anlat\u0131ld\u0131\u011f\u0131 birden fazla ge\xe7mi\u015f zaman eylemlerinde di\u011fer ge\xe7mi\u015f zaman c\xfcmleleri simple past tense ile anlat\u0131l\u0131r. Ayr\u0131ca belirtmek gerekir ki bir c\xfcmlede birden fazla perfect zamanda kullan\u0131lan c\xfcmle olamaz.\n\n",null,B.u,null,null,null,null,null,null)
B.PC=new A.R("              \nBu yap\u0131 ge\xe7mi\u015fte s\u0131kl\u0131kla yap\u0131lan ama art\u0131k yap\u0131lmayan eylemleri ifade etmek i\xe7in kullan\u0131l\u0131r. A\u015fa\u011f\u0131daki tabloda used to kal\u0131b\u0131n\u0131n c\xfcmle i\xe7inde olumlu, olumsuz ve soru ifadelerinde yap\u0131l\u0131\u015f\u0131 g\xf6sterilmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + used to + V1\n\nIt used to be a Chinese restaurant, but now it\u2019s French.\nEskiden bir \xc7in restoran\u0131yd\u0131, ama \u015fimdi Frans\u0131z.\nWe used to live in Paris.\nEskiden Paris\u2019te ya\u015f\u0131yorduk.\nI used to be able to play the guitar.\nEskiden gitar \xe7alabiliyordum.\nI used to drink coffee every morning but now I drink tea.\nEskiden her sabah kahve i\xe7erdim ama \u015fimdi \xe7ay i\xe7iyorum.\nSergio Ag\xfcero used to play football professionally but he had to quit because of an injury.\nSergio Ag\xfcero profesyonel olarak futbol oynuyordu ama sakatl\u0131\u011f\u0131 nedeniyle b\u0131rakmak zorunda kald\u0131.\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + didn\u2019t use to + V1\nSubject (I, you, we, they, he, she, it) + did not use to + V1\n\n\nIt didn\u2019t use to be so crowded in the shops as it is nowadays.\nEskiden d\xfckkanlar \u015fimdiki kadar kalabal\u0131k de\u011fildi.\nHe didn\u2019t use to eat fish before.\nDaha \xf6nce bal\u0131k yemezdi.\nJohn didn\u2019t use to read a book 5 years ago.\nJohn 5 y\u0131l \xf6nce kitap okumazd\u0131.\nHe didn\u2019t use to drink milk when he was a kid.\n\xc7ocukken s\xfct i\xe7mezdi.\n\n\u27a1\ufe0f Soru c\xfcmleleri\nDid + subject (I, you, we, they, he, she, it) + use to + V1?\n\nDid you use to go fishing every day?\nHer g\xfcn bal\u0131\u011fa gider miydin?\nDid you use to watch Bugs Bunny?\nBugs Bunny izler miydin?\nDid you use to drink milk when you were a child?\n\xc7ocukken s\xfct i\xe7er miydin?\nDid you use to smoke a lot in the past?\nGe\xe7mi\u015fte \xe7ok sigara i\xe7er miydin?\n\n\xd6rnek telaffuzlar\u0131:\n\n\ud83d\udd0a used to,\n\ud83d\udd0a didn\u2019t use to,\n\ud83d\udd0a did not use to\nBenzer anlamlarda would da kullan\u0131labilmektedir. Ancak used to ge\xe7mi\u015fte yap\u0131lan ama art\u0131k yap\u0131lmayan eylemleri anlat\u0131r. Buna kar\u015f\u0131l\u0131k would ile b\xf6ylesi bir kesinlik yoktur. \xc7ok bariz bir kesinlik varsa woul kullanmak yanl\u0131\u015f olacakt\u0131r.\n\nHe would do exercises every day before work. (\u015fu anda da yapabilir)\nHe used to do exercises every day before work. (\u015fu an kesinlikle yapm\u0131yor)\nHer g\xfcn i\u015ften \xf6nce egzersiz yapard\u0131.\n\nI used to live in London.\nI would live in London.\nEskiden Londra\u2019da ya\u015f\u0131yordum.\n\n",null,B.u,null,null,null,null,null,null)
