B.PE=new A.R("              \n\u0130ngilizcede \u015fimdiki zaman anlam\u0131 vermek i\xe7in kullan\u0131lan \u2013ing ve gelecek zaman anlam\u0131 vermekte kullan\u0131lan kal\u0131plardan biri olan will kullan\u0131larak (will + be + Ving) future continuous anlam\u0131 sa\u011flan\u0131r.\n\nA\u015fa\u011f\u0131daki tabloda \u015fah\u0131s zamirlerine g\xf6re future continuous ile olumlu, olumsuz ve soru c\xfcmlelerinin nas\u0131l yap\u0131ld\u0131\u011f\u0131 g\xf6sterilmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/you/we/they/he/she/it + will be Ving\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/you/we/they/he/she/it + will not be Ving\nI/you/we/they/he/she/it + won\u2019t be Ving\n\n\n\u27a1\ufe0f Soru c\xfcmleleri\nWill + I/you/we/they/he/she/it + be + Ving?\nWon\u2019t + I/you/we/they/he/she/it + be + Ving?\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a will be,\n\ud83d\udd0a will not be,\n\ud83d\udd0a won\u2019t be\nFuture Continuous Tense\u2019in Kullan\u0131l\u0131\u015f\u0131\nFuture continuous gelecekte bir \u015feyin olaca\u011f\u0131n\u0131 ve beklenen bir s\xfcre boyunca devam edece\u011fini belirten bir zaman kipidir.\n\n\u2b50 Gelecekte belli bir anda devam etmekte olacak i\u015fleri anlat\u0131r.\n\nTom will be flying over the Alps at five o\u2019clock tomorrow aftemoon.\nTom yar\u0131n \xf6\u011fleden sonra saat be\u015fte Alpler\u2019in \xfczerinden u\xe7uyor olacak.\nOur teacher will be correcting examination papers all next week.\n\xd6\u011fretmenimiz \xf6n\xfcm\xfczdeki hafta s\u0131nav ka\u011f\u0131tlar\u0131n\u0131 d\xfczeltiyor olacak.\n\n\u2b50 Gelecekte belirsiz zamanlarda s\xfcrecek i\u015fleri anlat\u0131r:\n\nShe will be visiting you from time to time.\nZaman zaman sizi ziyaret edecek.\nI will be working until late.\nGe\xe7 saatlere kadar \xe7al\u0131\u015f\u0131yor olaca\u011f\u0131m.\n\n\n\u2b50 Gelecekte yar\u0131da kesilen eylemleri anlatmak i\xe7in kullan\u0131l\u0131r.\n\nGelecekte devam etmekte olan eylemi yar\u0131da kesen eylem genelde geni\u015f zaman ile kullan\u0131l\u0131r:\n\nI will be watching football on TV when John arrives tonight.\nJohn bu gece geldi\u011finde televizyonda futbol izliyor olaca\u011f\u0131m.\nI will be playing video games on the computer until my father comes.\nBabam gelene kadar bilgisayarda video oyunlar\u0131 oynam\u0131\u015f olaca\u011f\u0131m.\n\n\u2b50 Gelecekte paralel zamanlarda ger\xe7ekle\u015fece\u011fi d\xfc\u015f\xfcn\xfclen iki eylemi anlat\u0131rken (\u0130ki eylemden biri \u015fimdiki zamanken di\u011feri future continuous olur):\n\nI will be studying while my brother is playing video games.\nKarde\u015fim video oyunlar\u0131 oynarken ben ders \xe7al\u0131\u015f\u0131yor olaca\u011f\u0131m.\nMy father will be working on the project while I am going to school.\nBen okula giderken babam proje \xfczerinde \xe7al\u0131\u015f\u0131yor olacak.\n\n\u2b50 Sonras\u0131 i\xe7in yap\u0131lan tasar\u0131lar\u0131 anlatmak i\xe7in kullan\u0131labilir.\n\nDon\u2019t come round tonight because I\u2019ll be studying.\nBu gece gelme \xe7\xfcnk\xfc ben ders \xe7al\u0131\u015f\u0131yor olaca\u011f\u0131m\nAfter the meal we are having coffee, and then we\u2019ll be watching TV.\nYemekten sonra kahve i\xe7ece\u011fiz ve ard\u0131ndan televizyon izleyece\u011fiz.\n\n\u2b50 Sabit veya rutin olaylar\u0131 anlat\u0131rken kullan\u0131l\u0131r. (Bu durum hem \u015fimdiki zaman, hem gelecek zaman yapmak i\xe7in kullan\u0131lan be going to ile de yap\u0131labilir. Ayn\u0131 anlama sahip olur.)\n\n\nI am staying at the Side Premium Hotel in Manvagat.\nManvagat\u2019ta Side Premium Otel\u2019de kalaca\u011f\u0131m.\nI am going to stay at the Hotel in Manavgat.\nManvagat\u2019ta Otel\u2019de kalaca\u011f\u0131m.\nI will be staying at the Side Premium Hotel in Manvagat.\nManvagat\u2019ta Side Premium Otel\u2019de kalaca\u011f\u0131m (kal\u0131yor olaca\u011f\u0131m).\n\n\u2757 \xd6nemli bir not belirtelim; \u0130ngilizcede gelecek zamanlar\u0131ndan hi\xe7birisi (future tense, future perfect tense, future perfect continuous tense) \u201cwhen\u201d \u201cwhile\u201d \u201cbefore\u201d gibi zaman zarflar\u0131ndan sonra kullan\u0131lmaz. \n\n\u2757 Future continuous ille de -yor olacak \u015feklinde T\xfcrk\xe7eye \xe7evrilmeyebilir. -ecek, -acak ekleri getirilerek de bu yap\u0131 pekala kullan\u0131labilir.\n\n",null,B.u,null,null,null,null,null,null)
