B.PJ=new A.R("              \nT\u0131pk\u0131 di\u011fer if clauses c\xfcmleleri gibi type 0 da if clause (\u015fartl\u0131 c\xfcmle) ve main clause (temel c\xfcmle) olmak \xfczere iki k\u0131s\u0131mdan olu\u015fmaktad\u0131r ve her iki k\u0131s\u0131m da geni\u015f zamanda (simpe present tense) kullan\u0131l\u0131r.\n\n\u25b6\ufe0f If Clause (\u015eartl\u0131 C\xfcmle), Main Clause (Ana C\xfcmle)\n\u25b6\ufe0f If + simple present tense, simple present tense\n\nIf you mix yellow and blue (if clause), you get green(main clause).\nSar\u0131 ve maviyi kar\u0131\u015ft\u0131r\u0131rsan\u0131z (\u015fart c\xfcmlesi) ye\u015fil elde edersiniz(temel c\xfcmle).\n\n\u2757 Di\u011fer \u015fart c\xfcmlelerinde oldu\u011fu gibi bunda da ko\u015fulun belirtildi\u011fi yan c\xfcmle ile sonucu belirten ana c\xfcmlenin s\u0131ras\u0131 de\u011fi\u015ftirilebilir. B\xf6ylesi durumlarda virg\xfcl\xfcn ko\u015ful belirten yan c\xfcmle ilk s\u0131rada gelirse kullan\u0131ld\u0131\u011f\u0131na dikkat etmek gerekir.\n\n\n\u25b6\ufe0f Main Clause (Ana C\xfcmle) + If Clause (\u015eartl\u0131 C\xfcmle)\n\u25b6\ufe0f Simple present tense + if + simple present tense (virg\xfcl yok)\n\nYou get green(main clause) if you mix yellow and blue (if clause).\nSar\u0131 ve maviyi kar\u0131\u015ft\u0131r\u0131rsan\u0131z (\u015fart c\xfcmlesi) ye\u015fil elde edersiniz(temel c\xfcmle).\n\nHangi Durumlarda Type 0 Kullan\u0131lmaktad\u0131r?\nGenel olarak \u0130ngilizcede type 0 c\xfcmleleri iki durumda kullan\u0131lmaktad\u0131r. Bunlar\u0131 s\u0131ras\u0131yla a\u015fa\u011f\u0131daki gibidir:\n\nGenel ge\xe7er durumlar\u0131 ifade ederken\nBilimsel ger\xe7ekleri ifade ederken\nA\u015fa\u011f\u0131daki tabloda \u0130ngilizce \xf6rnek type 0 c\xfcmleleri derlenmi\u015ftir.\n\nIf you press the button, the application opens.\nButona basarsan\u0131z, uygulama a\xe7\u0131l\u0131r.\n\nIf you boil water, it evaporates.\nSuyu kaynat\u0131rsan\u0131z buharla\u015f\u0131r.\n\nIf you overeat, you get fat.\nFazla yersen \u015fi\u015fmanlars\u0131n.\n\nIf water reaches 100 degrees, it boils.\nSu 100 dereceye ula\u015f\u0131rsa kaynar.\n\nThe ground gets wet if it rains.\nYa\u011fmur ya\u011farsa yerler \u0131slan\u0131r.\n\nYou go to bed early if you are tired.\nYorgunsan erken yatars\u0131n.\n\nIf you\u2019re hungry, eat something.\nAc\u0131kt\u0131ysan bir \u015feyler ye.\n\n\u0130ngilizcede Type 0 \xd6rnek C\xfcmleler\nType 0, if clauses, zero conditional gibi adland\u0131r\u0131lmalar\u0131 oldu\u011fu i\xe7in kafa kar\u0131\u015ft\u0131r\u0131c\u0131 olabilse de \u0130ngilizcede type 0 yap\u0131s\u0131 genel ge\xe7er durumlar\u0131 ve bilimsel ger\xe7ekleri ifade etti\u011finden haliyle geni\u015f zaman ile kullan\u0131l\u0131rlar.\n\n\u2757 Ayr\u0131ca belirtmek gerekir ki, if yerine when ba\u011flac\u0131n\u0131 koyabilirsiniz. Anlamda hi\xe7bir de\u011fi\u015fiklik olmayacakt\u0131r.\n\nWater boils if it reaches 100 degrees.\n\nWater boils when it reaches 100 degrees.\n\nSu 100 dereceye ula\u015f\u0131nca kaynar.\n",null,B.u,null,null,null,null,null,null)
B.PK=new A.R("            \nBir g\xfcn bir fil arkada\u015f aramak i\xe7in ormanda geziniyormu\u015f. A\u011fa\xe7ta bir maymun g\xf6rm\xfc\u015f. \u201cBenim arkada\u015f\u0131m olur musun?\u201d diye sormu\u015f fil.\n\nMaymun da \u201cSen \xe7ok b\xfcy\xfcks\xfcn. Benim gibi a\u011fa\xe7lardan sallanamazs\u0131n\u201d demi\u015f.\n\nDaha sonra, fil bir tav\u015fanla kar\u015f\u0131la\u015fm\u0131\u015f. Ona da arkada\u015f\u0131m olur musun diye sormu\u015f. Fakat tav\u015fan \u201cSen benim sen benim yuvamda oynamak i\xe7in \xe7ok b\xfcy\xfcks\xfcn\u201d demi\u015f. Sonra fil bir kurba\u011fayla tan\u0131\u015fm\u0131\u015f. Ona da \u201cBenim arkada\u015f\u0131m olur musun?\u201d diye sormu\u015f. \u201cNas\u0131l olurum?\u201d diye sormu\u015f kurba\u011fa. \u201cSen benim gibi s\u0131\xe7ramak i\xe7in \xe7ok b\xfcy\xfcks\xfcn.\u201d demi\u015f. Fil \xe7ok \xfczg\xfcnm\xfc\u015f.\n\nSonras\u0131nda bir tilkiyle kar\u015f\u0131la\u015fm\u0131\u015f. Tilkiye de \u201cBenim arkada\u015f\u0131m olur musun?\u201d diye sormu\u015f. Tilki de \u201c\xdczg\xfcn\xfcm efendim, siz \xe7ok b\xfcy\xfcks\xfcn\xfcz\u201d demi\u015f. Bir sonraki g\xfcn, fil b\xfct\xfcn hayvanlar\u0131n ormanda kendi canlar\u0131 i\xe7in ko\u015fu\u015fturduklar\u0131n\u0131 g\xf6rm\xfc\u015f. Fil onlara sorunun ne oldu\u011funu sormu\u015f. Ay\u0131 da \u201cOrmanda bir kaplan var. Hepimizi yemeye \xe7al\u0131\u015f\u0131yor.\u201d demi\u015f. B\xfct\xfcn hayvanlar saklanmak i\xe7in ka\xe7\u0131yorlarm\u0131\u015f.\n\nFil de ormandaki herkesi kurtarmak i\xe7in ne yapabilece\u011fini d\xfc\u015f\xfcnm\xfc\u015f. Bu arada, kaplan ormanda kimi bulduysa yiyormu\u015f.\n\nFil kaplana do\u011fru y\xfcr\xfcm\xfc\u015f ve demi\u015f ki \u201cL\xfctfen Bay Kaplan, bu zavall\u0131 hayvanlar\u0131 yemeyin.\u201d \u201cKendi i\u015fine bak!\u201d diye h\u0131rlam\u0131\u015f kaplan. Filin kaplana a\u011f\u0131r bir tekme indirmekten ba\u015fka \xe7aresi yokmu\u015f. Korkmu\u015f kaplan can\u0131n\u0131 kurtarmak i\xe7in ka\xe7m\u0131\u015f. Fil herkese iyi haberi vermek i\xe7in ormana d\xf6nm\xfc\u015f. B\xfct\xfcn hayvanlar file te\u015fekk\xfcr etmi\u015fler. Hepsi \u201cSen bizim arkada\u015f\u0131m\u0131z olmak do\u011fru boyuttas\u0131n\u201d demi\u015fler.\n            ",null,B.u,null,null,null,null,null,null)
B.PL=new A.R("              \nCausative Verbs, T\xfcrk\xe7ede \u201cettirgen yap\u0131\u201d anlam\u0131na gelmektedir. Ad\u0131ndan da tahmin edebilece\u011fin gibi, Causative Verbs kullanarak c\xfcmlemizde birine bir \u015feyi yapt\u0131rma, \u201cettirme\u201d anlam\u0131n\u0131 veririz. \n\nBu anlam\u0131 vermek i\xe7in kullanaca\u011f\u0131m\u0131z 5 kelime ve bunlara ba\u011fl\u0131 yap\u0131lar var. Hepsinde i\u015fi ba\u015fkas\u0131na yapt\u0131rma anlam\u0131 olsa da, alt anlamlar\u0131na bak\u0131nca epey \xf6nemli n\xfcanslar oldu\u011funu g\xf6receksin. Bu y\xfczden dikkatli olman\u0131 \xf6neririz. Haz\u0131rsan ba\u015flayal\u0131m!\n\nCausative Verbs: \u201cGet\u201d\n\xd6\u011frenece\u011fimiz ilk Causative Verbs \u201cget\u201d olacak. \u201cGet\u201d fiilinin \u201celde etmek, almak, kazanmak\u201d gibi bir \xe7ok anlam\u0131 olsa da burada c\xfcmlemize bamba\u015fka bir anlam katacak. \u201cGet someone to do something\u201d olarak \xf6zetleyebilece\u011fimiz bu yap\u0131n\u0131n alt\u0131ndaki anlam birine i\u015fi yapt\u0131r\u0131rken ondan istedi\u011fimiz, talep etti\u011fimiz ya da ikna etti\u011fimizdir. Kullan\u0131m\u0131 ise \u015fu \u015fekildedir\n\nget + (i\u015f yapt\u0131r\u0131lan ki\u015fi) + to + fiilin yal\u0131n hali\n\n\xd6rnek: \n\nI will get my friend to make a cake for the party. (Arkada\u015f\u0131ma parti i\xe7in kek yapt\u0131raca\u011f\u0131m. \nI got my brother to do my homework for me. (\xd6devimi erkek karde\u015fime yapt\u0131rd\u0131m.)\nShe should get Jake to help me with the housework. (Jake\u2019in ona yard\u0131m etmesini sa\u011flamal\u0131.)\nG\xf6rd\xfc\u011f\xfcn gibi \xf6rneklerimizde \u201cget\u201d \xe7e\u015fitli zaman ve gramer yap\u0131lar\u0131nda bulundu. \u0130lk c\xfcmlede gelecek zaman, ikinci c\xfcmlede ge\xe7mi\u015f zaman \xfc\xe7\xfcnc\xfc c\xfcmlede ise \u201cshould\u201d modal fiili ile kulland\u0131k. \n\nYani bu demek oluyor ki Causative Verbs, normal fiiller gibi farkl\u0131 zaman ve yap\u0131lardaki c\xfcmlelerde kullan\u0131labilir. Ama kal\u0131p olarak yan\u0131nda gelen, form\xfcl olarak belirtti\u011fimiz \u015feyleri unutmamak gerek.\n\nCausative Verbs: Have\n\u0130kinci Causative Verbs ba\u015fl\u0131\u011f\u0131m\u0131z ise \u201chave\u201d. Biliyorsun ki have \u201csahip olmak\u201d anlam\u0131nda bir fiil olsa da bir \xe7ok i\u015fleve sahiptir. \xd6rne\u011fin, Present Perfect Tense gibi baz\u0131 tense\u2019lerde yard\u0131mc\u0131 fiil olabilir. Buradaki kullan\u0131m\u0131nda ise birine bir i\u015fi yapmas\u0131 i\xe7in sorumluluk ya da vermek anlam\u0131nda olacak. Kullan\u0131m\u0131 \u201cget\u201d kullan\u0131m\u0131na benzese de \u201cto\u201d kullanm\u0131yoruz. Yani, form\xfcle d\xf6kersek \u015f\xf6yle olacakt\u0131r:\n\nhave + (i\u015f yapt\u0131r\u0131lan ki\u015fi) + fiilin yal\u0131n hali\n\n\xd6rnek: \n\nI\u2019ll have John handle our budget problem. (John\u2019\u0131n b\xfct\xe7e problemimizle ilgilenmesini sa\u011flayaca\u011f\u0131m.)\nHe is going to have the plumber fix the toilet. (Tuvaleti tesisat\xe7\u0131ya tamir ettirecek.)\nI had my dad drive me to school yesterday. (Bug\xfcn babama kendimi okula b\u0131rakt\u0131rd\u0131m.) \nUmar\u0131z buraya kadar her \u015fey akl\u0131na yatm\u0131\u015ft\u0131r. Causative Verbs \xe7ok da zor bir konu olmasa da bir\xe7ok farkl\u0131 yap\u0131yla birlikte kullan\u0131labilmesi ve anlamlar\u0131 aras\u0131ndaki ince farkl\u0131l\u0131klar y\xfcz\xfcnden zaman zaman kafa kar\u0131\u015ft\u0131rabilir. \u0130\u015fte bu noktada Open English yan\u0131nda! \n\nOpen English\u2019e abone olarak ana dili \u0130ngilizce olan d\xfcnya \xe7ap\u0131nda e\u011fitmenlerden 7/24, g\xf6nl\xfcnce ders alabilir, canl\u0131 konu\u015fma gruplar\u0131nda e\u011fitmenler moderat\xf6rl\xfc\u011f\xfcnde yabanc\u0131larla \xf6\u011frendiklerini prati\u011fe d\xf6kebilir ve akl\u0131ndaki her soruya dev ar\u015fivimizdeki kaynak ve materyallere dan\u0131\u015farak an\u0131nda cevap bulabilirsin!\n\nOpen English\u2019e kay\u0131t ba\u015fvurusu yapmak i\xe7in, bu sayfadaki ileti\u015fim formunu doldurman yeterli.\n\ncausative verbs kullan\u0131m\u0131 - ingilizce ettirgen c\xfcmleler\n\nCausative Verbs: Make\n\u015eimdi de\u011finece\u011fimiz Causative Verbs ise \u201cmake\u201d. Normalde \u201cyapmak\u201d anlam\u0131 olsa da buradaki anlam\u0131 epey farkl\u0131. \u201cMake\u201d fiilini Causative Verbs olarak kulland\u0131\u011f\u0131m\u0131zda birine bir i\u015fi zorla yapt\u0131rmak anlam\u0131na gelir. Biraz daha agresif bir anlam\u0131 oldu\u011fu i\xe7in kullan\u0131rken dikkat etmeliyiz. Kullan\u0131m\u0131 \u201chave\u201d ile ayn\u0131, fakat yine de form\xfcl olarak g\xf6relim:\n\nmake + (i\u015f yapt\u0131r\u0131lan ki\u015fi) + fiilin yal\u0131n hali\n\n\xd6rnek: \n\nThe principal made guilty students stand on one foot for an hour. (M\xfcd\xfcr su\xe7lu \xf6\u011frencileri bir saat boyunca tek ayak \xfczerine tuttu.)\nMy landlord made me move out for no reason. (Ev sahibim hi\xe7bir sebep yokken beni evden \xe7\u0131kartt\u0131.)\nI\u2019ll make him pay for the damage he\u2019s done. (Verdi\u011fi hasar i\xe7in onu \xf6detece\u011fim.)\nCausative Verbs: Let\nBu Causative Verbs, biraz daha as\u0131l anlam\u0131na yak\u0131n. Normalde anlam\u0131 \u201cizin vermek\u201d olan \u201clet\u201d burada da ayn\u0131 anlamda kullan\u0131lacak. \u201cLet\u201d fiilini Causative Verbs olarak kullanarak birine bir \u015feyi yapmas\u0131 i\xe7in izin vermek anlam\u0131n\u0131 sa\u011flayabiliriz. Kullan\u0131m\u0131n\u0131 inceleyelim:\n\nlet + (izin verilen ki\u015fi) + fiilin yal\u0131n hali\n\n\xd6rnek: \n\nMy mom let me go outside after dinner. (Annem ak\u015fam yeme\u011finden sonra d\u0131\u015far\u0131 \xe7\u0131kmama izin verdi.)\nTeacher didn\u2019t let him leave the classroom. (\xd6\u011fretmen s\u0131n\u0131ftan \xe7\u0131kmas\u0131na izin vermedi.)\nPlease let me go. (L\xfctfen gitmeme izin ver.)\nCausative Verbs: Help\n\xd6nceki ba\u015fl\u0131\u011f\u0131m\u0131zdaki gibi \u201chelp\u201d Causative Verbs\u2019\xfc de as\u0131l anlam\u0131na yak\u0131n. \u201cHelp\u201di Causative Verbs olarak kullanarak birine bir i\u015fi yapmas\u0131nda yard\u0131m etme anlam\u0131n\u0131 verebiliriz. Kullan\u0131m\u0131nda iki alternatifimiz var. Fiilden \xf6nce \u201cto\u201d kullanabiliriz de kullanmayabiliriz de. Form\xfcle d\xf6kelim:\n\nhelp + (yard\u0131m edilen ki\u015fi) + fiilin yal\u0131n hali \n\nya da \n\nhelp + (yard\u0131m edilen ki\u015fi) + to + fiilin yal\u0131n hali\n\n\xd6rnek: \n\nI helped him water the plants. (Bitkileri sulamas\u0131na yard\u0131m ettim. )\nShe helped them to finish their drawing. (\xc7izimlerini bitirmelerine yard\u0131m etti.)\nThey helped the old lady get home. (Ya\u015fl\u0131 kad\u0131n\u0131n eve gitmesine yard\u0131m ettiler.)\n\n",null,B.u,null,null,null,null,null,null)
