B.PQ=new A.R("              \nIf Clause konu anlat\u0131m\u0131m\u0131z\u0131n Type 3 ba\u015fl\u0131\u011f\u0131nda art\u0131k anlam a\xe7\u0131s\u0131ndan ge\xe7mi\u015fte kalm\u0131\u015f pi\u015fmanl\u0131klar ve de\u011fi\u015fmesi m\xfcmk\xfcn olmayan durumlardan bahsederiz. If Clause Type 3\u2019yi, Type 2\u2019nun daha da geriye d\xf6n\xfck hali olarak d\xfc\u015f\xfcnebiliriz. Bu y\xfczden Perfect Tense\u2019lerde kulland\u0131\u011f\u0131m\u0131z \u201chave\u201d yard\u0131mc\u0131 fiilini kullanaca\u011f\u0131z.\n\nIf Clause (Past Perfect, Past Perfect Continuous) + Main Clause (Could, Would, Might + have + fiilin \xfc\xe7\xfcnc\xfc hali)\n\n\xd6rnek: \n\nI would have studied law if I had studied hard in high school. (Lisede daha \xe7ok ders \xe7al\u0131\u015fsayd\u0131m hukuk okurdum.)\nIf I had taken my medicine on time, I would have been healthier now. (E\u011fer ilac\u0131m\u0131 zaman\u0131nda alsayd\u0131m \u015fimdi daha sa\u011fl\u0131kl\u0131 olurdum.)\nIf she had packed her suitcase yesterday, she wouldn\u2019t have missed her flight. (Bavulunu d\xfcn haz\u0131rlasayd\u0131 u\xe7a\u011f\u0131n\u0131 ka\xe7\u0131rmazd\u0131.)\n\n",null,B.u,null,null,null,null,null,null)
