B.PW=new A.R("            \nEvery Saturday Daniel and his family go to the beach. They live far from the beach, but once a week the family gets into the car and Daniel\u2019s father drives for hours until they arrive.\n\nDaniel\u2019s parents love the beach. Daniel and his sister and brother love the beach. The family\u2019s dog loves the beach very much. But it is a problem to go to the beach every week. Daniel\u2019s father gets tired from driving so many hours.\n\nThe rest of the family gets tired from sitting in the car for so many hours. Daniel\u2019s mother says: \u201cIt\u2019s fun in the beach, but it takes too much time to get there and back!\u201d Daniel and his sister and brother are very sad. They want to go to the beach, but it is a problem. They try to go the swimming pool, but it is not the same thing.\n\nOne day Daniel\u2019s parents come to talk with the kids. They say: \u201cWe have a problem to go to the beach every week, but we love the beach, and you love the beach, and the dog loves the beach. So we have a solution.\n\nWe need to live near the beach!\u201d Daniel and his sister and brother are very happy! Now they live near the beach. They go to the beach every day!\n            ",null,B.u,null,null,null,null,null,null)
B.PX=new A.R("              \n\u0130ngilizcede past continuous tense, olumlu c\xfcmlelerde \u015fah\u0131s zamirine uygun olacak \u015fekilde was / were kal\u0131b\u0131 ve fiilin birinci haline -ing eki getirilerek yap\u0131l\u0131r. Olumsuz c\xfcmlelerde ise was / were kal\u0131b\u0131ndan sonra not olumsuzluk eki ve yine fiilin birinci haline -ing eki getirilerek yap\u0131l\u0131r. Soru c\xfcmlelerinde ise was / were c\xfcmlenin ba\u015f\u0131na getirilir ve yine fiilin birinci haline -ing eki getirilir.\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/he/she/it was Ving\nWe/you/they were Ving\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/he/she/it was not Ving\nI/he/she/it wasn\u2019t Ving\nWe/you/they were not Ving\nWe/you/they weren\u2019t Ving\n\n\u27a1\ufe0f Soru c\xfcmleleri\nWas I/he/she/it Ving?\nWasn\u2019t I/he/she/it Ving?\nWere we/you/they Ving?\nWeren\u2019t we/you/they Ving?\n\n\u2757 Past continuous ile sorulmu\u015f bir soruya Evet-Hay\u0131r \u015feklinde k\u0131sa cevaplar verirken:\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\nYes, I/he/she/it was\nYes, we/you/they were\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\nNo, I/he/she/it was not\nNo, I/he/she/it wasn\u2019t\nNo, we/you/they were not\nNo, we/you/they weren\u2019t\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a was,\n\ud83d\udd0a wasn\u2019t,\n\ud83d\udd0a was not,\n\ud83d\udd0a were,\n\ud83d\udd0a weren\u2019t,\n\ud83d\udd0a were not\nPast Continuous Tense Kullan\u0131m\u0131\n\u2b50 Ge\xe7mi\u015fte herhangi bir anda (ne zaman ba\u015flad\u0131\u011f\u0131 \xf6nemli de\u011fil) ba\u015flayan olay\u0131n devam edip (s\xfcreklilik belirtir) yine ge\xe7mi\u015fte bitti\u011fi durumlarda kullan\u0131l\u0131r:\n\nI was talking to my friend on my way to school.\nOkula giderken arkada\u015f\u0131mla konu\u015fuyordum.\nThey were having dinner at the Osteria Francescana.\nOsteria Francescana\u2019da ak\u015fam yeme\u011fi yiyorlard\u0131.\nThey were playing basketball all yesterday afternoon.\nD\xfcn b\xfct\xfcn \xf6\u011fleden sonra basketbol oynuyorlard\u0131.\n\n\u2b50 Ge\xe7mi\u015fte ba\u015flam\u0131\u015f ve devam eden eylemin yine ge\xe7mi\u015fte ama bu kez k\u0131sa s\xfcreli olan bir ba\u015fka ge\xe7mi\u015f eylem taraf\u0131ndan kesintiye u\u011frat\u0131ld\u0131\u011f\u0131 durumlarda.\n\nI was watching TV with my friends when the doorbell rang.\nKap\u0131 zili \xe7ald\u0131\u011f\u0131nda arkada\u015flar\u0131mla televizyon izliyordum.\nIt was raining when I went out.\nD\u0131\u015far\u0131 \xe7\u0131kt\u0131\u011f\u0131mda ya\u011fmur ya\u011f\u0131yordu.\nThe dog was barking at me when I was walking in the street.\nSokakta y\xfcr\xfcyorken k\xf6pek bana havl\u0131yordu.\n\n\u2b50 Ge\xe7mi\u015fte herhangi bir anda ba\u015flam\u0131\u015f ve devam eden eylemin yine ge\xe7mi\u015fte herhangi bir anda ba\u015flam\u0131\u015f ve devam eden bir ba\u015fka eylem taraf\u0131ndan kesintiye u\u011frat\u0131ld\u0131\u011f\u0131 durumlarda kullan\u0131l\u0131r. Eylemlerin zaman\u0131 paraleldir ve haliyle her iki olay da past continuous ile anlat\u0131l\u0131r.\n\nShe was making the salad while I was making the soup.\nBen \xe7orbay\u0131 yap\u0131yorken o salatay\u0131 yap\u0131yordu.\nHe was watching TV while I was taking a shower.\nBen du\u015f al\u0131yorken o televizyon izliyordu.\n\n\u2b50 Resmiyet ve kibarl\u0131k gere\u011fi birisinin ge\xe7mi\u015fte ya\u015fad\u0131\u011f\u0131 bir zaman dilimi hakk\u0131nda soru soruldu\u011funda:\n\nWhat was he doing after he left his job?\n\u0130\u015ften ayr\u0131ld\u0131ktan sonra ne yap\u0131yordu?\nWhat were you doing before your present job?\n\u015eu anki i\u015finizden \xf6nce ne yap\u0131yordunuz?\n\n\u2b50 Ge\xe7mi\u015fte, iki zaman noktas\u0131 aras\u0131nda s\xfcrmekte olan i\u015fleri anlat\u0131r.\n\nBetween June 1998 and December 1999, she was writing a book.\n1998 y\u0131l\u0131 Haziran ay\u0131 ile 1999 y\u0131l\u0131 Aral\u0131k ay\u0131 aras\u0131nda bir kitap yaz\u0131yordu.\nBetween July 1992 and December 1994, he was looking for a job.\nTemmuz 1992 ile Aral\u0131k 1994 aras\u0131nda i\u015f ar\u0131yordu.\n\n\u2b50 Always zarf\u0131yla kullan\u0131ld\u0131\u011f\u0131nda yap\u0131lan i\u015fin onaylanmad\u0131\u011f\u0131 ifade edilir.\n\nJane was always making a disturbance in the office.\nJane ofiste her zaman bir rahats\u0131zl\u0131k yarat\u0131yordu.\nJohn was always making excuses.\nJohn her zaman bahaneler uyduruyordu.\n\nPast Continuous ile Kullan\u0131lan Zaman Zarflar\u0131\nYukar\u0131daki \xf6rneklerde de g\xf6rd\xfc\u011f\xfcn\xfcz \xfczere baz\u0131 zaman ifadelerinden faydalan\u0131lmaktad\u0131r. Bu zaman ifadelerini bilmek g\xfcndelik konu\u015fmada c\xfcmle kurmay\u0131 kolayla\u015ft\u0131rd\u0131\u011f\u0131 gibi ayr\u0131ca s\u0131navlarda b\xfcy\xfck bir ipucu sa\u011flamaktad\u0131r.\n\n\ud83d\udd0a when\tiken, -d\u0131\u011f\u0131 zaman\n\ud83d\udd0a as\tiken, -d\u0131\u011f\u0131 zaman\n\ud83d\udd0a while\tiken, s\u0131ras\u0131nda\nwhen\n\u2b50 Past continuous ile past tens olan c\xfcmlelerde yayg\u0131n bir \u015fekilde kullan\u0131lan when, genel olarak ana c\xfcmledeki (main clause) eylemin s\xfcrd\xfc\u011f\xfcn\xfc, devam etmekte oldu\u011funu a\xe7\u0131klar. When ile kurulan zarf c\xfcmlesi (adverbial clause) simple past tense ile kurulur ve eyleme iken, -d\u0131\u011f\u0131 zaman gibi anlamlar katar. Buna kar\u015f\u0131l\u0131k eylemin devam etti\u011fini anlat\u0131lan ana c\xfcmle ise past continuous olarak kullan\u0131l\u0131r.\n\nPast Continuous Tense, When + Simple Past Tense\nIt was raining when I woke up.\nUyand\u0131\u011f\u0131mda ya\u011fmur ya\u011f\u0131yordu.\nI was watching TV when the doorbell rang.\nKap\u0131 zili \xe7ald\u0131\u011f\u0131nda televizyon izliyordum.\n\n\u2b50 When e\u011fer arka arkaya ger\xe7ekle\u015fen eylemleri anlat\u0131rken kullan\u0131l\u0131rsa bu iki eylem de simple past tense olur.\n\nSimple Past Tense, When + Simple Past Tense\nWe went shopping together when Emma arrived.\nEmma geldi\u011finde birlikte al\u0131\u015fveri\u015fe gittik.\n\nwhile\n\u2b50 While, ana c\xfcmledeki eylem devam ederken ger\xe7ekle\u015fen ve b\xf6ylece ana c\xfcmledeki eylemi kesen bir ba\u015fka eylemi anlatabilir. While ile anlat\u0131lan ana eylem past continuous tense ile kullan\u0131l\u0131r. Bu eylemi kesen di\u011fer eylem ise simple past tense olarak kullan\u0131l\u0131r.\n\nPast Tense, While + Past Continuous Tense\nWhile the guard was sleeping, the thief robbed the bank.\nBek\xe7i uyurken h\u0131rs\u0131z bankay\u0131 soydu.\n\n\u2b50 While, ge\xe7mi\u015fte herhangi bir anda ba\u015flam\u0131\u015f ve devam eden birbirine paralel iki eylemi anlatmak i\xe7in kullan\u0131l\u0131r. B\xf6ylesi durumlarda iki c\xfcmle de past continuos tense olur.\n\nPast Continuous Tense, While + Past Continuous Tense\nI was studying while he was sleeping.\nO uyuyorken ben ders \xe7al\u0131\u015f\u0131yordum.\n\n\u2b50 While ile kurulan yan c\xfcmledeki eylem, ana c\xfcmledeki eylemle ayn\u0131 anda ger\xe7ekle\u015febilir. Bu durumda her ikisi de simple past tense olur.\n\nSimple Past Tense, While + Simple Past Tense\nI sang while I took a shower.\nDu\u015f al\u0131rken \u015fark\u0131 s\xf6yledim.\n\nSimple Past Tense ile Past Continuous Tense Aras\u0131ndaki Fark Nedir?\n\u0130ngilizcede ge\xe7mi\u015f zaman anlat\u0131mlar\u0131nda kullan\u0131lan simple past tense ile past continuous tense aras\u0131ndaki farklar nelerdir diye soracak olursan\u0131z a\u015fa\u011f\u0131daki gibi \xf6zetleyebiliriz:\n\n\u2757 Simple past tense ile ge\xe7mi\u015fte belirli bir anda tamamlanm\u0131\u015f eylemler anlat\u0131l\u0131rken past continuous ile eylemlerin ger\xe7ekle\u015firkenki s\xfcreci vurgulan\u0131r.\n\u2757 Non-progressive fiiller T\xfcrk\xe7e \xe7evirilerinde past continuous tense kullan\u0131l\u0131yor gibi g\xf6z\xfckse de \u0130ngilizcede simple past tense ile kullan\u0131l\u0131r.\n\u2757 Ge\xe7mi\u015fte s\u0131k yap\u0131lan i\u015fler veya ge\xe7mi\u015fte kalm\u0131\u015f al\u0131\u015fkanl\u0131klar i\xe7in past continuous tense kullan\u0131l\u0131r.\n",null,B.u,null,null,null,null,null,null)
B.PY=new A.R("              \n\u0130ngilizcede Gelecek Zaman\nT\xfcrk\xe7ede b\xfcy\xfck \xfcnl\xfc uyumuna uyacak \u015fekilde fiillere getirilen -ecek, -acak ekleriyle sa\u011flanan anlam \u0130ngilizcede will ve be going to yap\u0131lar\u0131yla sa\u011flanmaktad\u0131r.\n\n\u0130ngilizcede Will Kullan\u0131m\u0131\nA\u015fa\u011f\u0131daki tabloda \u015fah\u0131s zamirlerine g\xf6re kullan\u0131mlar\u0131 derlenmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/you/we/they/he/she/it + will V1\nI/you/we/they/he/she/it + \u2018ll V1\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/you/we/they/he/she/it + will not V1\nI/you/we/they/he/she/it + won\u2019t V1\n\n\n\u27a1\ufe0f Soru c\xfcmleleri\nWill + I/you/we/they/he/she/it + V1?\nWon\u2019t + I/you/we/they/he/she/it + V1?\n\n\u2757 Will ile sorulmu\u015f bir soruya Evet-Hay\u0131r \u015feklinde k\u0131sa cevaplar verirken:\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\nYes, I/you/we/they/he/she/it + will\nYes, I/you/we/they/he/she/it + \u2018ll\n\n\u2757 Evet-Hay\u0131r sorular\u0131na k\u0131sa evet cevaplar\u0131 verilmez.\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\nNo, I/you/we/they/he/she/it + will not\nNo, I/you/we/they/he/she/it + won\u2019t\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a will,\n\ud83d\udd0a I\u2019ll,\n\ud83d\udd0a will not,\n\ud83d\udd0a won\u2019t\nWill Kullan\u0131m Durumlar\u0131\n\u2b50 Konu\u015fma esnas\u0131nda bahsi ge\xe7en eylemlerin ani karar, teklif veya s\xf6z verme \u015feklinde verildi\u011fi durumlarda kullan\u0131l\u0131r:\n\n\nI will have the pizza and fries combo, please.\nPizza ve patates k\u0131zartmas\u0131 alay\u0131m l\xfctfen.\nOk, I will help you.\nTamam sana yard\u0131m edece\u011fim.\nI\u2019m very hungry. I will make a sandwiches.\nBen \xe7ok a\xe7\u0131m. Sandvi\xe7 yapaca\u011f\u0131m.\n\n\u2b50 Varsay\u0131m, beklenti, umut veya ki\u015fisel bilgi veya tecr\xfcbeye dayal\u0131 tahminlerde kullan\u0131l\u0131r:\n\nYou should watch Interstellar. I\u2019m sure you\u2019ll love it.\nInterstellar\u2019\u0131 izlemelisin. Eminim seveceksin.\nI think Italy will win the 2020 Euro Cup.\n2020 Euro Cup\u2019\u0131 \u0130talya\u2019n\u0131n kazanaca\u011f\u0131n\u0131 d\xfc\u015f\xfcn\xfcyorum.\n\n\u2b50 Resmi ifadelerde programlanm\u0131\u015f eylemleri ifade etmede kullan\u0131l\u0131r:\n\nThe summit will start four days later.\nZirve d\xf6rt g\xfcn sonra ba\u015flayacak.\nHer engagement will take place at Dubai Miracle Garden in July.\nNi\u015fan\u0131 Temmuz ay\u0131nda Dubai Miracle Garden\u2019da ger\xe7ekle\u015fecek.\n\n\u0130ngilizcede be going to Kullan\u0131m\u0131\nA\u015fa\u011f\u0131daki tabloda benzer \u015fekilde \u015fah\u0131s zamirlerine g\xf6re kullan\u0131mlar\u0131 derlenmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI am going to + Ving\nI\u2019m going to + Ving\nHe/she/it is going to + Ving\nHe/she/it\u2019s going to + Ving\nWe/you/they are going to + Ving\nWe/you/they\u2019re going to + Ving\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI am not going to + Ving\nI\u2019m not going to + Ving\nHe/she/it is not going to + Ving\nHe/she/it\u2019s not going to + Ving\nHe/she/it isn\u2019t going to + Ving\nWe/you/they are not going to + Ving\nWe/you/they\u2019re not going to + Ving\nWe/you/they aren\u2019t going to + Ving\n\n\n\u27a1\ufe0f Soru c\xfcmleleri\nAm I going to + Ving?\nAren\u2019t I going to + Ving?\nIs he/she/it going to + Ving?\nIsn\u2019t he/she/it going to + Ving?\nAre we/you/they going to + Ving?\nAren\u2019t we/you/they going to + Ving?\n\n\u2757 be going to ile sorulmu\u015f bir soruya Evet-Hay\u0131r \u015feklinde k\u0131sa cevaplar verirken:\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\n\nYes, I am.\nYes, I\u2019m.\nYes, he/she/it is.\nYes, he/she/it\u2019s.\nYes, we/you/they are.\nYes, we/you/they\u2019re.\n\n\u2757 Evet-Hay\u0131r sorular\u0131na k\u0131salt\u0131lm\u0131\u015f evet cevaplar\u0131 verilmez.\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\n\nNo, I am not.\nNo, I\u2019m not.\nNo, he/she/it is not.\nNo, he/she/it isn\u2019t.\nNo, he/she/it\u2019s not.\nNo, we/you/they are not.\nNo, we/you/they aren\u2019t.\nNo, we/you/they\u2019re not.\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a I am going to,\n\ud83d\udd0a I\u2019m going to,\n\ud83d\udd0a I am not going to,\n\ud83d\udd0a I\u2019m not going to,\n\ud83d\udd0a he is going to,\n\ud83d\udd0a he\u2019s going to,\n\ud83d\udd0a he isn\u2019t going to,\n\ud83d\udd0a he\u2019s not going to,\n\ud83d\udd0a we are going to,\n\ud83d\udd0a we\u2019re going to,\n\ud83d\udd0a we are not going to,\n\ud83d\udd0a we aren\u2019t going to,\n\ud83d\udd0a we\u2019re not going to\nbe going to Kullan\u0131m Durumlar\u0131\n\u2b50 \xd6nceden planlanm\u0131\u015f veya niyetlenmi\u015f eylemlerde kullan\u0131l\u0131r:\n\n\nWe are going to buy a car.\nBir araba sat\u0131n alaca\u011f\u0131z.\nI am going to pay my debts tomorrow.\nYar\u0131n bor\xe7lar\u0131m\u0131 \xf6deyece\u011fim.\nI am going to start exercising regularly.\nD\xfczenli spor yapmaya ba\u015flayaca\u011f\u0131m.\n\n\xd6nemli bir notu payla\u015fmam\u0131z gerekmekte. Malumunuz \u0130ngilizcede \u015fimdiki zaman vas\u0131tas\u0131yla gelecekte planlanm\u0131\u015f eylemlerin gelecek anlat\u0131mlar\u0131 yap\u0131lmakta. Haliyle benzer bir anlat\u0131m\u0131n (hemen yukar\u0131daki \xf6rneklerde de g\xf6rece\u011finiz \xfczere) be going to kal\u0131b\u0131yla da anlat\u0131labilmesinden \xf6t\xfcr\xfc kafa kar\u0131\u015f\u0131kl\u0131\u011f\u0131 ya\u015fanmakta.\n\n\u2757 \u015eimdiki zaman anlat\u0131mlar\u0131yla yap\u0131lan gelecek anlat\u0131mlar\u0131 net bir tarih ve \xe7ok daha g\xfc\xe7l\xfc bir kesinlik verir. Alttaki \xf6rnekleri inceledi\u011finizde bu durumun fark\u0131n\u0131 net bir \u015fekilde g\xf6receksiniz.\n\nWe\u2019re getting married on April 11th.\n11 Nisan\u2019da evleniyoruz.\nWe\u2019re going to get married this year.\nBu y\u0131l evlenece\u011fiz.\n\n\u2b50 Gelecekle olacak bir eylem hakk\u0131nda yap\u0131lan tahminlerde kullan\u0131labilir. Bu tahminler ki\u015fisel tecr\xfcbeden ziyade kan\u0131tlara dayal\u0131 bir \u015fekilde yap\u0131l\u0131r. Bu kan\u0131tlardan kastedilen ise bahsi ge\xe7en eylemin ger\xe7ekle\u015fme ihtimalinin y\xfckselten verilere dayanarak yap\u0131lan tahminlerdir.\n\nLook at the sky. It\u2019s going to rain soon.\nG\xf6ky\xfcz\xfcne bak. Yak\u0131nda ya\u011fmur ya\u011facak.\nI am going to start exercising regularly.\nD\xfczenli spor yapmaya ba\u015flayaca\u011f\u0131m.\n\n\u2757 Genel olarak \u201cgo\u201d ve \u201ccome\u201d fiilleri going to kal\u0131b\u0131 ile pek kullan\u0131lmaz. Onun yerine bu fiiller \u015fimdiki zaman olarak kullan\u0131l\u0131r.\n\n\u2757 G\xfcndelik konu\u015fmalarda be going to kal\u0131b\u0131 gonna (going to = gonna) \u015feklinde k\u0131salt\u0131larak kullan\u0131lmaktad\u0131r.\n\nI am going to listen to music.\nI am gonna listen to music.\nBen m\xfczik dinleyece\u011fim.\n\n\u0130ngilizcede Gelecek Zaman ile Kullan\u0131lan Zaman Zarflar\u0131\nA\u015fa\u011f\u0131daki tabloda gelecek zaman ile yayg\u0131n bir \u015fekilde kullan\u0131lan zaman zarflar\u0131 derlenmi\u015ftir:\n\n\ntomorrow\tyar\u0131n\ntomorrow morning\tyar\u0131n sabah\ntomorrow afternoon\tyar\u0131n \xf6\u011flen\ntomorrow evening\tyar\u0131n ak\u015fam\ntomorrow night\tyar\u0131n gece\nthe day after tomorrow\t\xf6b\xfcr g\xfcn, yar\u0131ndan sonraki g\xfcn\nfrom now on\tbu g\xfcnden itibaren\nnext week\t\xf6n\xfcm\xfczdeki (gelecek) hafta\nnext weekend\t\xf6n\xfcm\xfczdeki haftasonu\nnext Monday\t\xf6n\xfcm\xfczdeki pazartesi\nnext month\t\xf6n\xfcm\xfczdeki ay\nnext July\t\xf6n\xfcm\xfczdeki temmuz\nnext spring\t\xf6n\xfcm\xfczdeki bahar\nnext year\t\xf6n\xfcm\xfczdeki y\u0131l\nin 2050\t2050\u2019de\nin the future\tileride, gelecekte\nin the near future\tyak\u0131n gelecekte\nsoon\tyak\u0131nda, yak\u0131n zamanda\nbefore long\t\xe7ok ge\xe7meden\nin a few days\tbirka\xe7 g\xfcn i\xe7inde\nFuture Tense ile Kullan\u0131lan Zaman Zarflar\u0131\n\u0130ngilizcede Gelecek Zaman \u0130fade Eden Yap\u0131lar\n\u0130ngilizce \xf6\u011frenirken fark edece\u011finiz \xfczere gelecek anlat\u0131mlar\u0131 yaln\u0131zca future tense kullan\u0131larak yap\u0131lmamaktad\u0131r. Ba\u015fka zamanlarla da yap\u0131labilen gelecek zamanlar\u0131n kullan\u0131m mant\u0131\u011f\u0131n\u0131 detayl\u0131ca anlatmaktan ziyade a\u015fa\u011f\u0131daki \xf6rneklerle aralar\u0131ndaki anlam vurgusuna odaklan\u0131lm\u0131\u015ft\u0131r.\n\nYak\u0131n Gelecek\tHe will leave tomorrow.\nYar\u0131n ayr\u0131lacak.\nKararl\u0131l\u0131k\tHe is going to leave tomorrow.\nYar\u0131n ayr\u0131lacak.\nPlanlanm\u0131\u015f i\u015f\tHe leaves tomorrow.\nYar\u0131n ayr\u0131lacak.\nPlanlanm\u0131\u015f i\u015f\tHe is leaving tomorrow.\nYar\u0131n ayr\u0131lacak.\nYap\u0131lmas\u0131 beklenilen i\u015f\tHe is to leave tomorrow.\nYar\u0131n ayr\u0131lacak.\nYak\u0131nda yap\u0131lacak i\u015f\tHe is about to leave.\nAyr\u0131lmak \xfczere.\nYak\u0131nda yap\u0131lacak i\u015f\tHe is on the point of leaving.\nAyr\u0131lmak \xfczere.\nWill \u2013 Be Going to Farklar\u0131\n\u0130ngilizcede will ve be going to aras\u0131ndaki farklar a\u015fa\u011f\u0131daki tabloda \xf6zetlenmi\u015ftir:\n\n\u27a1\ufe0f will\n\u2b50 Ki\u015fisel g\xf6r\xfc\u015f veya tecr\xfcbeye dair tahminlerde\n\u2b50 Olay an\u0131nda verilen ani kararlarda \n\u2b50 Yard\u0131m ve rica tekliflerinde\n\u2b50 S\xf6z verme, yemin etmelerde\n\n\u27a1\ufe0f be going to\n\u2b50 Delile dayal\u0131 tahmin y\xfcr\xfctmelerinde\n\u2b50 Planlanarak karar verilmi\u015f eylemlerde\n\u2b50 Bir \u015fey olmak \xfczereyse\n",null,B.u,null,null,null,null,null,null)
B.PZ=new A.R("            \nHer Cumartesi Daniel ve ailesi plaja giderlermi\u015f. Onlar plajdan uzakta ya\u015f\u0131yorlarm\u0131\u015f , fakat haftada bir b\xfct\xfcn aile arabaya atlar plaja varana kadar Daniel in babas\u0131 arabay\u0131 s\xfcrermi\u015f.\n\nDaniel\u2019\u0131n annesi ve babas\u0131 plaj\u0131 \xe7ok seviyorlarm\u0131\u015f. Daniel, k\u0131z ve erkek karde\u015fi de plaj\u0131 severmi\u015f. Ailenin k\xf6pe\u011fi de plaj\u0131 \xe7ok seviyormu\u015f. Fakat plaja her hafta gitmek sorunmu\u015f. Daniel\u2019\u0131n babas\u0131 saatlerce araba kullanmaktan yoruluyormu\u015f.\n\nAilenin geri kalan\u0131 o kadar saat arabada oturmaktan yoruluyormu\u015f. Daniel\u2019\u0131n annesi demi\u015f ki \u201cPlaja gitmek zevkli, fakat oraya gitmek ve oradan d\xf6nmek \xe7ok zaman\u0131m\u0131z\u0131 al\u0131yor.\u201d Daniel, k\u0131z karde\u015fi ve erkek karde\u015fi bu duruma \xe7ok \xfcz\xfcl\xfcrler. Onlar plaja gitmek istiyorlar fakat bu da sorun oluyormu\u015f. Onlar y\xfczme havuzuna da gitmeyi denemi\u015fler, fakat ikisi ayn\u0131 \u015fey de\u011filmi\u015f.\n\nBir g\xfcn Daniel\u2019\u0131n anne ve babas\u0131 \xe7ocuklarla konu\u015fmaya gelmi\u015fler. Ve demi\u015fler ki:\u201d Bizim her hafta plaja gitmek gibi bir problemimiz var, fakat biz plaj\u0131 seviyoruz ve siz de seviyorsunuz ve de k\xf6pek de seviyor. Bu y\xfczden bir \xe7\xf6z\xfcm\xfcz var.\n\nPlaj\u0131n yak\u0131nlar\u0131nda ya\u015famam\u0131z gerekiyor.\u201d Daniel, k\u0131z ve erkek karde\u015fleriyle beraber \xe7ok mutlu olmu\u015flar! Art\u0131k plaj\u0131n yak\u0131n\u0131nda ya\u015f\u0131yorlarm\u0131\u015f. Her g\xfcn plaja gidiyorlarm\u0131\u015f!\n            ",null,B.u,null,null,null,null,null,null)
B.Q_=new A.R("              \n\u0130ngilizcede future perfect continuous tense, T\xfcrk\xe7ede ilgili ki\u015fi zamirine ba\u011fl\u0131 olarak  \u201c\u2026den beri yap\u0131yor olaca\u011f\u0131m\u201d \u015feklinde \xe7evrilebilen bu tens ile bir eylemin s\xfcresi \xf6n plandad\u0131r. Bu anlat\u0131m\u0131ndan dolay\u0131 da T\xfcrk\xe7ede s\xfcregelen gelecek \xf6ncesi zaman olarak adland\u0131r\u0131lmaktad\u0131r.\n\nwill + have + been + Ving \u015feklinde kullan\u0131lan bu kipin olumlu, olumsuz ve soru c\xfcmleleri a\u015fa\u011f\u0131daki tablolarda ilgili \u015fah\u0131s zamirlerine g\xf6re \xe7ekimlenmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/you/we/they/he/she/it + will have been Ving\nI/you/we/they/he/she/it + \u2018ll have been Ving\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/you/we/they/he/she/it + will not have been Ving\nI/you/we/they/he/she/it + won\u2019t have been Ving\n\n\n\u27a1\ufe0f Soru c\xfcmleleri\nWill + I/you/we/they/he/she/it + have been Ving?\nWon\u2019t + I/you/we/they/he/she/it + have been Ving?\n\n\xd6rnek telaffuzlar:\n\n\ud83d\udd0a will have been,\n\ud83d\udd0a I\u2019ll have been,\n\ud83d\udd0a will not have been,\n\ud83d\udd0a won\u2019t have been\nFuture perfect continuus tense gelecekte belli bir andan \xf6nce tamamlanacak i\u015fin s\xfcreklili\u011fini vurgular. Future perfect tense ile bunun d\u0131\u015f\u0131nda anlam farkl\u0131l\u0131\u011f\u0131 g\xf6stermez.\n\nIn September, I will have been working at my company for two years.\nEyl\xfcl ay\u0131nda \u015firketimde iki y\u0131ld\u0131r \xe7al\u0131\u015f\u0131yor olaca\u011f\u0131m.\n\nAt six o\u2019clock, I will have been waiting for my wife for thirty minutes.\nSaat alt\u0131da, otuz dakikad\u0131r kar\u0131m\u0131 bekliyor olaca\u011f\u0131m.\n\nWhen Sergio Ramos turn thirty, he will have been playing for Real Madrid for eleven years.\nSergio Ramos otuz ya\u015f\u0131na geldi\u011finde on bir y\u0131ld\u0131r Real Madrid i\xe7in oynuyor olacak.\n\nWon\u2019t Alice have been working in ABD for 5 years by this time next year?\nAlice gelecek y\u0131l bu zamanlar ABD\u2019de 5 y\u0131ld\u0131r \xe7al\u0131\u015f\u0131yor olmayacak m\u0131?\n\nWill John and Tom have been playing basketboll since morning?\nJohn ve Tom sabahtan beridir mi basketbol oynuyorlar?\n\nAnna will have been studying English for two years by the end of this course.\nAnna bu kursun sonunda iki y\u0131ld\u0131r \u0130ngilizce \xf6\u011frenim g\xf6r\xfcyor olacak.\n\nWe will have been living there for two years by the end of this year.\nBu y\u0131l\u0131n sonuna kadar iki y\u0131ld\u0131r orada ya\u015f\u0131yor olaca\u011f\u0131z.\n\n\u2757 \u0130ngilizcede stative verbs ad\u0131 verilen durum fiilleri -ing eki almad\u0131\u011f\u0131 i\xe7in fiilin \xfc\xe7\xfcnc\xfc hali kullan\u0131l\u0131r ve been kald\u0131r\u0131l\u0131r. Bu durumda mevcut yap\u0131 will + have + V3 \u015fekline d\xf6n\xfc\u015f\xfcr.\n\n\u2757 \u0130ngilizcede gelecek zaman kipleri \u201cwhen\u201c, \u201cwhile\u201c, \u201cbefore\u201d gibi zaman bildiren kelimelerden sonra kullan\u0131lmaz. \n\nMy friend will have read six books by January.\nArkada\u015f\u0131m Ocak ay\u0131na kadar alt\u0131 kitap okumu\u015f olacak.\nOn Friday, we will have known each other for a year.\nCuma g\xfcn\xfc birbirimizi bir y\u0131ld\u0131r tan\u0131yor olaca\u011f\u0131z.\n\n\nFuture Continuous ile Future Perfect Continuous Aras\u0131ndaki Farklar Nelerdir?\nGelecek anlat\u0131m\u0131n\u0131n yap\u0131ld\u0131\u011f\u0131 bu iki tense birbirleriyle s\u0131kl\u0131kla kar\u0131\u015ft\u0131r\u0131lmaktad\u0131r. Future continuous ile gelecekteki bir anda yap\u0131l\u0131yor olacak olan eylem anlat\u0131l\u0131rken, future perfect continuous ile yap\u0131lan eylemin gelecekteki o ana kadar ne kadar bir s\xfcreyle yap\u0131ld\u0131\u011f\u0131n\u0131 vurgular.\n\nAyr\u0131ca future perfect continuous ile bahsi ge\xe7en eylem ge\xe7mi\u015fte, g\xfcn\xfcm\xfczde veya gelecekte ba\u015flam\u0131\u015f olacak olup ve yine gelecekteki bir ana kadar (gelecekteki o noktadan sonras\u0131 da olacak \u015fekilde) s\xfcre\xe7 bildirerek devam etmesini anlat\u0131r. Buna kar\u015f\u0131l\u0131k future continuous ile eylem gelecekte ba\u015flay\u0131p gelecekte bitece\u011fi kesin bir kesilme an vard\u0131r.\n\n",null,B.u,null,null,null,null,null,null)
