B.Q1=new A.R("Kar\u015f\u0131la\u015ft\u0131rmak anlam\u0131na gelen compare fiilinden t\xfcretilen comperative konusu ile birden fazla \u015fey k\u0131yaslan\u0131rken kullan\u0131l\u0131r.\n\nBu yap\u0131da s\u0131fatlar ve zarflar, sahip olduklar\u0131 hece say\u0131lar\u0131na g\xf6re T\xfcrk\xe7ede daha anlam\u0131na gelen \u201c-er\u201d son eki ya da kelimenin \xf6ncesine gelen ve yine T\xfcrk\xe7ede daha anlam\u0131na gelen \u201cmore\u201d kelimesi kullan\u0131l\u0131r. \n\nBu yap\u0131daki s\u0131fatlara kar\u015f\u0131la\u015ft\u0131rma s\u0131fatlar\u0131 anlam\u0131na gelen comparative adjectives denilirken zarflara ise kar\u015f\u0131la\u015ft\u0131rma zarflar\u0131 anlam\u0131na gelen comparative adverbs denilmektedir.\n\n          \u0130ngilizcede Kar\u015f\u0131la\u015ft\u0131rma S\u0131fatlar\u0131\n          \nComperative adjectives olarak adland\u0131r\u0131lan kar\u015f\u0131la\u015ft\u0131rma s\u0131fatlar\u0131 a\u015fa\u011f\u0131daki \u015fekilde yap\u0131l\u0131r:\n\n\u2757 Tek heceli s\u0131fatlar -er eki getirilerek \xfcst\xfcnl\xfck anlam\u0131 kazand\u0131r\u0131l\u0131r. E\u011fer s\u0131fat\u0131n son harfi -e ile bitiyorsa -er eki yerine -r eki getirilir.\n\npoor\nfakir\t\n\npoorer\ndaha fakir\n\nyoung\ngen\xe7\t\n\nyounger\ndaha gen\xe7\n\nsafe\ng\xfcvenli\t\n\nsafer\ndaha g\xfcvenli\n\n\u2757 Son iki harfi sesli harf + sessiz harf \u015feklinde biten tek heceli s\u0131fatlar -er ekini al\u0131p comperative yap\u0131ya b\xfcr\xfcn\xfcrken sondaki sessiz harfini tekrarlar\n\nhot\ns\u0131cak\t\n\nhotter\ndaha s\u0131cak\n\nbig\nb\xfcy\xfck\t\n\nbigger\ndaha b\xfcy\xfck\n\nred\nk\u0131rm\u0131z\u0131\t\n\nredder\ndaha k\u0131rm\u0131z\u0131\n\n\u2757 Son harfi \u201c-y\u201d ile biten iki heceli s\u0131fatlarda \u201c-y\u201d harfi d\xfc\u015fer -er eki \u201c-ier\u201d \u015feklinde getirilerek comperative yap\u0131l\u0131r.\n\neasy\nkolay\t\n\neasier\ndaha kolay\n\ndusty\ntozlu\t\n\ndustier\ndaha tozlu\n\ndirty\nkirli\t\n\ndirtier\ndaha kirli\n\n\u2757 \u0130ki ve daha fazla heceli s\u0131fatlarla kar\u015f\u0131la\u015ft\u0131rma yapabilmek i\xe7in ilgili s\u0131fat\u0131n \xf6n\xfcne \u201cmore\u201d kelimesi getirilerek \u201cdaha\u201d anlam\u0131 kazand\u0131r\u0131l\u0131r.\n\nimportant\n\xf6nemli\t\n\nmore important\ndaha \xf6nemli\n\nhandsome\nyak\u0131\u015f\u0131kl\u0131\t\n\nmore handsome\ndaha yak\u0131\u015f\u0131kl\u0131\n\npowerful\ng\xfc\xe7l\xfc\t\n\nmore powerful\ndaha g\xfc\xe7l\xfc\n\n\u2757 Baz\u0131 s\u0131fatlar d\xfczensiz olduklar\u0131 i\xe7in genel kurala uymayacak \u015fekilde \xe7ekimlenirler. A\u015fa\u011f\u0131daki listede yayg\u0131n bir \u015fekilde kullan\u0131lan s\u0131fatlar derlenmi\u015ftir;\n\ngood\niyi\t\n\nbetter\ndaha iyi\n\nwell\niyi\t\n\nbetter\ndaha iyi\n\nbad\nk\xf6t\xfc\t\n\nworse\ndaha k\xf6t\xfc\n\nlittle\naz\t\n\nless\ndaha az\n\nmany\n\xe7ok\t\n\nmore\ndaha \xe7ok\n\nmuch\n\xe7ok\t\n\nmore\ndaha \xe7ok\n\nfar\nuzak\t\n\nfarther\ndaha uzak\n\nfar\nuzak\t\n\nfurther\ndaha uzak\n\nComperative adverbs olarak adland\u0131r\u0131lan kar\u015f\u0131la\u015ft\u0131rma zarflar\u0131 da a\u015fa\u011f\u0131dakiler gibi yap\u0131l\u0131r:\n\n\u2757 S\u0131fatlara benzer \u015fekilde zarflarla da k\u0131yaslama yap\u0131l\u0131r. \xd6zellikle sonu -ly ile biten zarflar haliyle \xe7ok heceli oldu\u011fu i\xe7in more kelimesi getirilerek k\u0131yaslama anlat\u0131m\u0131 sa\u011flan\u0131r.\n\nstrongly\ng\xfc\xe7l\xfc bir \u015fekilde\t\n\nmore strongly\ndaha g\xfc\xe7l\xfc bir \u015fekilde\n\nnicely\nho\u015f bir \u015fekilde\t\n\nmore nicely\ndaha ho\u015f bir \u015fekilde\n\n          \u0130ngilizce Kar\u015f\u0131la\u015ft\u0131rma C\xfcmleleri\n\nKar\u015f\u0131la\u015ft\u0131rma ifadelerinde -den/-dan anlam\u0131na gelen than kelimesi kullan\u0131l\u0131r. A\u015fa\u011f\u0131daki tabloda comperatives yani \u0130ngilizce kar\u015f\u0131la\u015ft\u0131rma c\xfcmleleri telaffuzlar\u0131yla beraber listelenmi\u015ftir;\n\nAnna is taller than Merry.\n\nAnna, Merry\u2019den daha uzundur.\n\nJohn\u2019s car is stronger than mine.\n\nJohn\u2019un arabas\u0131 benimkinden daha g\xfc\xe7l\xfc.\n\nBrad Pitt is obviously more handsome than me.\n\nBrad Pitt tabii ki benden daha yak\u0131\u015f\u0131kl\u0131d\u0131r.\n\nA Mac is always more efficient than a PC.\n\nBir Mac her zaman bir PC\u2019den daha verimlidir.\n\nWork is less boring than amusing oneself.\n\n\xc7al\u0131\u015fmak, kendini e\u011flendirmekten daha az s\u0131k\u0131c\u0131d\u0131r.\n",null,B.u,null,null,null,null,null,null)
B.Q2=new A.R("              \n\u0130ngilizcede tercih ifadeleri genel olarak would like to, would love to, would prefer to, would rather gibi yap\u0131larla sa\u011flan\u0131r.\n\nWould yap\u0131s\u0131n\u0131n pek \xe7ok kullan\u0131m\u0131 olsa da en bilindik olanlar\u0131 tercih ifadelerinde ve istek ifadelerini kibarla\u015ft\u0131rmak i\xe7in olanlard\u0131r.\n\n\xd6rne\u011fin; \u201cI want something to drink. (\u0130\xe7ecek bir \u015feyler istiyorum.)\u201d ifadesi gayriresmi durumlarda kullanmaya uygunken bu c\xfcmleyi kibarla\u015ft\u0131rmak i\xe7in \u201cI\u2019d like something to drink. (\u0130\xe7ecek bir \u015feyler istiyorum.)\u201d\u015feklinde kullanabiliriz.\n\n\u201cWould\u201d kelimesi beraberinde hangi zamir kullan\u0131l\u0131rsa kullan\u0131ls\u0131n de\u011fi\u015fmez. Birisine kibarca bir \u015feyler sormak i\xe7in kullan\u0131l\u0131r.\n\n\u2757 \u201cWould you like\u2026?\u201d veya \u201cwould like\u2026\u201d ifadesinden sonra gelen fiilden \xf6nce \u201cto\u201d kullan\u0131lmas\u0131 gerekti\u011fi unutulmamal\u0131d\u0131r. .\n\nWould you like\u2026?\n\n\u2026 ister misin?\n\nWould you like to go fishing at the weekend?\n\nHafta sonu bal\u0131\u011fa gitmek ister misiniz?\n\n\u201cWould you like\u2026?\u201d sorusu alternatif cevaplara da sahiptir. Bu cevaplar a\u015fa\u011f\u0131daki tabloda derlenmi\u015ftir;\n\nI\u2019d like to\u2026\n\n\u2026 isterim.\n\nI\u2019d love to\u2026\n\n\u2026 \xe7ok isterim.\n\nI\u2019d rather\u2026\n\n\u2026 tercih ederim.\n\nI\u2019d prefer to\u2026\n\n\u2026 tercih ederim.\n\n\u2757 Yukar\u0131daki ifadelerde g\xf6sterilen yap\u0131larda dikkat edilmesi gereken bir durum var. \u201cRather\u201d kelimesinden sonra fiilin yal\u0131n hali (V1) gelirken prefer\u2019den sonra fiilin yal\u0131n halinden \xf6nce \u201cto\u201d gelir. E\u011fer c\xfcmle olumsuz yap\u0131lacaksa \u201cnot\u201d olumsuzluk eki \u201crather\u201d ve \u201cprefer\u201d s\xf6zc\xfcklerinden sonra gelir.\n\nI would rather drink coffee.\n\nKahve i\xe7meyi tercih ederim.\n\nI would rather not drink coffee.\n\nKahve i\xe7memeyi tercih ederim.\n\nI would prefer to read a book.\n\nKitap okumay\u0131 tercih ederim.\n\nI would prefer not to read a book.\n\nKitap okumamay\u0131 tercih ederim.\n\n",null,B.u,null,null,null,null,null,null)
B.Q3=new A.R("              \n\u0130ngilizcede \u201cke\u015fke\u201d anlam\u0131n\u0131 vermek i\xe7in \u201cif only\u201d ve \u201cwish\u201d kal\u0131plar\u0131 kullan\u0131l\u0131r. \u201cIf only\u201d kal\u0131b\u0131n\u0131n verdi\u011fi anlam daha g\xfc\xe7l\xfc oldu\u011fu i\xe7in genellikle g\xfcnl\xfck hayatta \u201cwish\u201d kal\u0131plar\u0131ndan yararlan\u0131l\u0131r. \u201cIf only\u201d kal\u0131b\u0131n\u0131n de\u011fi\u015fik zaman kipleriyle kullan\u0131m\u0131n\u0131 a\u015fa\u011f\u0131daki \xf6rneklerle inceleyelim.\n\nPast Tense + If Only\nC\xfcmlenin gramatik yap\u0131s\u0131 ge\xe7mi\u015f zamana ait olsa da past tense ve if only kal\u0131plar\u0131 bir araya geldi\u011finde ge\xe7mi\u015fteki bir olaydan bahsetmez, \u015fimdiki zamanda ger\xe7ekle\u015fen bir pi\u015fmanl\u0131k durumundan bahseder. \xd6rne\u011fin:\n\nIf only that bag wasn\u2019t this expensive, I would buy it.\n(Ke\u015fke o \xe7anta bu kadar pahal\u0131 olmasayd\u0131, al\u0131rd\u0131m.)\n\nIf only I slept earlier yesterday, I wouldn\u2019t be tired right now.\n(Ke\u015fke d\xfcn daha erken yatsayd\u0131m, \u015fu anda yorgun olmazd\u0131m.)\n\nIf only you knew the truth.\n(Ke\u015fke ger\xe7e\u011fi bilseydin.)\n\nPast Perfect Tense + If Only\nIf only kal\u0131b\u0131 Past Perfect Tense ile kullan\u0131ld\u0131\u011f\u0131nda ge\xe7mi\u015fte ya\u015fanan olaylara kar\u015f\u0131 duyulan pi\u015fmanl\u0131klar\u0131 anlatmak i\xe7in kullan\u0131l\u0131r. \xd6rne\u011fin:\n\nIf only you had been more careful, the vase wouldn\u2019t break.\n(Ke\u015fke daha dikkatli olsayd\u0131n, vazo k\u0131r\u0131lmazd\u0131.)\n\nIf only we had been there, we would help you.\n(Ke\u015fke biz de orada olsayd\u0131k, sana yard\u0131m ederdik.)\n\nIf only she hadn\u2019t watched that film, we could watch it together.\n(Ke\u015fke o filmi izlemeseydi, beraber izleyebilirdik.)\n\n\u0130ngilizce Wish (Ke\u015fke) C\xfcmle Kal\u0131b\u0131\n\n\u0130ngilizcede wish kal\u0131b\u0131n\u0131 c\xfcmle i\xe7inde kullanmak i\xe7in ge\xe7mi\u015f zaman kiplerinden yararlan\u0131l\u0131r. \u015eimdiki zaman ve wish clause bir araya geldi\u011finde \u015fimdiki zaman c\xfcmlenin yap\u0131s\u0131nda de\u011fil verilmek istenen anlamdad\u0131r. Daha iyi anlamak i\xe7in a\u015fa\u011f\u0131daki \xf6rnekleri inceleyelim.\n\nWish \u0130le \u0130lgili C\xfcmleler\n\nI wish it wasn\u2019t raining.\n(Ke\u015fke ya\u011fmur ya\u011fm\u0131yor olsayd\u0131.)\n\nI wish I didn\u2019t take this class.\n(Ke\u015fke bu dersi almasayd\u0131m.)\n\nI wish I was more beautiful.\n(Ke\u015fke daha g\xfczel olsayd\u0131m.)\n\nI wish he was with his family.\n(Ke\u015fke ailesiyle birlikte olsayd\u0131.)\n\nI wish I could help you.\n(Ke\u015fke sana yard\u0131m edebilseydim.)\n\nI wish I had more friends.\n(Ke\u015fke daha fazla arkada\u015f\u0131m olsayd\u0131.)\n\nI wish I didn\u2019t tell you this.\n(Ke\u015fke bunu sana s\xf6ylemeseydim.)\n\nI wish you were more considerate.\n(Ke\u015fke daha anlay\u0131\u015fl\u0131 olsayd\u0131n.)\n\nI wish I was in \u0130stanbul right now.\n(Ke\u015fke \u015fu anda \u0130stanbul\u2019da olsayd\u0131m.)\n\nI wish we lived in Paris.\n(Ke\u015fke Paris\u2019te ya\u015f\u0131yor olsayd\u0131k.)\n\nYetenekle \u0130lgili Kullan\u0131lan Wish Clause C\xfcmleleri\n\n\u0130ngilizcede yetenek belirten, yapabilmeyi belirten ya da c\xfcmlenin \u201c-ebilmek\u201d halinin kullan\u0131ld\u0131\u011f\u0131 c\xfcmleler wish clause kullanarak olu\u015fturulur. A\u015fa\u011f\u0131daki \xf6rnekleri inceleyelim.\n\nI wish I could run faster.\n(Ke\u015fke daha h\u0131zl\u0131 ko\u015fabilsem.)\n\nI wish you could sing.\n(Ke\u015fke \u015fark\u0131 s\xf6yleyebilsen.)\n\nI wish I could be there with you.\n(Ke\u015fke orada seninle birlikte olabilsem.)\n\nI wish they could find my lost phone.\n(Ke\u015fke kay\u0131p telefonumu bulabilseler.)\n\nI wish we could stay here for another week.\n(Ke\u015fke burada bir hafta daha kalabisek.)\n\n\u015eimdiki Zamanla \u0130lgili Wish Clause (Dilek) C\xfcmleleri\n\n\u015eimdiki zaman ve wish clause bir arada kullan\u0131ld\u0131\u011f\u0131nda c\xfcmlenin \u015fimdiki zaman hali yap\u0131s\u0131nda de\u011fil, kast edilen anlam\u0131nda bulunur. \u015eu anda ya\u015fan\u0131lan durumdan veya gelecekte ger\xe7ekle\u015fmesi dilenen bir durumdan bahsediliyorsa \u015fimdiki zaman ve wish clause anlamsal olarak birlikte kullan\u0131l\u0131r. Daha iyi anla\u015f\u0131lmas\u0131 i\xe7in a\u015fa\u011f\u0131daki \xf6rnekleri inceleyelim.\n\nI wish I was at home right now.\n(Ke\u015fke \u015fu an evde olsayd\u0131m.)\n\nI wish you were here.\n(Ke\u015fke \u015fu an burada olsayd\u0131n.)\n\nI wish we weren\u2019t fighting.\n(Ke\u015fke \u015fu anda kavga etmiyor olsak.)\n\nI wish you weren\u2019t leaving today.\n(Ke\u015fke bug\xfcn gitmiyor olsan.)\n\nGelecekle \u0130lgili Wish C\xfcmleleri\n\nGelecekle ilgili wish clause c\xfcmleleri gelecekte de\u011fi\u015febilecek, de\u011fi\u015fmesi istenilen durumlar i\xe7in kullan\u0131l\u0131r. Genellikle bu c\xfcmleler \u201cwish + would\u201d kal\u0131b\u0131 ile kurulur. Bu kal\u0131b\u0131 bilmek dileklerinizi ve isteklerinizi daha rahat ifade edebilmenize yard\u0131mc\u0131 olacakt\u0131r. \xd6rne\u011fin:\n\nI wish you would get well soon.\n(Yak\u0131nda iyile\u015fmeni dilerim.)\n\nI wish he wouldn\u2019t be this rude.\n(Bu kadar kaba olmamas\u0131n\u0131 dilerdim.)\n\nI wish she would be more respectful.\n(Onun daha sayg\u0131l\u0131 olmas\u0131n\u0131 dilerdim.)\n\nI wish they would come here.\n(Buraya gelmelerini dilerdim.)\n\nI wish it wouldn\u2019t hurt this much.\n(Bu kadar can ac\u0131tmamas\u0131n\u0131 dileredim.)\n\nWish Clause Gramer Form\xfcl\xfc Nedir?\n\nWish clause c\xfcmle i\xe7inde kullan\u0131lan zamire ve c\xfcmlede verilmek istenilen anlama g\xf6re form\xfcl\xfcnde de\u011fi\u015fiklik g\xf6steren bir konudur. \xc7e\u015fitli durumlarda ve \xe7e\u015fitli zamirlerde wish clause yap\u0131s\u0131n\u0131n nas\u0131l de\u011fi\u015fti\u011fini ve nas\u0131l kullan\u0131laca\u011f\u0131n\u0131 yukar\u0131da bulabilirsiniz. \xd6zet olarak wish clause kal\u0131b\u0131n\u0131n gramatik yap\u0131s\u0131 a\u015fa\u011f\u0131daki gibidir:\n\nwish + past simple\nwish + past continuous\nwish + past perfect\nwish + would + bare infinitive\nwish + infinitive or wish + object + infinitive\n\n",null,B.u,null,null,null,null,null,null)
