B.Q9=new A.R("              \nPresent perfect continuous tense\u2019in anlatt\u0131\u011f\u0131 zaman T\xfcrk\xe7eye \u201cge\xe7mi\u015f ve \u015fimdiki zamanda devaml\u0131l\u0131k\u201d \u015feklinde \xe7evrilmektedir.\n\nAyr\u0131ca present perfect tense ile benzerliklerinden \xf6t\xfcr\xfc yeni \xf6\u011frenenler i\xe7in olduk\xe7a kafa kar\u0131\u015ft\u0131r\u0131c\u0131 bir konu olabilmektedir.\n\nHave/has + been + Ving \u015feklinde kullan\u0131lan present perfect continuous tense\u2019in olumlu ve olumsuz c\xfcmleleri a\u015fa\u011f\u0131daki tablolarda ilgili \u015fah\u0131s zamirlerine g\xf6re \xe7ekimlenmi\u015ftir:\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nI/you/we/they + have been Ving\nI/you/we/they + \u2018ve been Ving\nHe/she/it + has been Ving\nHe/she/it + \u2018s been Ving\n\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nI/you/we/they + have not been Ving\nI/you/we/they + haven\u2019t been Ving\nHe/she/it + has not been Ving\nHe/she/it + hasn\u2019t been Ving\n\n\u27a1\ufe0f Soru c\xfcmleleri\nHave + I/you/we/they + been Ving?\nHaven\u2019t + I/you/we/they + been Ving?\nHas + he/she/it + been Ving?\nHasn\u2019t + he/she/it + been Ving?\n\n\u2757 Present perfect continuous tense ile sorulmu\u015f bir soruya Evet-Hay\u0131r \u015feklinde k\u0131sa cevaplar verirken:\n\n\u27a1\ufe0f Olumlu k\u0131sa cevaplar\nYes, I/you/we/they have.\nYes, I/you/we/they \u2018ve.\nYes, He/she/it + has.\nYes, He/she/it + \u2018s.\n\n\u2757 Evet-Hay\u0131r sorular\u0131nda k\u0131sa evet cevaplar\u0131 k\u0131saltmal\u0131 verilmez.\n\n\u27a1\ufe0f Olumsuz k\u0131sa cevaplar\nNo, I/you/we/they have.\nNo, I/you/we/they haven\u2019t.\nNo, he/she/it has not.\nNo, he/she/it hasn\u2019t.\n\nG\xfcndelik ya\u015famda s\u0131kl\u0131kla kar\u015f\u0131la\u015f\u0131labilecek olan yukar\u0131daki formlar\u0131n a\u015fa\u011f\u0131da telaffuzlar\u0131 verilmi\u015ftir. Bu telaffuzlar\u0131 \xf6\u011frenmek hem konu\u015fma hem dinleme becerileri i\xe7in olduk\xe7a faydal\u0131 olacakt\u0131r.\n\n\n\ud83d\udd0a have been,\n\ud83d\udd0a I\u2019ve been,\n\ud83d\udd0a have not been,\n\ud83d\udd0a haven\u2019t been,\n\ud83d\udd0a has been,\n\ud83d\udd0a He\u2019s been,\n\ud83d\udd0a has not been,\n\ud83d\udd0a hasn\u2019t been\nPresent Perfect Continuous Tense Kullan\u0131m\u0131\n\u2b50 Ge\xe7mi\u015fte ba\u015flam\u0131\u015f ve hala devam eden eylemleri anlat\u0131rken:\n\n-I haven\u2019t been working since morning.\nSabahtan beri \xe7al\u0131\u015fm\u0131yorum/\xe7al\u0131\u015fmaktay\u0131m.\n-We\u2019ve been walking for 3 hours.\n3 saattir y\xfcr\xfcyoruz/y\xfcr\xfcmekteyiz.\n-We have been staying at home for days due to pandemic measures.\nPandemi \xf6nlemleri nedeniyle g\xfcnlerdir evdeyiz.\n-Anna has been sleeping since morning.\nAnna sabahtan beri uyuyor/uyumakta.\n-I have been taking medicine for my cold since Thursday.\nPer\u015fembe g\xfcn\xfcnden beri so\u011fuk alg\u0131nl\u0131\u011f\u0131m i\xe7in ila\xe7 kullan\u0131yorum/kullanmaktay\u0131m.\n\n\u2b50 Bahsi ge\xe7en eylemin sonu\xe7lar\u0131na bak\u0131l\u0131p ne kadar zamand\u0131r yap\u0131ld\u0131\u011f\u0131n\u0131 vurgulamak i\xe7in kullan\u0131l\u0131r:\n\n-I\u2019ve been battling covid for a week. I finally recovered.\nBir haftad\u0131r covid ile m\xfccadele ediyorum/etmekteyim. Sonunda iyile\u015ftim.\n-I am exhausted because I have been walking too fast.\n\xc7ok h\u0131zl\u0131 y\xfcr\xfcd\xfc\u011f\xfcm i\xe7in yoruldum.\n-We\u2019ve been working on it for two months. It\u2019s finally over.\n\u0130ki ayd\u0131r \xfczerinde \xe7al\u0131\u015f\u0131yoruz/\xe7al\u0131\u015fmaktay\u0131z. Nihayet bitti.\n\n\u2b50 Kimi eylemlerle yar\u0131m kalm\u0131\u015f i\u015fleri anlat\u0131r:\n\n-I am exhausted because I have been walking too fast.\n\xc7ok h\u0131zl\u0131 y\xfcr\xfcd\xfc\u011f\xfcm i\xe7in yoruldum.\n-I\u2019ve been battling covid for a week. I finally recovered.\nBir haftad\u0131r covid ile m\xfccadele ediyorum. Sonunda iyile\u015ftim.\n-He has been working on this book for years.\nY\u0131llard\u0131r bu kitap \xfczerinde \xe7al\u0131\u015f\u0131yor/\xe7al\u0131\u015fmakta.\n\n\u2b50 this week, this month, this year, today, all day, recently gibi zaman dilimleri ile kullan\u0131labilir.\n\n-He\u2019s been studying hard this week.\nBu hafta \xe7ok \xe7al\u0131\u015f\u0131yor.\n-We\u2019ve been going to the gym recently.\nGe\xe7enlerde spor salonuna gidiyorduk/gitmekteydik.\n\nPresent Perfect Continuous Tense \u0130le Kullan\u0131lan Zaman Zarflar\u0131\nA\u015fa\u011f\u0131daki tabloda ise yayg\u0131n bir \u015fekilde kullan\u0131lan zaman zarflar\u0131 derlenmi\u015ftir.\n\n\ud83d\udd0a for\t-d\u0131r/-dir\n\ud83d\udd0a since\t-den/-dan beri\n\ud83d\udd0a all morning\tt\xfcm sabah boyunca\n\ud83d\udd0a all week\tt\xfcm hafta boyunca\n\ud83d\udd0a recently\tson zamanlarda\n\u2757 Never, ever, sometimes, once, twice, three times, always, rarely, yet, just gibi zaman zarflar\u0131 present perfect continuous ile kullan\u0131lmazlar.\n\n\u2757 \u0130ngilizcede own, arrive, know gibi -ing almayan fiillerle present perct continuous yap\u0131lamaz. Bu fiiller ile olan c\xfcmlelerde present perfect tense kullan\u0131l\u0131r.\n\nThey have known each other since 2000.\nThey have been knowing each other since 2000.\n2000 y\u0131l\u0131ndan beri birbirlerini tan\u0131yorlar.\n\n",null,B.u,null,null,null,null,null,null)
B.Qa=new A.R("              \n\u0130ngilizcede S-V-O kural\u0131 olarak ge\xe7en \xd6zne+Y\xfcklem+Nesne kural\u0131; yani \u0130ngilizcede fiilin \xf6zneden hemen sonra gelmesi durumu Past Perfect Continuous i\xe7in de ge\xe7erlidir. Dikkat edilmesi gereken \xf6zneden sonra ge\xe7mi\u015f zaman\u0131 belirtmek i\xe7in Perfect Tense\u2019lerde kullan\u0131lan \u201chave\u201d yard\u0131mc\u0131 fiilinin ge\xe7mi\u015f hali olan \u201chad\u201d kullan\u0131lmas\u0131 ve \u201cbe\u201d fiilinin Past Participle formu olan \u201cbeen\u201d kullan\u0131lmas\u0131 ile kullan\u0131lan fiile \u201c-ing\u201d eki getirilmesidir, daha sonra nesne eklenir. Bu kurallar\u0131 g\xf6z \xf6n\xfcne al\u0131nca Past Perfect Continuous Tense c\xfcmle dizilimi \u015fu \u015fekildedir;\n\nOlumlu c\xfcmlelerde:\nI + had + been + V-ing\nHe/She/It + had + been + V-ing\nWe/You/They + had + been + V-ing\n\nOlumsuz c\xfcmlelerde:\nI + had + not + been + V-ing\nHe/She/It + had + not + been + V-ing\nWe/You/They had + not + been + V-ing\n\nSoru c\xfcmlelerinde:\nHad + I + been + V-ing ?\nHad + He/She/It + been + V-ing ?\nHad + We/You/They + been + V-ing ?\n\nPast Perfect Continuous Gramer Kurallar\u0131 Tablosu\n\nOlumlu C\xfcmlelerde:\tI/He/She/It/You/We/They + had + been + fiil (v-ing)\nOlumsuz C\xfcmlelerde:\tI/He/She/It/You/We/They + hadn\u2019t + been + fiil (v-ing)\nSoru C\xfcmlelerinde:\tHad + I/He/She/It/You/We/They + been + fiil (v-ing)\n\n\u0130ngilizcede yak\u0131n ge\xe7mi\u015fi ifade eden Present Perfect Tense, s\xf6z konusu olay\u0131n veya durumun ge\xe7mi\u015f zamanda ya\u015fand\u0131\u011f\u0131n\u0131 ancak etkisinin hala devam etti\u011fini belirtmek i\xe7in kullan\u0131l\u0131r. Bir c\xfcmlenin yak\u0131n ge\xe7mi\u015f zaman ile kuruldu\u011funu belirtmek i\xe7in \u201chave/has\u201d yard\u0131mc\u0131 fiilleri kullan\u0131l\u0131r. Past Perfect Continuous Tense i\xe7in \u201chave/has\u201d \u201chad\u201d yard\u0131mc\u0131 fiiline d\xf6n\xfc\u015f\xfcr ve ard\u0131ndan \u201cbeen\u201d daha sonra ise fiilin \u201c-ing\u201d eki alm\u0131\u015f hali getirilir.\n\nThey had been painting the building.\n\n(Onlar binay\u0131 boyuyorlard\u0131.)\n\nPast Perfect Continuous C\xfcmle Nas\u0131l Kurulur?\nPast Perfect Continuous Tense ge\xe7mi\u015fte olan bir olaydan daha da \xf6ncesini ifade etti\u011fi i\xe7in Perfect Tenselerde kullan\u0131lan \u201chave\u201d fiilinin ge\xe7mi\u015f hali olan \u201chad\u201d ile \u201cbe\u201d fiilinin 3. hali olan \u201cbeen\u201d fiili ve olay\u0131n bir s\xfcrece yay\u0131ld\u0131\u011f\u0131n\u0131 g\xf6sterdi\u011fi i\xe7in fiilin \u201c-ing\u201d eki alm\u0131\u015f hali ile nesne art arda eklenerek c\xfcmle olu\u015fturulur. A\u015fa\u011f\u0131da c\xfcmle dizilimine dair verilen \xf6rne\u011fi inceleyelim;\n\nSubject (I/You/He/She/It/We/You/They) + yard\u0131mc\u0131 fiil (had) + yard\u0131mc\u0131 fiil (been) + Fiil (V-ing) + \u2026.\n\nI had been working.\n\n(Ben \xe7al\u0131\u015f\u0131yordum.)\n\nPast Perfect Continuous Olumlu C\xfcmle \xd6rnekleri\n\n\u2013C\xfcmle dizili\u015fi: S + had + been + V-ing\n-\xd6zneden sonra \u201chad\u201d ve \u201cbeen\u201d yard\u0131mc\u0131 fiilleri daha sonra da fiilin \u201c-ing\u201d eki alm\u0131\u015f hali art arda eklenerek Past Perfect Continuous Tense ile olumlu c\xfcmle olu\u015fturulur.\n-A\u015fa\u011f\u0131da Past Perfect Continuous Tense ile olumlu c\xfcmle \xf6rnekleri yer almaktad\u0131r.\n\nYou had been disturbing other students when the supervisor warned you.\n\n(G\xf6zetmen seni uyard\u0131\u011f\u0131nda di\u011fer \xf6\u011frencileri rahats\u0131z ediyordun.)\n\nWe had been walking until someone offered to give us a lift.\n\n(Biri bizi arabayla g\xf6t\xfcrmeyi teklif edene kadar y\xfcr\xfcyorduk.)\n\nWe had been hearing a strange sound when the car exploded.\n\n(Araba patlad\u0131\u011f\u0131nda tuhaf bir ses duyuyorduk.)\n\nYour grandmother had been staying at a nursing home before your wife brought them to home.\n\n(Kar\u0131n eve getirmeden \xf6nce b\xfcy\xfckannnen huzurevinde kal\u0131yordu.)\n\nPast Perfect Continuous Olumsuz C\xfcmle \xd6rnekleri\n\n\u2013C\xfcmle dizili\u015fi: S + hadn\u2019t + been + V-ing\n-\xd6zneden sonra \u201chad\u201d yard\u0131mc\u0131 fiilinin olumsuz hali olan \u201chadn\u2019t\u201d ve \u201cbeen\u201d yard\u0131mc\u0131 fiilleri daha sonra da fiilin \u201c-ing\u201d eki alm\u0131\u015f hali art arda eklenerek Past Perfect Continuous Tense ile olumsuz c\xfcmle olu\u015fturulur.\n-A\u015fa\u011f\u0131da Past Perfect Continuous Tense ile olumsuz c\xfcmle \xf6rnekleri yer almaktad\u0131r.\n\nShe hadn\u2019t been staying at the dormitory before you took her to your home.\n\n(Sen onu evine g\xf6t\xfcrmeden \xf6nce yurtta kalm\u0131yordu.)\n\nWe hadn\u2019t been waiting for you when you showed up at the party.\n\n(Partiye geldi\u011finde seni beklemiyordu.)\n\nThe audience hadn\u2019t been clapping until the lights turned on.\n\n(I\u015f\u0131klar yanana kadar seyirciler alk\u0131\u015flam\u0131yorlard\u0131.)\n\nThe landlady hadn\u2019t been demanding an extra charge before you moved in.\n\n(Sen ta\u015f\u0131nmadan \xf6nce ev sahibi ek \xfccret istemiyordu.)\n\nPast Perfect Continuous ile \u0130ngilizce Edilgen C\xfcmle \xd6rnekleri\n\n\u2013C\xfcmle dizili\u015fi: S + had + been + being + V3\n-\xd6zneden sonra \u201chad\u201d ve \u201cbeen\u201d yard\u0131mc\u0131 fiilleri daha sonra da \u201cbe\u201d fiilinin \u201c-ing\u201d eki alm\u0131\u015f hali olan \u201cbeing\u201d ve kullan\u0131lacak fiilin \xfc\xe7\xfcnc\xfc hali art arda eklenerek Past Perfect Continuous Tense ile edilgen c\xfcmle olu\u015fturulur.\n-A\u015fa\u011f\u0131da Past Perfect Continuous Tense ile edilgen c\xfcmle \xf6rnekleri yer almaktad\u0131r.\n\nThe floor had been being wiped by the housekeeper when I slipped and fell.\n\n(Kay\u0131p d\xfc\u015ft\xfc\u011f\xfcmde yerler temizlik\xe7i taraf\u0131ndan siliniyordu.)\n\nWe had been being warned by our neighbours before we decided to move out.\n\n(Ta\u015f\u0131nmaya karar vermeden \xf6nce kom\u015fular\u0131m\u0131z taraf\u0131ndan uyar\u0131l\u0131yorduk.)\n\nMy daughter had been being bullied by her friends when she dropped out of school?\n\n(K\u0131z\u0131m okulu b\u0131rakt\u0131\u011f\u0131nda arkada\u015flar\u0131 taraf\u0131ndan zorbal\u0131\u011fa u\u011fruyordu.)\n\nThe table had been being dyed by the workers when I bought it.\n\n(Sat\u0131n ald\u0131\u011f\u0131mda masa \xe7al\u0131\u015fanlar taraf\u0131ndan boyan\u0131yordu.)\n\nPast Perfect Continuous Soru C\xfcmlesi \xd6rnekleri\n\n\u2013C\xfcmle dizili\u015fi: Had + S + been + V-ing\n\u2013\u201cHad\u201d yard\u0131mc\u0131 fiilinden sonra \xf6zne ve \u201cbeen\u201d yard\u0131mc\u0131 fiili daha sonra da fiilin \u201c-ing\u201d eki alm\u0131\u015f hali art arda eklenerek Past Perfect Continuous Tense ile olumlu soru c\xfcmlesi olu\u015fturulur.\n-A\u015fa\u011f\u0131da Past Perfect Continuous Tense ile olumlu soru c\xfcmlesi \xf6rnekleri yer almaktad\u0131r.\n\nHad you been working as a firefighter when your daughter was born?\n\n(K\u0131z\u0131n do\u011fdu\u011funda itfaiyeci olarak \xe7al\u0131\u015f\u0131yor muydun?)\n\nHad we been living in the same city when I was a child?\n\n(Ben \xe7ocukken ayn\u0131 \u015fehirde mi ya\u015f\u0131yorduk?)\n\nHad they been cleaning the house before my mother came?\n\n(Annem gelmeden \xf6nce evi temizliyorlar m\u0131yd\u0131?)\n\nHad your classmates been preparing a surprise for you before your birthday?\n\n(Do\u011fum g\xfcn\xfcnden \xf6nce s\u0131n\u0131f arkada\u015flar\u0131n sana s\xfcrpriz mi haz\u0131rl\u0131yorlard\u0131?)\n\nPast Perfect Continuous Tense Olumsuz Soru C\xfcmlesi \xd6rnekleri\n\n\u2013C\xfcmle dizili\u015fi: Hadn\u2019t + S + been + V-ing\n\u2013\u201cHad\u201d yard\u0131mc\u0131 fiilinin olumsuz hali olan \u201chadn\u2019t\u201d ard\u0131ndan \xf6zne ve \u201cbeen\u201d yard\u0131mc\u0131 fiili daha sonra da fiilin \u201c-ing\u201d eki alm\u0131\u015f hali art arda eklenerek Past Perfect Continuous Tense ile olumsuz soru c\xfcmlesi olu\u015fturulur.\n-A\u015fa\u011f\u0131da Past Perfect Continuous Tense ile olumsuz soru c\xfcmlesi \xf6rnekleri yer almaktad\u0131r.\n\nHadn\u2019t you been crying before I took you to the concert?\n\n(Seni konsere getirmeden \xf6nce a\u011flam\u0131yor muydun?)\n\nHadn\u2019t we been looking for a solution for hours when she came up with a great idea?\n\n(O harika bir fikir buldu\u011funda biz saatlerdir bir \xe7\xf6z\xfcm aram\u0131yor muyduk?)\n\nHadn\u2019t your daughter been trying to humiliate my son when we arrived at the school?\n\n(Okula vard\u0131\u011f\u0131m\u0131zda senin k\u0131z\u0131n benim o\u011flumu k\xfc\xe7\xfck d\xfc\u015f\xfcrmeye \xe7al\u0131\u015fm\u0131yor muydu?)\n\nHadn\u2019t I been doing your homework until I broke my hand?\n\n(Elim k\u0131r\u0131lana kadar senin \xf6devlerini yapm\u0131yor muydum?)\n\nPast Perfect Continuous ile Edilgen Soru C\xfcmleleri\n\n\u2013C\xfcmle dizili\u015fi: Had + S + been + being + V3\n\u2013\u201cHad\u201d yard\u0131mc\u0131 fiilinin ard\u0131ndan \xf6zne ve \u201cbeen\u201d yard\u0131mc\u0131 fiili daha sonra da \u201cbeing\u201d ard\u0131ndan da kullan\u0131lacak fiilin \xfc\xe7\xfcnc\xfc hali eklenerek Past Perfect Continuous Tense ile olumlu edilgen soru c\xfcmlesi olu\u015fturulur.\n-A\u015fa\u011f\u0131da Past Perfect Continuous Tense ile olumlu edilgen soru c\xfcmlesi \xf6rnekleri yer almaktad\u0131r.\n\nHad you been being observed by the teacher until the bell rang?\n\n(Zil \xe7alana kadar \xf6\u011fretmen taraf\u0131ndan g\xf6zetleniyor muydun?)\n\nHad your brother been being distracted by other students when he left the class?\n\n(Abin s\u0131n\u0131f\u0131 terk etti\u011finde di\u011fer \xf6\u011frenciler taraf\u0131ndan rahats\u0131z m\u0131 ediliyordu?)\n\nHad the clothes been being washed by your mother before you bought a washing machine?\n\n(Sen \xe7ama\u015f\u0131r makinesi almadan \xf6nce k\u0131yafetler annen taraf\u0131ndan m\u0131 y\u0131kan\u0131yordu?)\n\nHad the textbooks been being torn apart by your classmates before the teacher came?\n\n(\xd6\u011fretmen gelmeden \xf6nce ders kitaplar\u0131 s\u0131n\u0131f arkada\u015flar\u0131n taraf\u0131ndan m\u0131 par\xe7alan\u0131yordu?)\n\n\u0130ngilizcede Past Perfect Continuous Olumsuz Edilgen Soru C\xfcmleleri\n\n\u2013C\xfcmle dizili\u015fi: Had not + S + been + being + V3\n-Olumsuz halde olan \u201chadn\u2019t\u201d yard\u0131mc\u0131 fiilinin ard\u0131ndan \xf6zne ve \u201cbeen\u201d yard\u0131mc\u0131 fiili daha sonra da \u201cbeing\u201d ard\u0131ndan da kullan\u0131lacak fiilin \xfc\xe7\xfcnc\xfc hali eklenerek Past Perfect Continuous Tense ile olumsuz edilgen soru c\xfcmlesi olu\u015fturulur.\n-A\u015fa\u011f\u0131da Past Perfect Continuous Tense ile olumsuz edilgen soru c\xfcmlesi \xf6rnekleri yer almaktad\u0131r.\n\nHadn\u2019t your room been being cleaned by your roommates until they left for lunch?\n\n(\xd6\u011fle yeme\u011fine gidene kadar odan oda arkada\u015flar\u0131n taraf\u0131ndan temizlenmiyor muydu?)\n\nHadn\u2019t the walls been being painted by your neighbours when you came in?\n\n(\u0130\xe7eri girdi\u011finde duvarlar kom\u015fular\u0131n taraf\u0131ndan boyanm\u0131yor muydu?)\n\nHadn\u2019t your room been being redecorated by your family before you came back home from college?\n\n(\xdcniversiteden eve d\xf6nmeden \xf6nce odan ailen taraf\u0131ndan yeniden dekore edilmiyor muydu?)\n\nHadn\u2019t the ceiling been being repaired before it collapsed?\n\n(\xc7\xf6kmeden \xf6nce tavan tamir edilmiyor muydu?)\n\n",null,B.u,null,null,null,null,null,null)
B.Qb=new A.R("              \nReported Speech\u2019in kelime anlam\u0131 \u201cDolayl\u0131 Anlat\u0131m\u201dd\u0131r. Yani herhangi bir zaman diliminde kurulmu\u015f bir c\xfcmlenin ba\u015fkalar\u0131na dolayl\u0131 yoldan aktar\u0131lma \u015feklidir.\n\nOlay\u0131n ger\xe7ekle\u015fme an\u0131 ge\xe7mi\u015f, \u015fimdiki veya gelecek zamanda olabildi\u011fi gibi ba\u015fka birine anlat\u0131ld\u0131\u011f\u0131 zaman aral\u0131\u011f\u0131nda, olayla ayn\u0131 zaman diliminde veya sonras\u0131nda da olabilir.\n\nDolayl\u0131 anlat\u0131ma basit bir \xf6rnek verelim.\n\n\xd6rnek:\n\nC\xfcmle: Jane: I am going to my friend\u2019s party.\n(Jane: Ben arkada\u015f\u0131m\u0131n partisine gidiyorum.)\n\nC\xfcmle: Jane said, \u201cI am going to my friend\u2019s party.\u201d\n(Jane, \u201cBen arkada\u015f\u0131m\u0131n partisine gidiyorum.\u201d dedi.)\n\nReported Speech C\xfcmle: Jane said (that) she was going to her friend\u2019s party.\n(Jane, arkada\u015f\u0131n\u0131n partisine gidece\u011fini s\xf6yledi.)\n\n\u0130lk c\xfcmle, Jane\u2019nin a\u011fz\u0131ndan \xe7\u0131kan c\xfcmlenin orijinal halidir.\n\n\u0130kinci c\xfcmlede anlat\u0131lmak istenen, c\xfcmle bozulmadan aktar\u0131l\u0131r. Buna \u0130ngilizcede \u201cDirect Speech\u201d de denir. (Jane b\xf6yle dedi.)\n\n\xdc\xe7\xfcnc\xfc c\xfcmlede ise anlatan ki\u015fi olay\u0131 dolayl\u0131 yoldan aktar\u0131r. Buna da rapor etmek, anlatmak anlam\u0131nda \u201cReported Speech\u201d ya da \u201cIndirect Speech\u201d denir. C\xfcmlede kullan\u0131lan tense bir \xf6nceki tensle yer de\u011fi\u015ftirir, \xf6zneler ve iyelik ekleri anlat\u0131c\u0131ya g\xf6re de\u011fi\u015fir.\n\n \n\nReported Speech Kullan\u0131m Kurallar\u0131\n\nDolayl\u0131 anlat\u0131m\u0131n genel kural\u0131, anlat\u0131lanlar\u0131 bir ad\u0131m geri alarak aktarmakt\u0131r. Yani kullan\u0131lan zaman dilimleri bir zaman geriden s\xf6ylenir. Zamirler anlat\u0131ma g\xf6re de\u011fi\u015fime u\u011frar. Zaman zarflar\u0131, anlat\u0131ma g\xf6re bir \xf6nceki zamandan aktar\u0131l\u0131r.\n\nBir c\xfcmleyi dolayl\u0131 anlat\u0131m ile anlat\u0131rken a\u015fa\u011f\u0131daki kurallar\u0131 g\xf6z \xf6n\xfcne alarak bildirmek gerekir:\n\nTenslerin Kullan\u0131m\u0131\n\nReported Speech\u2019te tensler (zamanlar) en \xf6nemli konudur. \xc7\xfcnk\xfc olay\u0131n ger\xe7ekle\u015fme zaman\u0131 ile anlat\u0131lma zamanlar\u0131 farkl\u0131 olabilir. Bu nedenle report edilecek c\xfcmlenin tensi bir \xf6nceki zamandan s\xf6ylenir.\n\n\xd6rnek:\n\nShe said \u201cI work a bank.\u201d\nShe said (that) she worked a bank.\nShe said \u201cJohn is sleeping.\u201d\nShe said (that) John was sleeping.\nHe said \u201cI was reading the newspaper when you were at the door.\u201d\nHe said (that) he had been reading the newspaper when I had been at the door.\nThey said \u201cWe will call him later.\u201d\nThey said (that) they would call him later.\nNot: Baz\u0131 durumlarda tenslerin de\u011fi\u015fikli\u011fe u\u011framad\u0131\u011f\u0131 da g\xf6r\xfclebilir. Dolayl\u0131 anlat\u0131m\u0131n ger\xe7ekle\u015fti\u011fi anda devam eden olaylar ve do\u011frulu\u011fu her zaman ge\xe7erli olan konular i\xe7in tense de\u011fi\u015ftirmeden c\xfcmle kurulur. \n\n\xd6rnek:\n\nThe teacher said \u201cThe Sun rises from the east.\u201d\nThe teacher said (that) the Sun rises from the east.\nMum says \u201cDinner is ready.\u201d\nMum says dinner is ready.\nPersonal Pronouns, Possessive Pronouns ve Possessive Adjectives Kullan\u0131m\u0131\nReported Speech\u2019te personal pronouns (ki\u015fi zamirleri), possessive pronouns (iyelik zamirleri) ve possessive adjectives (iyelik s\u0131fatlar\u0131) direct c\xfcmle ile ayn\u0131 kalmaz. \n\nC\xfcmleyi kuran \u201cI (ben)\u201d ki\u015fi zamirini kullan\u0131yorsa anlat\u0131c\u0131 \u201che/ she (o)\u201d ki\u015fi zamirini kullanarak s\xf6ylemelidir.\n\n\xd6rnek: \n\nHe said \u201cWe will finish the project.\u201d\nHe said (that) they would finish the project. (\u201cBiz\u201d zamiri \u201conlar\u201d olarak de\u011fi\u015fmi\u015f.)\nAyn\u0131 \u015fekilde aitlik bildiren iyelik zamir ve s\u0131fatlar\u0131 da ki\u015fi zamirleri gibi de\u011fi\u015ftirilmelidir.\n\n\xd6rnek: \n\nTom said \u201cMy mother bought some apple from the market.\u201d (direct)\n(Tom \u201cAnnem marketten biraz elma ald\u0131.\u201d dedi.)\nTom said (that) his mother bought/ had bought some apple from the market. (reported)\n(Tom annesinin marketten biraz elma ald\u0131\u011f\u0131n\u0131 s\xf6yledi.)\nShe said \u201cI can write a letter to you.\u201d (direct)\n(O, \u201cSana bir mektup yazabilirim.\u201d dedi.)\nShe said (that) she could write a letter to me. (reported)\n(O, bana bir mektup yazabilece\u011fini s\xf6yledi.)\nG\xf6r\xfcld\xfc\u011f\xfc gibi ilk \xf6rnekte iyelik s\u0131fat\u0131, sonraki \xf6rnekte de ki\u015fi zamiri ve iyelik zamiri de\u011fi\u015fmi\u015ftir.\n\n",null,B.u,null,null,null,null,null,null)
