B.Qg=new A.R("            \nTina was a 6 years old cute girl. She is very fond of wooden toys, especially she had a beautiful wood horse gifted by her uncle when she was 2 years old. The wooden horse has been her close pal and her pet. She has a 9 years old brother. She went on a vacation to a nature resort in the woods with her family. She carried the wooden horse with her. \n\nShe enjoyed her holiday with her family in the woods. While she was packing things with her brother as they planned to return home, the wooden horse fell down and one of the legs was broken. Tina was too sad and silently cried for her horse. She was very upset. They packed all things and left the woods. The entire family tried to cheer up the sweet little girl, but Tina was so silent, very upset. Tina\u2019s brother tried to console her a lot.\n\nThey had a break for lunch and Tina refused to eat. Her momma requested her to eat food, she ate a very little amount of food. While others were eating, she sat quietly in their car. Her brother came to her and kissed her cheek, told her,\n\n\u201cTina dear, don\u2019t worry, don\u2019t get upset dear. It is only a wooden toy. The horse doesn\u2019t have a life like us and it is just a lifeless thing. Don\u2019t be so sad about the broken leg. Even if the horse loses its tail, it won\u2019t be hurting the horse. Even if all four legs are broken, the wooden horse remains the same. Even if the horse loses its head, it won\u2019t be painful. I will buy a new wood horse for you!\u201d\n\nTina replied, \u201cYou think it doesn\u2019t matter that a leg of my pet toy was broken?\u201d\n\nHer brother replied, \u201cYes dear!\u201d\n\nTina replied, \u201cYes brother, you are right. It won\u2019t be a major issue for you even if the horse is broken into pieces at this age. But if you are in my age, if you had a pet like I had, you will feel how painful it would be to even if a small part of the horse is broken!\u2019\n\nHer brother left silently.\n            ",null,B.u,null,null,null,null,null,null)
B.Qh=new A.R("              \n          \u0130ngilizcede Gerunds (Ula\xe7)\n\nGerund, T\xfcrk\xe7ede ula\xe7 ad\u0131 verilen bir dil bilgisi konusuna at\u0131fta bulunur. Bilindi\u011fi \xfczere ula\xe7, c\xfcmle i\xe7erisinde zarf g\xf6reviyle kullan\u0131lmakta olan fiilimsilere denir ve genellikle y\xfckleme y\xf6neltilen \u201cnas\u0131l\u201d veya \u201cne zaman\u201d sorular\u0131na yan\u0131t verir.\n\nC\xfcmlede \xf6zne, nesne veya t\xfcmle\xe7 g\xf6revinde bulunabilen gerund her ne kadar fiillerin \u2013ing eki almas\u0131yla olu\u015fsa da her -ing ekini alm\u0131\u015f fiil gerund olmayabilir. A\u015fa\u011f\u0131daki \xf6rneklerde tam da b\xf6ylesi bir durum irdelenmi\u015ftir.\n\nGerund\tI like running in the evening.\n\nAk\u015famlar\u0131 ko\u015fmay\u0131 severim.\n\nParticiple\tI saw a running woman this evening.\n\nBu ak\u015fam ko\u015fan bir kad\u0131n g\xf6rd\xfcm.\n\nYukar\u0131daki tabloda verilen ilk c\xfcmlede running isimdir ve haliyle de gerund olmaktad\u0131r. Buna kar\u015f\u0131l\u0131k ikinci c\xfcmlede running, ismi niteledi\u011fi i\xe7in s\u0131fat g\xf6revi g\xf6rmekte ve bu y\xfczden de gerund de\u011fil present partciple olmaktad\u0131r.\n\n          Simple ve Perfect Gerunds Kullan\u0131m\u0131\n\nGerund \xf6bekleri c\xfcmlede simple veya perfect zamanlarda kullan\u0131labilir:\n\n       SIMPLE\t                             PERFECT\n\nhearing someone\t          having heard someone\n\nbeing heard\t                    having been heard\n\nPerfect gerunds ile s\xf6z konusu eylemin \xe7oktan ger\xe7ekle\u015fti\u011fini anlat\u0131rken simple gerunds ise baz\u0131 durumlarda tamamlanm\u0131\u015f i\u015fleri ifade edebilir ve genel olarak geni\u015f zaman i\xe7eren bir kullan\u0131m\u0131 ifade eder.\n\n\xd6\u011frenmeye \xe7al\u0131\u015f\u0131yor\t\n\nTom appreciates learning how to use computer.\n\n\xd6\u011frenmi\u015f\t\n\nTom appreciates having learned how to use computer.\n\nGerund \xf6beklerinin \xf6zneleri iyelik s\u0131fat\u0131 ya da nesne zamiri \u015feklinde g\xf6r\xfclebilir. Gerund \xf6be\u011fi \u015fekline d\xf6n\xfc\u015ft\xfcr\xfclen \xf6zg\xfcn t\xfcmce olumsuz ise, gerund \xf6be\u011finde olumsuzlu\u011fu sa\u011flamak i\xe7in NOT kullan\u0131l\u0131r. A\u015fa\u011f\u0131daki tabloda bu durum \xf6rneklenmi\u015ftir.\n\nThomas recall Ronaldo not being very enthusiastic about being a footballer.\n\nNot learning to swim can be dangerous.\n\n          C\xfcmle \u0130\xe7inde Gerunds Kullan\u0131m\u0131\n\nA\u015fa\u011f\u0131daki c\xfcmlenin \xf6znesi gerund phrase\u2019dir:\n\nSomething\t  is good for your health.\nYou run.\t  It is good for your health.\nYour running\t  is good for your health.\nRunning\tis  good for your health\n\n\u2757 Your zamiri, herhangi biri anlam\u0131nda bir belirsiz zamir olarak kullan\u0131ld\u0131\u011f\u0131nda c\xfcmleden at\u0131labilir. B\xf6ylece c\xfcmlemiz son format\u0131na \u201cRunning is good for your health.\u201d \u015feklinde b\xfcr\xfcnm\xfc\u015ft\xfcr. Gerund c\xfcmle i\xe7inde \xf6zne, nesne veya t\xfcmle\xe7 gibi \xe7e\u015fitli g\xf6revlerde kullan\u0131labilmektedir.\n\n\u2b50 \xd6zne g\xf6revindeyken kullan\u0131labilir.\n\nSwimming in this pool is enjoyable.\n\nBu havuzda y\xfczmek \xe7ok keyifli.\n\nPlaying football is my favourite sport.\n\nFutbol oynama benim favori sporumdur.\n\nClimbing seems like a dangerous activity.\n\nT\u0131rmanma tehlikeli bir aktivite gibi g\xf6r\xfcn\xfcyor.\n\n\u2b50 Nesne g\xf6revindeyken gerund kullan\u0131labilir.\n\nI like listening to classical music.\n\nKlasik m\xfczik dinlemeyi severim.\n\nShe fancy going for a walk in the rain.\n\nYa\u011fmurda y\xfcr\xfcy\xfc\u015fe \xe7\u0131kmaktan ho\u015flan\u0131r.\n\nHe doesn\u2019t like enjoy walking.\n\nY\xfcr\xfcmekten ho\u015flanmaz.\n\n\u2b50 Come ve go fiillerinden sonra gerund kullan\u0131labilir. B\xf6ylesi ifadelerde \xf6neri veya davet anlam\u0131 sa\u011flan\u0131r.\n\nCome fishing this weekend.\n\nBu hafta sonu bal\u0131k tutmaya gel.\n\nCome swimming tomorrow.\n\nYar\u0131n y\xfczmeye gel.\n\nWhy don\u2019t we go shopping an hour later.\n\nNeden bir saat sonra al\u0131\u015fveri\u015fe gitmiyoruz?\n\n\u2b50 Need, require ve want fiillerinden sonra gerund kullan\u0131labilir.\n\nYour car requires washing.\n\nAraban\u0131z\u0131n y\u0131kanmas\u0131 gerekiyor.\n\nHe needs encouraging.\n\nTe\u015fvik etmeye ihtiyac\u0131 var.\n\n\u2b50 Edatlardan (prepositions) sonra gerund kullan\u0131labilir.\n\nBrad didn\u2019t tell me about going on a holiday.\n\nBrad bana tatile gitmekten bahsetmedi.\n\nAnna left the school without asking for permission.\n\nAnna izin istemeden okulu terk etti.\n\nAfter swimming two hours, I felt tired.\n\n\u0130ki saat y\xfczd\xfckten sonra kendimi yorgun hissettim.\n\n\u2b50 S\u0131fatlardan sonra gerund kullan\u0131labilir. Bu tarz c\xfcmleler genellikle it \xf6znesi ile ba\u015flar. S\u0131fatlardan sonra iyelik (possessive) zamirler gelebilir.\n\nIt is difficult finding a job these days.\n\nBu devirde i\u015f bulmak zor.\n\nIt is strange you marrying with him.\n\nOnunla evlenmen garip.\n\nIt\u2019s ridiculus his talking like that.\n\nB\xf6yle konu\u015fmas\u0131 g\xfcl\xfcn\xe7.\n\n\u2b50 \u0130simlerden sonra gerund kullan\u0131labilir. \u0130smin say\u0131labilir olup olmamas\u0131 fark etmeksizin ard\u0131ndan gerund kullan\u0131labilir. Bu arda c\xfcmle ise it \xf6znesi ile ba\u015flar.\n\nIt is a pleasure being here with you.\n\nBurada seninle olmak bir zevk.\n\nIt\u2019s fun being taken to the zoo.\n\nHayvanat bah\xe7esine g\xf6t\xfcr\xfclmek e\u011flencelidir.\n\nIt\u2019s a hell sharing the same room with him.\n\nOnunla ayn\u0131 oday\u0131 payla\u015fmak cehennem.\n\n\u2b50 S\u0131fat + edattan sonra gerund kullan\u0131labilir.\n\nShe is good at singing.\n\n\u015eark\u0131 s\xf6ylemekte iyidir.\n\nI am sorry for disturbing you.\n\nSeni rahats\u0131z etti\u011fim i\xe7in \xf6z\xfcr dilerim.\n\nHe is interested in collecting stamps.\n\nPul toplamaya merakl\u0131d\u0131r.\n\n\u2b50 \u0130sim + edattan sonra gerund kullan\u0131labilir.\n\n\nHis fear of flying surprised everybody.\n\nU\xe7ma korkusu herkesi \u015fa\u015f\u0131rtt\u0131.\n\nThe manager gave me information about visiting the monuments.\n\nY\xf6netici bana an\u0131tlar\u0131 ziyaret etme hakk\u0131nda bilgi verdi.\n\nHis interest in coding makes his family happy.\n\nKodlamaya olan ilgisi ailesini mutlu ediyor.\n\n",null,B.u,null,null,null,null,null,null)
