B.Qj=new A.R("              \nWill ve won\u2019t ile beraber definitely, probably ve maybe gibi zarflar kullanarak durumlar\u0131n veya ya\u015fanan \u015feylerin olas\u0131 az veya \xe7ok muhtemel oldu\u011funu anlatan kelimeler vard\u0131r. \u0130ngilizcede ihtimal anlatan kelimeler \xf6rnekleri ve kullan\u0131ld\u0131\u011f\u0131 durumlara g\xf6re irdelenmi\u015ftir.\n\nDefinitely\n\nKesinlikle anlam\u0131na gelen definitely, S\xf6yledi\u011fimiz \u015feyden kesinlikle emin oldu\u011fumuzu belirtmek i\xe7in kullan\u0131r\u0131z. Definetely genellikle \u201cwill\u201d den sonra gelir ancak daima \u201cwon\u2019t\u201d dan \xf6nce gelmektedir:\n\nIt definitely won\u2019t rain tomorrow.\nYar\u0131n kesinlikle ya\u011fmur ya\u011fmayacak.\nShe will definitely forgive you.\nSeni kesinlikle affedecektir.\nThis attack will definitely goal.\nBu atak kesinlikle gol olur.\nHe definitely won\u2019t win this match.\nBu ma\xe7\u0131 kesinlikle kazanamayacak.\n\u0130ngilizcede \u0130htimal Anlatan Kelimeler\n\nProbably\n\nMuhtemelen anlam\u0131na gelen probably, bir \u015feyin olas\u0131 oldu\u011funu d\xfc\u015f\xfcn\xfcld\xfc\u011f\xfc ancak \u201cdefinitely\u201d den daha az emin olma durumunu belirtmek i\xe7in kullan\u0131l\u0131r. T\u0131pk\u0131 definetely gibi genellikle \u201cwill\u201d den sonra gelir ancak daima \u201cwon\u2019t\u201d dan \xf6nce gelmektedir:\n\nIt probably won\u2019t rain tomorrow.\nMuhtemelen yar\u0131n ya\u011fmur ya\u011fmayacak.\nShe probably won\u2019t come here in a minute.\nMuhtemelen bir dakika i\xe7inde buraya gelmeyecek.\nHe will probably like the cat.\nMuhtemelen kediyi sevecektir.\nThey probably won\u2019t arrive on time.\nMuhtemelen zaman\u0131nda gelmeyecekler.\n\u0130ngilizcede \u0130htimal Anlatan Kelimeler\n\nMaybe\n\nMaybe zarf\u0131 bir \u015fey hakk\u0131nda daha az emin olunan durumlar\u0131 ifade etmek i\xe7in kullan\u0131l\u0131r ve genel olarak c\xfcmlenin ba\u015f\u0131na gelir:\n\nMaybe we\u2019ll go out later.\nBelki sonra \xe7\u0131kar\u0131z.\nMaybe it will rain tomorrow.\nBelki yar\u0131n ya\u011fmur ya\u011far.\nMaybe I will go to Germany.\nBelki Almanya\u2019ya giderim.\nMaybe she likes you.\nBelki senden ho\u015flan\u0131yordur.\n\nMay / Might\n\nMay ve might, bir \u015feyin olma ihtimalini belirtirken kullan\u0131r\u0131z. Bu ikisinde anlam olarak \u201cwill\u201d ve \u201cwon\u2019t\u201d kullanmaya g\xf6re daha az emin olma durumu vard\u0131r.\n\n\nAyr\u0131ca may ve might fiilleri ile genel olarak \u201cprobably\u201d, \u201cdefinitely\u201d ve \u201cmaybe\u201d ile beraber kullan\u0131lmaz.\n\nIt might be a fun dinner.\nE\u011flenceli bir ak\u015fam yeme\u011fi olabilir.\nThey might go out later.\nDaha sonra d\u0131\u015far\u0131 \xe7\u0131kabilirler.\nThe price of meat may fall. I\u2019m not sure.\nEt fiyatlar\u0131 d\xfc\u015febilir. Emin de\u011filim.\n\n",null,B.u,null,null,null,null,null,null)
