B.Ql=new A.R("              \n\u0130ngilizcede relative clauses, isimleri a\xe7\u0131klamak, nitelemek, yap\u0131sal ve anlamsal a\xe7\u0131dan geni\u015fletmek i\xe7in kullan\u0131lan c\xfcmlelerdir. Bu \u015fekilde nitelendirilen isimler antecedent olarak adland\u0131r\u0131l\u0131r.\n\n\u0130ngilizcede e\u011fer iki c\xfcmlede ayn\u0131 varl\u0131\u011f\u0131 g\xf6steren iki ad \xf6be\u011fi varsa bu iki c\xfcmle pekala birle\u015ftirilebilir:\n\nThe student wrote a book.\nThe book was ecellent.\nThe student wrote a book / the book was ecellent.\n\u201cThe student wrote a book / the book was ecellent.\u201d dizili\u015fi ile verilmek istenen anlam\u0131 anla\u015f\u0131labilmektedir ancak hen\xfcz kabul edilebilir bir c\xfcmle ortaya \xe7\u0131kmam\u0131\u015ft\u0131r.\n\n\u0130ngilizcede \u015fah\u0131s zamirlerini anlatt\u0131\u011f\u0131m\u0131z dersimizde ayn\u0131 ismi anlatan ad \xf6be\u011finin ikinci kullan\u0131m\u0131nda onun yerine bir zamir kullan\u0131lmas\u0131 gerekti\u011fini belirtmi\u015ftik. Bu y\xfczden c\xfcmlelerimizi birle\u015ftirmek i\xe7in ilgi zamirlerinden (relative pronouns) uygun olan\u0131 kullan\u0131r\u0131z. Bu c\xfcmlemiz i\xe7in ise which ilgi zamiri uygun olan\u0131d\u0131r:\n\n\nThe student wrote a book the book which was ecellent.\n\xd6\u011frenci m\xfckemmel bir kitap yazd\u0131.\nRelative Clauses\nC\xfcmle i\xe7inde s\u0131fat g\xf6revi g\xf6ren ve adlar\u0131 niteleyen bu yan c\xfcmlecikler T\xfcrk\xe7ede yap\u0131lan\u0131n aksine niteledikleri isimlerden sonra yer al\u0131rlar:\n\nThe book which I lent you was stolen.\nSana \xf6d\xfcn\xe7 verdi\u011fim kitap \xe7al\u0131nd\u0131.\n\u0130ngilizcede relative clause yaparken kullan\u0131lan 5 temel ilgi zamiri (relative pronoun) bulunmaktad\u0131r:\n\nwho\nwhom\nwhose\nthat\nwhich\nWho ya da that zamirleri insanlar i\xe7in kullan\u0131l\u0131rken that veya which ilgi zamirleri e\u015fyalar, \u015feyler ve nesneler i\xe7in kullan\u0131lmaktad\u0131r. Ve son olarak whose ise iyelik belirten s\xf6zc\xfcklerle (sahiplik durumunda) kullan\u0131lmaktad\u0131r.\n\n\u2757 Bir zamirin nesne durumunda m\u0131 yoksa \xf6zne durumunda oldu\u011funu anlamak i\xe7in ilgi zamirinin hemen ard\u0131ndan gelen kelimeye bakmak yard\u0131mc\u0131 olacakt\u0131r. E\u011fer ilgi zamirinden sonra gelen kelime fiil ise ilgi zamiri \xf6zne durumunda, e\u011fer nesne ise ilgi zamiri nesne durumunda kullan\u0131lm\u0131\u015ft\u0131r.\n\n\xd6zne\tThe student who is in the class is very clever.\nS\u0131n\u0131ftaki \xf6\u011frenci \xe7ok zekidir.\nNesne\tThis is the PC which I bought last week.\nGe\xe7en hafta ald\u0131\u011f\u0131m bilgisayar budur.\n\nRelative Clauses C\xfcmleleri\n\n\u2757 Baz\u0131 durumlarda ilgi zamiri (relative pronoun) \xe7\u0131kar\u0131labilir. Bu durum zamir, s\u0131fat c\xfcmleci\u011finin \xf6znesi olmad\u0131\u011f\u0131 zaman ger\xe7ekle\u015fir.\n\nThe lady (that/who) I live with is a painter.\nBirlikte ya\u015fad\u0131\u011f\u0131m han\u0131mefendi bir ressam.\n\nCan you give me the book (that/which) I put on my bed?\nYata\u011f\u0131ma koydu\u011fum kitab\u0131 bana verir misin?\n\nDefining Adjective Clause\n\nDefining adjective clause olarak bilinen tan\u0131mlayan s\u0131fat c\xfcmlecikleri ile bilinmeyen bir isim nitelenerek bilinir hale gelir. Bilinir hale gelen bu bilgi e\u011fer ana c\xfcmleden \xe7\u0131kar\u0131ld\u0131\u011f\u0131nda, kimden ya da neyden bahsedildi\u011fi de haliyle anla\u015f\u0131lmaz.\n\nBu tarz s\u0131fat c\xfcmleciklerinde c\xfcmlenin anla\u015f\u0131lmas\u0131nda gerekli bir bilgi verildi\u011fi i\xe7in, c\xfcmleci\u011fin ba\u015f\u0131na ve sonuna virg\xfcl gelmez.\n\nThe man who painted my house was very professional.\nEvimi boyayan adam \xe7ok profesyoneldi.\n\nThe woman who is wearing a red hat is my girl friend.\nK\u0131rm\u0131z\u0131 \u015fapkal\u0131 kad\u0131n benim k\u0131z arkada\u015f\u0131m.\n\nA man who wants to see you is waiting at the door.\nSizi g\xf6rmek isteyen bir adam kap\u0131da bekliyor.\n\nThe patient who will have an operation is my friend.\nAmeliyat olacak hasta benim arkada\u015f\u0131m.\n\nRelative Clauses C\xfcmleleri\n\nNon-Defining Adjective Clause\nT\xfcrk\xe7ede tan\u0131mlayan olmayan s\u0131fat c\xfcmlecikleri olarak adland\u0131r\u0131lan non-defining adjective clauses, her ne kadar bilinen bir isim hakk\u0131nda fazladan bilgi vermek i\xe7in kullan\u0131lsa da ismi nitelemez.\n\nHaliyle de bu bilgi, ana c\xfcmleden \xe7\u0131kar\u0131ld\u0131\u011f\u0131nda, isim herkes taraf\u0131ndan yine de bilinir. Bundan dolay\u0131 non-defining adjective clause olarak kurulan c\xfcmleciklerde, c\xfcmleci\u011fin ba\u015f\u0131na ve sonuna virg\xfcl konulmaktad\u0131r.\n\nMy friend Brad Pitt, who is very handsome, is an actor.\n\xc7ok yak\u0131\u015f\u0131kl\u0131 olan arkada\u015f\u0131m Brad Pitt bir akt\xf6rd\xfcr.\n\nHis brother John, who is very hardworking, won a scholarship.\n\xc7ok \xe7al\u0131\u015fkan olan karde\u015fi John bir burs kazand\u0131.\n\nThomas, who is a computer engineer, wants to improve his German.\nBilgisayar m\xfchendisi olan Thomas, Almancas\u0131n\u0131 geli\u015ftirmek istemektedir.\n\nHer roommate Emma, who is a teacher, wants to teach English to me.\n\xd6\u011fretmen olan oda arkada\u015f\u0131 Emma bana \u0130ngilizce \xf6\u011fretmek istiyor.\n",null,B.u,null,null,null,null,null,null)
B.Qm=new A.R("            \nSince almost the beginning of cinema, we have had scary films. Of all the genres that exist, horror is perhaps one of the most conventional. Many horror films rely on specific plot devices, also called tropes, to make their audience frightened. When a trope is used too much, it can become a clich\xe9. But when used well, it can really make us jump out of our skin. Here are some of the most used, and perhaps abused, clich\xe9s in horror films.\nNo matter what kind of house it is, the basement is a scary place in horror films. That\u2019s usually where something is hiding or where the evil psychopath has hidden their tools. Basements are always dark and often damp. You can only reach them by a narrow staircase. And basements are always creepy, even when there isn\u2019t anything down there.\nIn older horror films, when protagonists were in desperation, it was difficult or impossible for them to call for help or call the police. Mobile phones have made that situation a bit less believable now. What\u2019s the solution to maintain suspense? No phone coverage! If you\u2019re a hero in a horror film, it\u2019s almost certain that at a key moment, just when you absolutely need to call for help, you will not have any coverage at all. Or your phone battery will die just as you are making the call. Or both.\nHorror films love uninhabited places. This could be an abandoned hospital, a scary empty house or a ghost town. There\u2019s something about lonely, empty places. What was it like when people lived there? Why did they leave? Maybe it\u2019s also that they are so quiet, which can be very scary too. Of course, abandoned places are also handy for horror film directors in that it\u2019s more believable that you will have no phone coverage there either.\nThe hero has been driving for hours. It\u2019s night-time and it\u2019s beginning to rain. Suddenly he sees a person on the side of the road. Maybe the company will keep him awake? In horror films, giving anybody a ride is asking for trouble. The hero always does it, and it always ends badly.\nThis horror film clich\xe9 was especially popular with horror films of the late 20th century. It starts with a group of teenagers all enjoying themselves, and it ends with everyone dead except one girl. At the beginning the girl is usually innocent, shy and not particularly strong. By the end, she has become the toughest and most resourceful person in the world. The last girl almost always wins in the end.\n            ",null,B.u,null,null,null,null,null,null)
B.Qn=new A.R("              \n\u2795 Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + could have V3.\n\n\u2796 Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + could not have V3.\nSubject (I, you, we, they, he, she, it) + couldn\u2019t have V3.\n\n\u2753 Soru c\xfcmleleri\nCould + subject (I, you, we, they, he, she, it) + have V3?\nCouldn\u2019t + subject (I, you, we, they, he, she, it) + have V3?\n\n\xd6rnek telaffuzlar:\n\ud83d\udd0a could have,\n\ud83d\udd0a couldn\u2019t have,\n\ud83d\udd0a could not have\n\n\u2757 Could, silent l harfine sahiptir. Dikkatli dinlerseniz l harfinin telaffuz edilmedi\u011fini fark edeceksiniz.\n\nThomas got really lucky while driving. It could have caused a terrible accident.\nThomas araba s\xfcrerken ger\xe7ekten \u015fansl\u0131yd\u0131. Korkun\xe7 bir kazaya neden olabilirdi.\n\nHistory is the sum total of the things that could have been avoided.\nTarih, ka\xe7\u0131n\u0131labilecek \u015feylerin toplam\u0131d\u0131r.\n\nHe said that \u201cA woman never forgets the men she could have married.\u201d\n\u201cBir kad\u0131n evlenebilece\u011fi erkekleri asla unutmaz\u201d dedi.\n\nBe a little careful! You could have killed yourself!\nBiraz dikkatli ol! Kendini \xf6ld\xfcrebilirdin!\n\nHe had money and could have paid off all his debts, but I don\u2019t think he did.\nParas\u0131 vard\u0131 ve t\xfcm bor\xe7lar\u0131n\u0131 \xf6deyebilirdi, ama \xf6dedi\u011fini sanm\u0131yorum.\n\nHe could have visited his father in the hospital, but I don\u2019t think he did.\nO, babas\u0131n\u0131 hastanede ziyaret edebilirdi ama ziyaret etti\u011fini sanm\u0131yorum.\n\nAlthough he had no free time, he could have met her.\nHer ne kadar bo\u015f zaman\u0131 olmasa da, onunla bulu\u015fabilirdi.\n\nIf he kept talking abusive like that, they could have called the police.\nB\xf6yle k\xfcf\xfcrl\xfc konu\u015fmaya devam etseydi, polisi arayabilirlerdi.\n\n\u0130ngilizcede Could Have V3 \xd6rnek C\xfcmleleri\n\n\u2b50 Couldn\u2019t have V3 yap\u0131s\u0131, ge\xe7mi\u015fte ger\xe7ekle\u015fmesi imkans\u0131z oldu\u011fu d\xfc\u015f\xfcn\xfclen olaylar\u0131 anlatmak i\xe7in kullan\u0131labilir.\n\nHe couldn\u2019t have seen Anna. She is in Paris.\nAnna\u2019y\u0131 g\xf6rm\xfc\u015f olamaz. O, Paris\u2019te.\n\nJohn couldn\u2019t have been in a car accident. He was at home.\nJohn bir araba kazas\u0131 ge\xe7irmi\u015f olamaz. O evdeydi.\n\nHe couldn\u2019t have gone to London. He was in the hospital because he was sick.\nLondra\u2019ya gitmi\u015f olamaz. Hasta oldu\u011fu i\xe7in hastanedeydi.\n\n",null,B.u,null,null,null,null,null,null)
