B.Qq=new A.R("              \nT\xfcrk\xe7ede -meli/mal\u0131 anlamlar\u0131na gelen should kip belirtecinin (modal verbs) a\u015fa\u011f\u0131daki tabloda olumlu, olumsuz ve soru halleri ve \xf6rnek telaffuzlar\u0131 g\xf6sterilmi\u015ftir.\n\n\u27a1\ufe0f Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + should + V1\n\n\u27a1\ufe0f Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + shouldn\u2019t + V1\nSubject (I, you, we, they, he, she, it) + should not + V1\n\n\u27a1\ufe0f Soru c\xfcmleleri\nShould + subject (I, you, we, they, he, she, it) + V1 ?\nShouldn\u2019t + subject (I, you, we, they, he, she, it) + V1 ?\n\n\n\xd6rnek telaffuzlar\u0131:\n\n\ud83d\udd0a should,\n\ud83d\udd0a I\u2019d,\n\ud83d\udd0a should not,\n\ud83d\udd0a shouldn\u2019t\nAlt ba\u015fl\u0131klar halinde should yard\u0131mc\u0131 fiilinin kullan\u0131m\u0131 derlenmi\u015ftir:\n\n\u2b50 G\xf6rev, gereklilik ve tavsiye ifadelerinde kullan\u0131l\u0131r:\n\nYou shouldn\u2019t drink too much alcohol.\n\xc7ok fazla alkol i\xe7memelisiniz.\nA fox should not be on the jury at a goose\u2019s trial.\nBir kaz\u0131n duru\u015fmas\u0131nda bir tilki j\xfcride olmamal\u0131.\n\n\u2b50 Beklenti, ak\u0131l y\xfcr\xfctme ve tahmin c\xfcmlelerinde kullan\u0131l\u0131r:\n\nAnna should be finishing her work in an hour.\nAnna i\u015fini bir saat i\xe7inde bitirmesi gerekiyor.\nI\u2019ve worked hard, so I should pass my exam.\n\xc7ok \xe7al\u0131\u015ft\u0131m, bu y\xfczden s\u0131nav\u0131m\u0131 ge\xe7mem laz\u0131m.\n\n\u2b50 Ko\u015ful c\xfcmlelerinde olas\u0131l\u0131k zay\u0131fl\u0131\u011f\u0131n\u0131 ifade eder\n\n\nIf Europe should ever be ruined, it will be by its warriors.\nE\u011fer Avrupa bir g\xfcn mahvolacaksa, bu onun sava\u015f\xe7\u0131lar\u0131 taraf\u0131ndan olacakt\u0131r.\nShould you fail to operate the team, just give him a call.\nEkibi \xe7al\u0131\u015ft\u0131ramazsan, onu araman yeterli.\n\n\u2b50 Ge\xe7ici bir \xf6neri anlat\u0131mlar\u0131nda kullan\u0131l\u0131r:\n\nShould we perhaps stop watching TV now? The show is too bad.\nArt\u0131k televizyon izlemeyi b\u0131raksak m\u0131? G\xf6steri \xe7ok k\xf6t\xfc.\nIt\u2019s getting dark, I guess I should sleep.\nHava karar\u0131yor, san\u0131r\u0131m uyumal\u0131y\u0131m.\n\n\u2b50 Evrensel de\u011ferlerin ifade edilmesinde kullan\u0131l\u0131r:\n\nCrimes should be punished.\nSu\xe7lar cezaland\u0131r\u0131lmal\u0131d\u0131r.\nLaws should be Iike clothes. They should be made to fit the people they are meant to serve.\nKanunlar giysi gibi olmal\u0131. Hizmet etmeleri ama\xe7lanan insanlara uyacak \u015fekilde yap\u0131lmal\u0131d\u0131r.\n\n\u2b50 \u0130sim c\xfcmlelerinde kullan\u0131l\u0131r:\n\nI wonder why he should buy a car like that.\nNeden b\xf6yle bir araba almas\u0131 gerekti\u011fini merak ediyorum.\nI wonder why she should ask that stupid question.\nBu aptal soruyu neden sormas\u0131 gerekti\u011fini merak ediyorum.\n\n",null,B.u,null,null,null,null,null,null)
