B.Qr=new A.R("              \nT\u0131pk\u0131 T\xfcrk\xe7edeki gibi \u0130ngilizcede de \u015fimdiki zaman ve geni\u015f zaman kullanarak gelecek anlat\u0131m\u0131 yap\u0131labilmektedir.\n\nNas\u0131l ki T\xfcrk\xe7ede gelecek anlat\u0131mlar\u0131 yaparken bizzat gelecek zaman\u0131 kullanmak yerine \u015fimdiki zaman veya geni\u015f zamandan yararlan\u0131yorsak ana dili \u0130ngilizce olan ki\u015filer de gelecek hakk\u0131nda konu\u015furken gelecek zaman yerine geni\u015f zaman (simple present tense) ya da \u015fimdiki zaman (present continuous tense) yap\u0131s\u0131n\u0131 yayg\u0131n bir \u015fekilde kullan\u0131rlar.\n\nA\u015fa\u011f\u0131daki tabloda \u0130ngilizcede \u015fimdiki zaman ve geni\u015f zaman ile gelecek anlat\u0131m\u0131 ile alakal\u0131 \xf6rnek c\xfcmleler derlenmi\u015ftir:\n\nWhat are you doing at this weekend?\n\nBu hafta sonu ne yap\u0131yorsun?\n\nTomorrow I am going to the cinema.\n\nYar\u0131n sinemaya gidiyorum.\n\nJosh is visiting his parents this weekend.\n\nJosh bu hafta sonu ailesini ziyaret ediyor.\n\nI fly on July 1st.\n\n1 Temmuz\u2019da u\xe7uyorum.\n\nGelecekteki zaman anlat\u0131mlar\u0131nda kullan\u0131lan bu iki zaman aras\u0131nda ince bir fark vard\u0131r:\n\n\u2757 E\u011fer kendimiz gelecek hakk\u0131nda gelecek plan\u0131 yap\u0131yorsak \u015fimdiki zaman kullan\u0131r\u0131z.\n\nWe are meeting John and Brad at the restaurant tomorrow.\n\nYar\u0131n restoranda John ve Brad ile bulu\u015faca\u011f\u0131z.\n\n\u2757 Organize edilmi\u015f veya \xf6nceden planlanm\u0131\u015f eylemleri anlat\u0131rken ise geni\u015f zaman\u0131 kullan\u0131r\u0131z.\n\nMy flight leaves at 12:30 tomorrow.\n\nU\xe7a\u011f\u0131m yar\u0131n 12:30\u2019da kalk\u0131yor.\n\n",null,B.u,null,null,null,null,null,null)
B.fS=new A.R("Metni G\xf6r",null,null,null,null,null,null,null,null)
B.Qs=new A.R("              \nGenel olarak di\u011fer perfect modals yap\u0131lar\u0131 gibi ilgili kip belirtecinin \xf6n\xfcne have + past participle (V3) gelmesiyle anlat\u0131lan would + have + V3 kip belirteci Type 3 (Tip 3) olarak bilinen ko\u015ful t\xfcmceciklerinde s\u0131kl\u0131kla kullan\u0131l\u0131r.\n\n\u2795 Olumlu c\xfcmleler\nSubject (I, you, we, they, he, she, it) + would have V3\nSubject (I, you, we, they, he, she, it) + \u2018d have V3\n\n\u2796 Olumsuz c\xfcmleler\nSubject (I, you, we, they, he, she, it) + wouldn\u2019t have V3\nSubject (I, you, we, they, he, she, it) + would not have V3\n\n\u2753 Soru c\xfcmleleri\nWould have + subject (I, you, we, they, he, she, it) + V3?\nWouldn\u2019t have + subject (I, you, we, they, he, she, it) + V3?\n\n\n\xd6rnek telaffuzlar\u0131:\n\n\ud83d\udd0a would have,\n\ud83d\udd0a I\u2019d have,\n\ud83d\udd0a would not have,\n\ud83d\udd0a wouldn\u2019t have\n\u2757 would, silent l harfine sahiptir. Dikkatli dinlerseniz l harfinin telaffuz edilmedi\u011fini fark edeceksiniz.\n\nIf Messi had transferred to PSG, they would have won.\nMessi PSG\u2019ye transfer olsayd\u0131 kazan\u0131rd\u0131.\n\nIf she hadn\u2019t come here, everything would have been fine.\nBuraya gelmeseydi her \u015fey yoluna girecekti.\n\nIf the driver had been careful, the accident would not have happened.\n\u015eof\xf6r dikkatli olsayd\u0131 kaza olmayacakt\u0131.\n\nWouldn\u2019t she have gained weight if she had paid attention to her diet?\nBeslenmesine dikkat etseydi kilo almaz m\u0131yd\u0131?\n\nIf I were in her place, I wouldn\u2019t have dropped out of school.\nBen onun yerinde olsam okulu b\u0131rakmazd\u0131m.\n\nWe would have won if the player had not received a red card.\nOyuncu k\u0131rm\u0131z\u0131 kart g\xf6rmeseydi kazan\u0131rd\u0131k.\n\nShe would have called me if her phone hadn\u2019t broken.\nTelefonu bozulmasayd\u0131 beni arard\u0131.\n\nIf he had studied for the exam, he wouldn\u2019t have gotten a low grade.\nS\u0131nava \xe7al\u0131\u015fsayd\u0131, d\xfc\u015f\xfck not alamazd\u0131.\n\nHe wouldn\u2019t have been so bored if he hadn\u2019t seen her.\nOnu g\xf6rmeseydi bu kadar s\u0131k\u0131lmazd\u0131.\n\n",null,B.u,null,null,null,null,null,null)
B.Qt=new A.R("Gelecek Anlat\u0131mlar\u0131",null,null,null,null,null,null,null,null)
B.Qu=new A.R("Ten Steps",null,null,null,null,null,null,null,null)
B.Qv=new A.R("            \nJack and Lydia are on holiday in France with their friends, Mike and Anna.\n\nMike loves to visit historical buildings. Jack agrees to sightsee some historical buildings with him.\n\nLydia and Anna decide to shop in the city. \u201cSee you boys when we get back!\u201d the girls shout.\n\nIn the village Jack and Mike see a beautiful old church, but when they enter the church, a service is already in progress.\n\n\u201cShh! Just sit quietly, so that we don\u2019t stand out. And act like the others!\u201d Mike whispers.\n\nSince they don\u2019t really know French, Jack and Mike quietly sit down. During the service, they stand, kneel and sit to follow what the rest of the crowd do.\n\n\u201cI hope we blend in and don\u2019t look like tourists!\u201d Mike tells Jack.\n\nAt one point, the priest makes an announcement and the man who sits next to Jack and Mike stands up.\n\n\u201cWe should stand up, too!\u201d Jack whispers to Mike.\n\nSo, Jack and Mike stand up with the man. Suddenly, all the people burst into laughter!\n\nAfter the service, Jack and Mike approach the priest, who speaks English.\n\n\u201cWhat\u2019s so funny?\u201d Jack asks.\n\nWith a smile on his face the priest says, \u201cWell boys, there is a new baby born, and it\u2019s tradition to ask the father to stand up.\u201d\n\nJack and Mike look at each other and Mike shakes his head. He smiles and says, \u201cI guess we should understand what people do before we act like the others!\u201d\n            ",null,B.u,null,null,null,null,null,null)
